(22, 7, 0, 'Objective NCERT at your FINGERTIPS for NEET-AIIMS - Biology', 0, 'objective-ncert-at-your-fingertips-for-neet-aiims-biology', 2, 12, 1, 'MTG', 'India', 1, 1, 'shipped', 'upload/images/8580-2021-07-31.jpg', '', '<p>Objective NCERT at your Fingertips - Biology, is an unparalleled book to let you learn NCERT at your fingertips. This book is designed as per the fact that most of the questions asked in PMTs are from Biology NCERT books (11th and 12th). It gives chapter-wise, student-friendly synopses for quick-and-easy revision of important concepts, topic-wise MCQs aligned with NCERT content to check your progress, Huge variety of MCQs extracted and derived from NCERT textbooks, HOTS MCQs and figure-based MCQs to boost concepts, NCERT exemplar MCQs, Assertion and Reason questions are included for an edge in your AIIMS preparation and 6 Practice Papers are given for self-assessment. It possesses 100 MCQs chapter-wise in an average to guarantee the complete revision of NCERT Biology. This book also gives an advantage to gauze your progress with Preparation Meter. The New Revised Edition (2019) have HD Quality Multi-colored pages, Fingertips++ an exclusive access to 5 Online Mock Tests and few changes as per the new NCERT Syllabus. Content:- Class XI Chapters: The Living World Biological Classification Plant Kingdom Animal Kingdom Morphology of Flowering Plants Anatomy of Flowering Plants Structural Organization in Animals Cell: The Unit of Life Biomolecules Cell Cycle and Cell Division Transport in Plants Mineral Nutrition Photosynthesis in Higher Plants Respiration in Plants Plant Growth and Development Digestion and Absorption Breathing and Exchange of Gases Body Fluids and Circulation Excretory Products and their Elimination Locomotion and Movement Neural Control and Coordination Chemical Coordination and Integration Practice papers: 1. Practice Paper 1 2. Practice Paper 2 3. Practice Paper 3 Answer Key Class XII Chapters: Reproduction in Organisms Sexual Reproduction in Flowering Plants Human Reproduction Reproductive Health Principles of Inheritance and Variation Molecular Basis of Inheritance Evolution Human Health and Disease Strategies for Enhancement in Food Production Microbes in Human Welfare Biotechnology : Principles and Processes Biotechnology and Its Applications Organisms and Populations Ecosystem Biodiversity and Conservation Environmental Issues Practice papers: 1. Practice Paper 1 2. Practice Paper 2 3. Practice Paper 3 Answer Key</p>', 1, '2021-07-31 08:43:28', 1, 7, 'all', ''),
