(49, 11, 0, 'University Physics for JEE Mains and Advance | Vol 2 | Thirteenth Edition', 1, 'university-physics-for-jee-mains-and-advance-vol-2-thirteenth-edition', 2, 0, 1, 'Pearson Education; Thirteenth edition (25 March 2019)', 'INDIA', 1, 1, 'processed', 'upload/images/1217-2021-08-01.jpg', '', 'University Physics for the JEE, br>volume-i, is an Indian adaptation of the internationally-renowned bestseller \'University Physics with modern Physics by young Freedman and Ford\'. The Indian adaptation, modified as per the JEE syllabus, strives to meet the requirements of the students. This edition provides a perfect blend of theoretical clarity along with optimum number of examples and practice exercises. The authors, who have more than 35 years of cumulative teaching experience have tailored this book especially for JEE aspirants.', 1, '2021-08-01 09:39:36', 1, 7, 'all', ''),
(50, 11, 0, 'University Physics for JEE Mains and Advance | Vol 2 | Thirteenth Edition', 1, 'university-physics-for-jee-mains-and-advance-vol-2-thirteenth-edition-1', 2, 0, 1, 'Pearson Education; Thirteenth edition (25 March 2019)', 'INDIA', 1, 1, 'processed', 'upload/images/1724-2021-08-01.jpg', '', 'University Physics for the JEE, br>volume-i, is an Indian adaptation of the internationally-renowned bestseller \'University Physics with modern Physics by young Freedman and Ford\'. The Indian adaptation, modified as per the JEE syllabus, strives to meet the requirements of the students. This edition provides a perfect blend of theoretical clarity along with optimum number of examples and practice exercises. The authors, who have more than 35 years of cumulative teaching experience have tailored this book especially for JEE aspirants.', 1, '2021-08-01 09:39:39', 1, 7, 'all', ''),
(51, 14, 0, 'SKM Sir Organic Handwritten Notes for JEE', 1, 'skm-sir-organic-handwritten-notes-for-jee-1', 9, 0, 1, 'BooksBear', 'India', 1, 1, 'shipped', 'upload/images/8080-2021-08-01.png', '', '<p>Surendra Kumar Mishra (SKM) SIR teaching style makes him different than other organic chemistry teachers. They teach by telling a story whose main character is elements (i.e. hydrogen, oxygen, etc.) Mr. Surendra Kumar Mishra, a Co-founder, Director is extensively known as SKM Sir is a quintessence in the field of Organic Chemistry. He is also the author of the book, “Problems &amp; Solution of Organic Chemistry” for IIT mains and advanced. While teaching organic chemistry, he usually uses the unconventional way of teaching i.e. ‘Direct Instruction’ along with visual media, ChemDraw, and moly mod. Driven by his fascination for the subject and teaching, he makes his teachings interesting which leave the students mesmerized, He sermonizes his students to chase their dreams without compromising, which payed the way for Chitrang Murdia (AIR-1, IIT-JEE 2014) and Govind Lahoti (AIR-3, IIT-JEE 2014) to secure a position in IIT-JEE examination.</p>', 1, '2021-08-01 10:41:12', 1, 7, 'all', ''),
(52, 0, 0, 'Mathematics For Class 10 By R D Sharma', 0, 'mathematics-for-class-10-by-r-d-sharma-1', 2, 20, 0, 'R.D.SHARMA', 'INDIA', 1, 1, 'shipped', 'upload/images/4275-2021-08-02.jpg', '', '<p>RD SHARMA MATHEMATICS CLASS 10 DHANPAT RA</p>', 1, '2021-08-02 15:56:58', 2, 7, 'all', ''),
(53, 7, 0, 'Secondary School Mathematics For Class X( R S AGGARWAL, V AGGARWAL)', 0, 'secondary-school-mathematics-for-class-x-r-s-aggarwal-v-aggarwal', 2, 20, 1, 'Bhariti Bhawan', 'INDIA', 1, 1, 'shipped', 'upload/images/2300-2021-08-02.jpeg', '', '<p>This is a very good book. The format of this book is systematic and precise. There are a ample number of solved examples and practice. It have noticed that book has incorporated many previous years questions in its solved example section. The crisp theory makes it a better tool for last minute revisions during exams. There are sufficient numbers of 1 marker questions like mcq, fill in the blanks, assertion and reasoning etc etc but what it feel is this particularly section lacks consistansy i. e it variation is not similar in all in chapters. For example assertion and reasoning type is not there in all the chapters same with the case of true and false and mitch the following or fill in the blanks. But mcq is there all over. If we talk about comparison than it&#39;s direct rival is RD sharma mathematic book. Frankly speaking, using both the books for all most two years I&#39;ve come to know that this book is better, although RD sharma is also a great book but it lacks the possibility of complete solvability. So I will recommend and prefer RS Aggarwal.</p>', 1, '2021-08-02 16:06:58', 1, 7, 'all', ''),
