(62, 11, 0, 'Understanding Physics for JEE Main and Advanced Electricity and Magnetism [18th Edition]', 0, 'understanding-physics-for-jee-main-and-advanced-electricity-and-magnetism-18th-edition', 2, 1, 1, 'Arihant Publications; Eighteen edition (10 May 2021); Arihant Publications India Pvt. Ltd.', 'INDIA', 1, 1, 'processed', 'upload/images/2068-2021-08-03.jpg', '[\"../upload/other_images/1627999943.2833-678.jpg\"]', '\"1. Understanding Physics Series Comprises of Total 5 Books\r\n2. Total 36 Essential Chapters of Physics\r\n3. Volume 3 is Electricity and Magnetism Consists 6 Chapters\r\n4. Includes Last 6 Years Question of JEE Main & Advances\r\n5. One of the Most Preferred Textbook for IIT JEE\r\n6. Focused Study Material with Applications Solving Skills\r\n7. Includes New Pattern of Question from recent previous Exams\r\n\r\nIIT JEE has become a worldwide brand in the engineering institutions that has some of the best and brightest engineering students and career professionals. To make their way in this institution, every year lakhs of aspirants appear for IIT JEE Main and Advanced held by CBSE which tests the conceptual knowledge real-life application based problems on Physics, Chemistry, and Mathematics.\r\n\r\nArihant’s Understanding Physics is one of the best selling series of books in Physics, since its first edition for the preparation of JEE Entrance. The third volume of this series deals with Electricity and Magnetism providing the in-depth discussions on the Current Electricity, Capacitors, Magnetics, Electromagnetics Induction. Dividing the entire syllabus into 6 scoring Chapters, this book focuses on the concept building along with solidifying the problem-solving skills. It is a must have book for anyone who are desiring to be firm footed in the concepts of physics as well as their applications in problem solving.\r\n\r\nTOC\r\n\r\nCurrent Electricity, Electrostatics, Capacitors, Magnetics, Electromagnetics Induction, Altering Current, Hints & Solutions.\"', 1, '2021-08-03 14:12:23', 1, 7, 'all', ''),
(63, 11, 0, 'Understanding Physics for JEE Main and Advanced Optics and Modern Physics [18th Edition]', 0, 'understanding-physics-for-jee-main-and-advanced-optics-and-modern-physics-18th-edition', 2, 0, 1, 'Arihant Publications; Eighteen edition (10 May 2021); Arihant Publications India Pvt. Ltd.', 'INDIA', 1, 1, 'processed', 'upload/images/8771-2021-08-03.jpg', '[\"../upload/other_images/1628000202.0428-846.jpg\"]', '1. Understanding Physics Series Comprises of Total 5 Books\r\n\r\n2. Total 36 Essential Chapters of Physics\r\n\r\n3. Volume 5 is OPTICS AND MODERN PHYSICS Consists 6 Chapters\r\n\r\n4. One of the Most Preferred Textbook for IIT JEE\r\n\r\n5. Focused Study Material with Applications Solving Skills\r\n\r\n6. Includes New Pattern of Question from recent previous Exams\r\n\r\nJEE Main & Advanced is not just a premier Engineering Institute in India, it has become a brand Worldwide for Its academic excellence. IIT JEE is home to some of the best and brightest Engineering students and Career professional. It’s a dream for every aspirant with Science stream in class 12th. With such aspiration comes the even greater competition. Every year lakhs of aspirants appear for JEE Main & Advanced examination held by CBSE.\r\n\r\n\r\n\r\nArihant Understanding Physics Series is considered as one of the Most trusted and Helpful textbooks for preparing Physics for JEE. Authored by renowned by D C Pandey the bestselling series has been divided in 6 important Topics.\r\n\r\n\r\n\r\nThe Fifth of the Series Optics and Modern Physics is based on the foundation of Mechanics, written in effective and easy to understandable way to build you foundation for vast understanding. In the beginning Author has also discussed basic Maths and system of measurement in Physics. The Core focus of the book has been kept around building concept around topics like Electromagnetic Waves, Reflection of Light, Refraction of Light, and more. Current Edition like every previous one brings the best way to learn applying the concept while solving numerical.\r\n\r\n\r\n\r\nA Must have Textbooks for developing Laws of Physics in a firm footed way and its application in day to day life as well for academic purpose.\r\n\r\n\r\nTABLE OF CONTENT\r\n\r\n\r\nElectromagnetic Waves, Reflection of Light, Refraction of Light, Interference and Diffraction of Light, Modern Physics-I, Modern Physics-II, Semiconductors, Communication System, Hints & Solutions\"', 1, '2021-08-03 14:16:42', 1, 7, 'all', ''),
(64, 11, 0, 'Understanding Physics for JEE Main and Advanced Waves and Thermodynamics [19th Edition]', 0, 'understanding-physics-for-jee-main-and-advanced-waves-and-thermodynamics-19th-edition', 2, 0, 1, 'Arihant Publications; Ninteen edition (10 May 2021); Arihant Publications India Pvt. Ltd.', 'INDIA', 1, 1, 'processed', 'upload/images/2361-2021-08-03.jpg', '[\"../upload/other_images/1628000643.025-761.jpg\"]', '\"1. Understanding Physics Series Comprises of Total 5 Books\r\n2. Total 36 Waves and Thermodynamics of Physics\r\n3. Volume 4 is Electricity and Magnetism Consists 6 Chapters\r\n4. Includes Last 6 Years Question of JEE Main & Advances\r\n5. One of the Most Preferred Textbook for IIT JEE\r\n6. Focused Study Material with Applications Solving Skills\r\n7. Includes New Pattern of Question from recent previous Exams\r\n\r\nIIT JEE has become a worldwide brand in the engineering institutions that has some of the best and brightest engineering students and career professionals. To make their way in this institution, every year lakhs of aspirants appear for IIT JEE Main and Advanced held by CBSE which tests the conceptual knowledge real-life application based problems on Physics, Chemistry, and Mathematics.\r\n\r\nArihant’s Understanding Physics is one of the best selling series of books in Physics, since its first edition for the preparation of JEE Entrance. The fourth volume of this series deals with Waves and Thermodynamics providing the in-depth discussions on the Wave Motion, Thermometry, Thermal Expansion & Kinetic Theory, Calorimetry and Heat Transfer. Dividing the entire syllabus into 6 scoring Chapters, this book focuses on the concept building along with solidifying the problem-solving skills. It is a must have book for anyone who are desiring to be firm footed in the concepts of physics as well as their applications in problem solving.\r\n\r\nTOC\r\n\r\nWave Motion, Superposition of Waves, Sound Waves, Thermometry, Thermal Expansion & Kinetic Theory, Laws of Thermodynamics, Calorimetry and Heat Transfer, Hints & Solutions.\"', 1, '2021-08-03 14:24:03', 1, 7, 'all', '');
