tation, Mechanical Properties of Solids, Mechanical Properties of fluids, thermal properties of Matter, Thermo dynamics, Kinetic Theory, Oscillations, waves, Periodic tests, activities, case study based Questions, 5 Sample questions.</p>', 1, '2021-08-03 17:20:39', 1, 7, 'all', ''),
(81, 15, 0, 'Pradeep\'s A Text Book of Biology for Class 11 (Set of 2 Vol.)', 0, 'pradeep-s-a-text-book-of-biology-for-class-11-set-of-2-vol-1', 2, 12, 1, 'Pradeep Publications', 'India', 1, 1, 'shipped', 'upload/images/7542-2021-08-03.jpg', '', '<p>Senior Secondary Class is essentially a career–making Class, and Science is the most sought-after course at this level for pursuing the ambitious career of a doctor, an engineer, a scientist, a research scholar etc. For realizing his dream, a student has to perform exceptionally well in this class. It is thus utmost important that all Science books – Physics, Chemistry, Biology and Mathematics for this class are designed in a way to give complete knowledge of these subjects in the most presentable manner. Pradeep’s books are the only books meeting this requirement in the most innovative way for more than 30 years. Whether Physics or Chemistry or Biology or Mathematics, The books are being updated with knowledge every year, and presented in the most acceptable &amp; interesting manner. This is why pradeep’s books are no.1 selling books in the country.</p>', 1, '2021-08-03 17:29:58', 1, 7, 'all', ''),
(82, 15, 0, 'CBSE BIOLOGY Simplified NCERT Class 11', 0, 'cbse-biology-simplified-ncert-class-11-1', 2, 0, 1, 'Arihant', 'India', 1, 1, 'shipped', 'upload/images/5157-2021-08-03.jpg', '', '<p>1. Comprises of well elaborated 22 Chapters.<br />\r\n2. comprehend theories with full clarity<br />\r\n3. reinforces the ability to answer the concept – based problems<br />\r\n4. highly approachable that helps to gain mastery over the subject<br />\r\n5. Includes new pattern and syllabus</p>\r\n\r\n<p>The study of NCERT helps students greatly in various competitive and entrance exams. For prestigious IIT JEE and NEET, NCERT books are all you need to strengthen the fundamentals of the subjects. But students often face problem in understanding the concepts which is why they fail to succeed.To facilitate an easy learning, Doctor Dilip Gangwar who is known throughout the country for his ‘Art of Teaching Biology’ conceived an idea of bringing out a comprehensive book written in a highly simplistic manner and supported by all the possible elements to enhance the conceptual clarity.</p>\r\n\r\n<p>Biology Simplified NCERT for class XI is a newly designed book by him which is based on the latest exam pattern and syllabus of NEET UG/AIIMS. It has 22 chapters written in an easy-to-digest manner which qualifies aspirants to comprehend theories with full clarity and reinforces their ability to answer the concept-based problems intellectually. Aimed at easing the study level of NCERT, this book is highly approachable and ensures to help you gain mastery over the subject.</p>\r\n\r\n<p>Table of Contents</p>\r\n\r\n<p>The Living World, Biological Classification, Plant Kingdom, Animal Kingdom, Morphology of Flowering Plants, Anatomy of Flowering Plants, Structural Organisation in Animals, Cell: The Unit of Life,Biomolecules, Cell Cycle and Cell Division, Transport in Plants, Mineral Nutrition, Photosynthesis in Higher Plants, Respiration in Plants, Plant Growth and Development, Digestion and Absorption,Breathing and Exchange of Gases, Body Fluids and Circulation, Excretory Products and their Eliminations,<br />\r\nLocomotion and Movement, Neural Control and Coordination, Chemical Coordination and Integration\"</p>', 1, '2021-08-03 17:34:01', 1, 7, 'all', ''),
(83, 15, 0, 'NCERT Text Book + Exemplar Problems - Solutions Biology Class 11', 0, 'ncert-text-book-exemplar-problems-solutions-biology-class-11', 2, 0, 1, 'MTG', 'India', 1, 1, 'shipped', 'upload/images/2579-2021-08-03.jpg', '', '<p>Mtg’s NCERT Textbook + Exemplar Problem solutions- Biology is an excellent book designed to provide a comprehensive guide to NCERT Textbook and NCERT Exemplar problems of Biology for Class XI students. This book provides a detailed explanation to all subjective and objective type questions given in both NCERT Textbook and NCERT Exemplar problems book. This is an error free and ‘Self-study’ book to master the concepts in Biology. This book aims to give the best solutions and help the students to score high in school examinations as well as to build a strong foundation for Olympiads and competitive exams like NEET &amp; PMTs. Content: 1. The living World 2. Biological classification 3. Plant kingdom 4. Animal kingdom 5. Morphology of Flowering Plants 6. Anatomy of Flowering Plants 7. Structural organisation in Animals 8. Cell: the br&gt;Unit of life 9. Biomolecules 10. Cell Cycle and Cell Division 11. Transport in Plants 12. Mineral Nutrition 13. Photosynthesis in higher plants 14. Respiration in Plants 15. Plant Growth and development 16. Digestion and Absorption 17. Breathing and Exchange of Gases 18. Body fluids and circulation 19. Excretory products and Their elimination 20. Locomotion and movement 21. Neural control and Coordination 22. Chemical coordination and integration.</p>', 1, '2021-08-03 17:40:36', 1, 7, 'all', ''),
