 their thinking and learning abilities.</p>\r\n\r\n<p>As the book has been designed strictly according to the NCERT Textbook of Mathematics for Class XI and contains simplified text material in the form of class room notes and answers to all the questions in lucid language, it for sure will help the Class XI students in an effective way for Mathematics.</p>', 1, '2021-08-04 07:59:27', 1, 7, 'all', ''),
