(101, 15, 0, 'NCERT Text Book + Exemplar Problems - Solutions Mathematics Class 11', 0, 'solutions-mathematics-class-11-1', 2, 0, 1, 'MTG', 'India', 1, 1, 'shipped', 'upload/images/9259-2021-08-04.jpg', '', '<p>MTG’s NCERT Textbook + Exemplar problem solutions - Mathematics is an excellent book designed to provide a comprehensive guide to NCERT textbook and NCERT exemplar problems of mathematics for class XI students. This book provides a detailed explanation to all subjective and objective type questions given in both NCERT textbook and NCERT exemplar problems book. This is an error free and ‘Self-study’ book to master the concepts in mathematics.<br />\r\nThis book aims to give the best solutions and help the students to score high in school examinations as well as to build a strong foundation for Olympiads and competitive exams like PETs.</p>', 1, '2021-08-04 08:02:39', 1, 7, 'all', ''),
