(105, 15, 0, 'All In One Mathematics Class 11', 0, 'all-in-one-mathematics-class-11-2', 2, 0, 1, 'Arihant', 'India', 1, 1, 'shipped', 'upload/images/2977-2021-08-04.jpg', '', '<p>1. ‘All in One’ - best selling series form Class 6th -12th<br />\r\n2. Covers complete theory, practice and assessment of Mathematics for Class 11<br />\r\n3. The guide has been divided into 16 Chapters giving coverage to the syllabus<br />\r\n4. Each Chapter is supported by detailed theory, illustrations, all types of questions<br />\r\n5. Every topic covers NCERT Questions, NCERT Exemplar Questions, Model Papers for complete practice<br />\r\n6. Every Chapter accompanies Summary and Chapter Practice for quick revision<br />\r\n7. Periodic Tests, Activities, Case Study Based Questions, 3 Sample Questions for complete assessment.</p>\r\n\r\n<p>Arihant’s All in One needs no introduction, the best selling academic series that is prepared to provide Complete Study, Practice &amp; Assessment to ensure better learning.</p>\r\n\r\n<p>With the current edition of “All in One – Mathematics for Class 11” that is designed on the exact lines of the latest syllabus prescribed by the CBSE board. The entire book is categorized under 16 Chapters. Each topic is well supported by detailed theories, illustrations and Numerical Questions providing Complete Study Guidance. For Complete Practice, every topic covers NCERT Questions, NCERT Exemplar Questions and other important questions from an exam point of view. 5 Model Papers are provided as per latest Syllabus and Pattern. Chapter Practice is accompanied after every chapter for quick revision. , Periodic Tests, Activities, Case Study Based Questions, 3 Sample Questions are all supplemented to provide Complete Assessment. Serving as the Self – Study Guide it provides all the explanations and guidance that is needed to study efficiently and succeed in the exam.</p>\r\n\r\n<p>TOC</p>\r\n\r\n<p>Sets, Relations &amp; Functions, Trigonometric Functions, Principle of Mathematical Induction, Complex Numbers, Linear Inequalities, Permutations and Combinations, Binomial Theorem, Sequences and Series, Straight Lines, Conic Sections, Introduction to Three Dimensional Geometry, Limits and Derivatives, Mathematical Reasoning, Statistics, Probability, Periodic Tests, Activities, Case Study Based Questions, 3 Sample Questions.\"</p>', 1, '2021-08-04 08:34:17', 1, 7, 'all', '');
