(108, 7, 0, 'Principles of Management  (English, Paperback, Tripathi P.C.)', 0, 'principles-of-management-english-paperback-tripathi-p-c-1', 2, 15, 1, 'Plot No -6, Ground Floor Khasra No-40, Satbari, Chattarpur, New Delhi -110074 NEW DELHI 110074', 'INDIA', 1, 1, 'shipped', 'upload/images/2167-2021-08-04.jpeg', '', '<p>This is one of the best books on management. Highly recommended for students of all the universities. The topics are crisp and to the point. Easy to comprehend. Go for it.</p>', 1, '2021-08-04 14:10:06', 1, 7, 'all', ''),
(109, 7, 0, 'Organizational Behaviour  (English, Paperback, Robbins Stephen P.)', 0, 'organizational-behaviour-english-paperback-robbins-stephen-p-1', 2, 15, 1, 'Pearson Education India', 'INDIA', 1, 1, 'shipped', 'upload/images/9994-2021-08-04.jpeg', '', '<p>Long considered the standard for all organizational behavior textbooks, the Eighteenth Edition continues its tradition of making current, relevant research available to students in the language that they understand. While maintaining its hallmark features-clear writing style, cutting-edge content, and engaging pedagogy-Organizational Behavior, 18e has been updated to reflect the most recent research within the field of organizational behavior. In addition to comprehensive and thorough revisions of the core material, this edition reflects important research and topical issues facing organizations, managers, and employees. Examples from Indian organizations are added to make it relevant to the readers.</p>', 1, '2021-08-04 14:13:18', 1, 7, 'all', ''),
(110, 7, 0, 'S. CHANDS ADVANCED OBJECTIVE GENERAL KNOWLEDGE REVISED EDITION  (English, Paperback, R.S. Aggarwal)', 0, 's-chands-advanced-objective-general-knowledge-revised-edition-english-paperback-r-s-aggarwal-1', 2, 16, 1, 'R.S. Aggarwal', 'INDIA', 1, 1, 'shipped', 'upload/images/0158-2021-08-04.jpeg', '', '<p> </p>\r\n\r\n<p>Over the years, Objective General Knowledge has been an indispensable book for the aspirants of different competitive examinations. Its popularity among its readers has never ebbed despite the presence of so many competing books from other publishers. To ensure this book retains the place of âfirst choiceâ among the readers, it has been revised in accordance with the current pattern and trends in various competitive examinations. Original questions (based on memory) from exams like SSC-SI, RBI-Officers Grade, State Services Examinations, Banking, CDS, Indian Railways and several others have been added in different sections of the bookâGeneral Science, History, Indian Polity, Economics, Geography and General Awareness.</p>', 1, '2021-08-04 14:17:38', 1, 7, 'all', ''),
(292, 17, 0, 'Xam Idea class 10th Social science (sst)', 0, 'xam-idea-class-10th-social-science-sst', 38, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/7193-2021-09-03.jpg', '[\"upload/other_images/1630643553.4302-827.jpg\"]', '<p>Xam Idea Social science </p>\r\n\r\n<p>Complete Class X </p>\r\n\r\n<p>2019-2020 edition </p>', 1, '2021-09-03 04:32:33', 1, 7, 'all', ''),
(111, 14, 0, 'Prakash Ojha (PO) Sir Organic Chemistry Notes', 0, 'prakash-ojha-po-sir-organic-chemistry-notes', 9, 0, 1, '', '', 1, 1, 'shipped', 'upload/images/2066-2021-08-04.png', '', 'These Notes are accurate & upto the syllabus of JEE Exam. The handwriting is neat & beautiful and the pages are clean & black & white high grayscale.\r\n\r\nAbout the Author:\r\nPO Sir (Mr.Prakash Kumar Ojha )is B.Tech and M.Tech from IIT Mumbai. He is Chemistry Guru for JEE Mains & Advanced with 15 Years of Teaching experience as Sr. faculty. His exclusive approach and unmatchable teaching style have made him famous amongst students.', 1, '2021-08-04 17:54:17', 1, 7, 'all', ''),
(112, 14, 0, 'Paul Sir Organic Handwritten Notes for JEE', 0, 'paul-sir-organic-handwritten-notes-for-jee', 9, 0, 1, '', '', 1, 1, 'shipped', 'upload/images/6307-2021-08-04.png', '', 'RAMASHISH PAUL  SIR is very renowned in the filed of organic chemistry and his notes are very popular among JEE & NEET students.\r\n\r\nThese notes are :\r\nBlack & White\r\nAccurate to topic\r\nNeat\r\nClean & beautiful handwriting\r\nExam based.', 1, '2021-08-04 18:00:32', 1, 7, 'all', ''),
(113, 14, 0, 'MS Chauhan Sir Organic Handwritten Notes for JEE', 0, 'ms-chauhan-sir-organic-handwritten-notes-for-jee', 9, 0, 1, '', '', 1, 1, 'shipped', 'upload/images/6422-2021-08-04.png', '', 'An all-rounder Mr. Mahendra Singh Chouhan (MS Chauhan) is a co-founder, Director, and HOD of Organic Chemistry. He is a renowned name in the field of IIT-JEE preparation for the last 17 years. His dedication and passion for teaching reflect the results of the students who are aiming for IIT JEE. His core knowledge of the subject assists them to achieve their targets. He is a profound author too.\r\n\r\nHe has written,\r\n\r\nAdvanced problems in Organic Chemistry for JEE\r\nSolomon’s-Organic chemistry for JEE (Main & Advanced)\r\nAdvance Theory in Organic Chemistry\r\nAdvance test paper & Solution of Organic chemistry\r\nElementary Problems in Organic chemistry for NEET/AIIMS', 1, '2021-08-04 18:12:38', 1, 7, 'all', ''),
(114, 14, 0, 'SR Sir Organic Handwritten Notes Class XII', 0, 'sr-sir-organic-handwritten-notes-class-xii', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/7110-2021-08-04.png', '', 'He is the author of “GRB Questions Bank For Organic Chemistry” for JEE (Mains & Advanced). He is a master teacher who fathoms the challenges faced by those who prepare for the IIT-JEE and has customized fundamentals of organic chemistry in his book to meet students’ requirements.', 1, '2021-08-04 18:26:23', 1, 7, 'all', ''),
(115, 14, 0, 'Akshay Choudhary (AC) Sir Organic Handwritten Notes for JEE', 0, 'akshay-choudhary-ac-sir-organic-handwritten-notes-for-jee', 9, 0, 1, '', '', 1, 1, 'shipped', 'upload/images/2988-2021-08-05.png', '', 'Akshay Choudhary, a renowned faculty of organic chemistry, teaches IIT-JEE aspirants, assisting them to achieve their goal. Many students have been successful under his guidance and achieved top ranks in the IIT-JEE exam. The author is a postgraduate in chemistry as well as Junior Research Fellow from NCL, Pune.\r\n\r\nHe has a keen interest in the subject and strives to presênt it to students in a lucid style to help them ace the exams effortlessly.', 1, '2021-08-04 18:34:32', 1, 7, 'all', ''),
(116, 14, 0, 'SJ Sir Inorganic Chemistry Notes for JEE', 0, 'sj-sir-inorganic-chemistry-notes-for-jee', 9, 0, 1, '', '', 1, 1, 'shipped', 'upload/images/6673-2021-08-05.png', '', 'Making good Notes is an art, but finding good notes is even better, it’s smart. We have done all the hard work for you by creating JEE Toppers Notes, a collection of best notes on JEE written by previous year JEE toppers. What separates a topper from an average student is the ability to study smart and not only hard. They create their notes highlighting the concepts which should be focused on during the first read and later, marking key takeaways for each chapter. What makes handwritten notes so valuable is the fact that.\r\n\r\nThe flow of the notes matches the way a topic is taught in the class by an expert teacher. Contains solved problems on the most important and most asked concepts. Made by toppers and taught by subject experts, which makes these notes a perfect learning tool to gain benefits from.', 1, '2021-08-04 18:40:24', 1, 7, 'all', ''),
(117, 14, 0, 'VKJ Sir Inorganic Chemistry Notes for JEE', 0, 'vkj-sir-inorganic-chemistry-notes-for-jee', 9, 0, 1, '', '', 1, 1, 'shipped', 'upload/images/4737-2021-08-05.png', '', 'Endowed with a very pleasant personality Mr. Vimal Kumar Jaiswal is a Co-founder, Director, and HOD of Inorganic Chemistry. He completed a Master’s degree in Chemistry and Mass Communication in Science and Technology from Lucknow University. He has been a part and parcel of this unique profession for the last 19 years. He consistently provides effective education with a smile, so as to derive maximum from the aspirants. His efforts are commendable.\r\n\r\nHe is an academician who provides systematic theory and practice of inorganic chemistry to solve various problems. He is also the author of “Problems in Inorganic Chemistry” & “Problems in Inorganic Chemistry for NEET/AIIMS”.', 1, '2021-08-04 18:45:01', 1, 7, '', ''),
(118, 14, 0, 'VJ Sir Inorganic Chemistry Notes for JEE', 0, 'vj-sir-inorganic-chemistry-notes-for-jee', 9, 0, 1, '', '', 1, 1, 'shipped', 'upload/images/0571-2021-08-05.png', '', 'Mr. Vishal Joshi, Co-founder, and Director are known as the wizard of Inorganic Chemistry. He is the author of “Problems and Solutions in Inorganic Chemistry” for JEE (Mains & Advanced). He is a master teacher who fathoms the challenges faced by those who prepare for the IIT-JEE and has customized fundamentals of inorganic chemistry in his book to meet students’ requirements.\r\n\r\nStudents address him as “THE GOD OF INORGANIC CHEMISTRY”. Possessing good motivational skills, he has been inspiring a lot of students to prosper in the preparation journey of JEE. Chitrang Murdia (AIR-1, IIT-JEE 2014), Govind Lahoti (AIR-3, IIT-JEE 2014) have been mentored and guided by him. Not only this he has produced ICHO Toppers.', 1, '2021-08-05 05:39:03', 1, 7, 'all', ''),
(119, 14, 0, 'Kapil Wadhwa (KW) Sir Inorganic Chemistry Notes for JEE', 0, 'kapil-wadhwa-kw-sir-inorganic-chemistry-notes-for-jee', 9, 0, 1, '', '', 1, 1, 'shipped', 'upload/images/5456-2021-08-05.png', '', 'He is the author of “Advanced Problems in Inorganic Chemistry” for JEE (Mains & Advanced). He is a master teacher who fathoms the challenges faced by those who prepare for the IIT-JEE and has customized fundamentals of inorganic chemistry in his book to meet students’ requirements.', 1, '2021-08-05 05:41:12', 1, 7, 'all', ''),
(120, 14, 0, 'Jitender Hirwani (JH) Sir Inorganic Chemistry Notes for JEE', 0, 'jitender-hirwani-jh-sir-inorganic-chemistry-notes-for-jee', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/6110-2021-08-05.png', '', 'JH Sir is known for his simplified Chemistry teaching techniques and students have fondly coined JH Sir as ‘HIRWANI DEVELOPED FAST CALCULATION (H.D.F.C) and renamed him as JARA HATKE(J.H. SIR).Learn Inorganic Chemistry with one of best faculty of Kota Jitendra Hirwani Sir. (J.H Sir) Jitendra Hirwani (J.H.Sir), a B.Tech in Mining Engineering from IIT Kharagpur (IIT-KGP) in 2001, has been a Chemistry mentor for IIT JEE Chemistry since 2001. In this long Journey of his career, he was associated with several premier institutes like Bansal Classes-Kota, Resonance-Kota, Career Point, Narayana, Gupta Tutorial-Indore, etc.', 1, '2021-08-05 05:50:14', 1, 7, 'all', ''),
