(274, 11, 0, 'Physics Topic-Wise & Chapter-Wise Dpp', 0, 'wise-chapter', 2, 12, 1, 'DISHA', 'INDIA', 1, 1, 'shipped', 'upload/images/5943-2021-08-29.jpg', '', '<p>These is the best book for practise as in any competitive exam daily practise is most important after buying you syrley love it and it will greatly help you<br />\r\nThe book “Biology Topic-wise and Chapter-wise Daily Practice Problem (DPP) Sheets for NEET 3rd Edition” is precise, apt and tuned to all the requirements of a NEET aspirant.<br />\r\nThe DPP Sheets contains:<br />\r\n1. Well Crafted collection of questions. The book is divided into 2 parts - Topic-wise DPP followed by Chapter-wise DPP Sheets.<br />\r\n2. Part A Sheets divides the complete NEET Biology syllabus into 60 most important Topics. Each chapter has been broken into 2 or more topics.<br />\r\n3. Part B provides 38 Chapter-wise DPPs based on the NCERT.<br />\r\n4. Time Limit, Maximum Marks, Cut-off, Qualifying Score for each DPP Sheet is provided.<br />\r\n5. These sheets will act as an Ultimate tool for Concept Checking and Speed Building.<br />\r\n6. Collection of 3500+ MCQ’s .<br />\r\n7. Covers all important Concepts of each Topic</p>', 1, '2021-08-29 17:11:47', 1, 7, 'all', ''),
(123, 14, 0, 'Jitender Hirwani (JH) Sir Physical Chemistry Notes for JEE', 0, 'jitender-hirwani-jh-sir-physical-chemistry-notes-for-jee', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/2114-2021-08-05.png', '', 'JH Sir is known for his simplified Chemistry teaching techniques and students have fondly coined JH Sir as ‘HIRWANI DEVELOPED FAST CALCULATION (H.D.F.C) and renamed him as JARA HATKE(J.H. SIR).Learn Inorganic Chemistry with one of best faculty of Kota Jitendra Hirwani Sir. (J.H Sir) Jitendra Hirwani (J.H.Sir), a B.Tech in Mining Engineering from IIT Kharagpur (IIT-KGP) in 2001, has been a Chemistry mentor for IIT JEE Chemistry since 2001. In this long Journey of his career, he was associated with several premier institutes like Bansal Classes-Kota, Resonance-Kota, Career Point, Narayana, Gupta Tutorial-Indore, etc.', 1, '2021-08-05 13:07:15', 1, 7, 'all', ''),
(124, 14, 0, 'AKK Sir Physical Chemistry Notes for JEE', 0, 'akk-sir-physical-chemistry-notes-for-jee', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/4206-2021-08-05.png', '', 'Mr. Akhilesh Kanther, Co-founder and Director is the best faculty of Physical Chemistry in India. He is an alumni of IIT-BHU. His organized teaching methodology makes students interested in the subject to understand the complexities of physical chemistry.\r\n\r\nHis decent and sober behavior “which also reflects in his teaching”, attracts students. After mentoring Chitrang Murdia (AIR-1, IIT-JEE 2014) and Govind Lahoti (AIR-3, IIT-JEE 2014), he has been guiding a lot of students to get through JEE. AKK Sir is the best in the physical chemistry field.', 1, '2021-08-05 13:09:57', 1, 7, 'all', ''),
(125, 14, 0, 'Narendra Awasthi (NA) Sir Physical Chemistry Notes', 0, 'narendra-awasthi-na-sir-physical-chemistry-notes', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/5682-2021-08-05.png', '', 'A true visionary Mr. Narendra Avasthi is a Co-founder, Director, and HOD of Physical Chemistry. He completed his graduation from NIT Jaipur in Chemical Engineering and Post graduation course in Advanced Computing designed and developed by ACTS(Pune). He is addressed as Sodium Sir by his students lovingly. A force to reckon with in his chosen field, he has been serving the cause of education for the past 17 years.\r\n\r\nAfter years of experience, he has written books on Chemistry. “Problems in Physical Chemistry” and “Problems in Physical Chemistry for NEET/AIIMS”. He inspires the aspirants of IIT-JEE to work hard and put their heart and soul into it.\r\n\r\nHe is a living example of what he preaches. He became “Half Ironman” by participating in Triathlon and also a Marathon runner, recently completed Full Marathon at Leh(Ladakh) under sub-normal circumstances. Thus, he proved everything and anything can be achieved through hard work, dedication, and sustained efforts.', 1, '2021-08-05 13:13:17', 1, 7, 'all', ''),
(126, 14, 0, 'Neeraj Kumar (NK) Sir Physical Chemistry Notes for JEE', 0, 'neeraj-kumar-nk-sir-physical-chemistry-notes-for-jee', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/8908-2021-08-05.png', '', 'Neeraj Kumar is a civil engineer from Bihar College of Engineering, Patna (Now NIT, Patna). He has been teaching IIT-JEE aspirants since 1992. He established Neeru’s Chemistry Arena at Musallahpur Hat, Patna. He worked for several other coaching institutes since 2002. Presently, he is working as the Head of the Department of Physical and Inorganic Chemistry in a renowned institute. The author strongly believes that cracking any competitive examination demands theoretical knowledge though the current trends of IIT-JEE support the theoretical and Analytical approach.\r\n\r\nNeeraj Kumar has written a good number of books for IIT-JEE as well as for the school curriculum. He has also co-authored a few books and contributed papers in reputed educational magazines such as Chemistry Patron and Junior Science Refresher', 1, '2021-08-05 13:15:03', 1, 7, 'all', ''),
