(129, 15, 0, 'Xam Idea Physics -Class 12', 0, 'class-12', 2, 0, 1, 'Editorial Board', 'India', 1, 1, 'shipped', 'upload/images/7524-2021-08-05.jpg', '', '<p>The book has been designed topic and subtopic-wise, keeping the students’ needs in mind. The current edition has certain unique features:</p>\r\n\r\n<p>Each chapter starts with a To Do list. It gives the central idea of the chapter and the way it has been addressed.</p>\r\n\r\n<p>Each chapter is divided into several sections corresponding to different components of the syllabus.</p>\r\n\r\n<p>Each chapter is splashed with HOTS. This is to promote clarity of the basics.</p>\r\n\r\n<p>Focus Zones in each chapter present a crux of the concepts.</p>\r\n\r\n<p>Blocks in each chapter include matter of special significance.</p>\r\n\r\n<p>Power Points and Revision Window offer a quick glance of the subject matter.</p>\r\n\r\n<p>‘Exercise’ is tuned to the pattern of examination. Answers to important questions focus on the technique of writing. The exercise includes:</p>\r\n\r\n<p>objective type questions (remembering &amp; understanding based questions), divided into five sections:</p>\r\n\r\n<p>(a) multiple choice questions, (b) fill in the blanks, (c) true or false, (d) matching the correct statements, (e) ‘very short answer’</p>\r\n\r\n<p>objective type questions</p>\r\n\r\n<p>reason-based questions</p>\r\n\r\n<p>HOTS &amp; applications</p>\r\n\r\n<p>analysis &amp; evaluation</p>\r\n\r\n<p>CBSE questions (with answers or reference to the text for answers)</p>\r\n\r\n<p>NCERT questions (with hints to answers)</p>\r\n\r\n<p>miscellaneous and add-on questions (with hints or reference to the text for answers)</p>\r\n\r\n<p>Dos and Don’ts (at the end of each chapter) should serve as a safeguard against misinterpretation of the concepts.</p>\r\n\r\n<p>Ability Zone is a uniquely designed section at the end of the chapter. This raises the difficulty level, of course, but should serve as a useful material for the outstanding learners.</p>\r\n\r\n<p>Solved &amp; Unsolved numericals are given to boost a grip on the subject.</p>', 1, '2021-08-05 15:44:17', 1, 7, 'all', ''),
