lane, Laws of Motion, Work, Power and Energy, System of Particles and Rotational Motion, Gravitation, Mechanical Properties of Solids, Mechanical Properties of Fluids, Thermal Properties of Matter, Thermo Dynamics, Kinetic Theory, Oscillations, Waves, Periodic Tests, Activities, Case Study Based Questions, 5 Sample Questions.\"</p>', 1, '2021-08-05 17:55:02', 1, 7, 'all', ''),
