(137, 11, 0, '40 Years’ Chapterwise Topicwise Solved Papers (2018-1979) IIT JEE MathematicsPaperback – 1 January 2018', 0, '40-years-chapterwise-topicwise-solved-papers-2018-1979-iit-jee-mathematicspaperback-1-january-2018', 8, 0, 1, '', 'INDIA', 1, 1, 'processed', 'upload/images/1647-2021-08-06.jpg', '[\"../upload/other_images/1628248063.7949-519.jpg\"]', 'IIT-JEE (Joint Entrance Examination) is an All India Level Engineering Entrance Exam conducted in two screening levels i.e., Mains followed by Advanced for admission to undergraduate courses like B.Tech, B.E., B.Planning and B.Arch in 23 renowned Indian Institutes of Technology (IIT). The given book titled “40 Years’ Chapterwise Topicswise Solved Papers” of Mathematics has been revised for bringing the abundant knowledge of the subject based on the nature of both the exams to the students. The best part about this Two-in-One book is that it comes with ample amount of solved papers of Mains as well as Advanced from last 40 Years’ Questions (1979 to 2018) and not only covers the entire concepts Chapterwise but topicwise too. In this book, students will find 26 chapters along with JEE Main & Advanced Solved Papers of 2018 which is going to help them in a large manner for the forthcoming exam. As efficient as possible and as supplemented as required, this book is one of the very few genuine sources to help leading dual success in IIT-JEE 2019. Table of Contents Complex Numbers, Theory of Equations, Sequences and Series, Permutations and Combinations, Binomial Theorem, Probability, Matrices and Determinants, Functions, Limit, Continuity and Differentiability, Application of Derivatives, Indefinite Integration, Definite Integration, Area, Differential Equations, Straight Line and Pair of Straight Lines, Circle, Parabola, Ellipse, Hyperbola, Trigonometrical Ratios and Identities, Trigonometrical Equations, Inverse Circular Functions, Properties of Triangles, Vectors, 3D Geometry, Miscellaneous, JEE MAIN Solved Paper 201