(144, 15, 0, 'CBSE Champion Chapterwise-Topicwise - Physics Class 11', 0, 'topicwise-1', 2, 0, 1, 'MTG', 'India', 1, 1, 'shipped', 'upload/images/6182-2021-08-07.jpg', '', '<p>The book “CBSE Champion Chapterwise- Topicwise Physics” has been especially designed for students who are studying in Class XI. This book provides an excellent approach to master the Physics subject at school level. The book has been designed in sync with the latest pattern and curriculum of CBSE examination, with each chapter divided into individual topics for better understanding of the concepts. Each topic contains important facts / formulas, detailed theory in the form of quick recap supported by derivations, tables, flow charts, etc. At the end of each chapter, a separate section named “CBSE Practice Questions” has been included which contains all types of questions like Very Short Answer Type, Short Answer Type, Long Answer Type, Value Based, HOTS etc. These Topicwise-Chapterwise questions are framed from NCERT, Exemplar, and various exams like KVS, MSE, NCT etc. with detailed solutions according to CBSE marking scheme. 10 practice paper (2 solved and 8 unsolved) are also included in the book totally based on blue print issued by CBSE for thorough practice. This newly edition also include selected questions from 2018 exam papers of various schools with detailed solutions. Content: 1. Physical World 2. Units and Measurements 3. Motion in a Straight Line 4. Motion in a Plane 5. Laws of Motion 6. Work, Energy and Power 7. Systems of Particles and Rotational Motion 8. Gravitation 9. Mechanical Properties of Solids 10. Mechanical Properties of Fluids 11. Thermal Properties of Matter 12. Thermodynamics 13. Kinetic Theory 14. 0scillations 15. Waves • 10 Practice Papers</p>', 1, '2021-08-07 16:26:16', 1, 7, 'all', ''),
