(150, 15, 0, 'Concept of Physics Part-1 & 2', 0, '1-2', 2, 0, 1, 'H.C Verma', 'India', 1, 1, 'shipped', 'upload/images/3969-2021-08-07.jpg', '', '<p>The author continues to take the readers through the journey of character development. He elaborates how the development of the character of a being ranges from the time of his birth to the years until he grows independent. The first three habits demark the development one goes from dependence to independence. The next three habits describe in detail about interdependence while the final seventh habit deals with the new self, that is renewal</p>', 1, '2021-08-07 17:01:42', 1, 7, 'all', ''),
(151, 15, 0, 'NCERT Text Book + Exemplar Problems - Solutions Chemistry Class 11', 0, 'solutions-chemistry-class-11-1', 2, 0, 1, 'MTG', 'India', 1, 1, 'shipped', 'upload/images/9316-2021-08-07.jpg', '', '<p>MTG’s NCERT textbook + Exemplar problem solutions- Chemistry is an excellent book designed to provide a comprehensive guide to NCERT textbook and NCERT exemplar problems of chemistry for class XI students. This book provides a detailed explanation to all subjective and objective type questions given in both NCERT textbook and NCERT exemplar problems book. This is an error free and ‘Self-study’ book to master the concepts in Chemistry.<br />\r\nThis book aims to give the best solutions and help the students to score high in school examinations as well as to build a strong foundation for Olympiads and competitive exams like PETs and PMTs.</p>', 1, '2021-08-07 17:04:20', 1, 7, 'all', ''),
(152, 15, 0, 'Oswaal NCERT Exemplar (Problems - solutions) Class 12', 0, 'solutions-class-12', 2, 0, 1, 'Oswaal', 'India', 1, 1, 'shipped', 'upload/images/9126-2021-08-07.jpg', '', '<p>• Chapter wise &amp; Topic wise presentation for ease of learning<br />\r\n• Quick Review for in depth study<br />\r\n• Mind maps to unlock the imagination and come up with new ideas<br />\r\n• Know the links R &amp; D based links to empower the students with the latest information on the given topic<br />\r\n• Tips &amp; Tricks useful guideline for attempting questions in minimum time without any mistake<br />\r\n• Expert advice how to score more suggestions and ideas shared<br />\r\n• Some commonly made errors Highlight the most common and unidentified mistakes made by students at all levels<br />\r\n• All latest NCERT EXEMPLAR Question Fully – solved<br />\r\n• Quick Response (QR codes ) for a digital learning experience</p>', 1, '2021-08-07 17:09:01', 1, 7, 'all', '');
