onal Motion, Gravitation, Mechanical Properties of Solids, Mechanical Properties of fluids, thermal properties of Matter, Thermo dynamics, Kinetic Theory, Oscillations, waves, Periodic tests, activities, case study based Questions, 5 Sample questions.</p>', 1, '2021-08-07 17:12:04', 1, 7, 'all', ''),
