(160, 14, 0, 'SKC Sir Organic Chemistry Notes for NEET', 0, 'skc-sir-organic-chemistry-notes-for-neet', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/6796-2021-08-08.png', '', 'SKC Sir is a great motivator and a very enthusiastic teacher of organic chemistry. With teaching experience of more than 6 years now. He is a great artist and his magical teaching makes the subject very interesting for students.  He always says that “I am not going to change the world but I guarantee that I will spark the brain that will”. This effective teaching set high standards for students. He creates learning tasks appropriate to the student’s level of understanding.', 1, '2021-08-08 08:01:42', 1, 7, 'all', ''),
