(166, 14, 0, 'Sameer Bansal Sir Mathematics Notes Class XII for JEE', 0, 'sameer-bansal-sir-mathematics-notes-class-xii-for-jee', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/6461-2021-08-08.png', '', 'To reach heights one must start climbing and if the journey is difficult then perseverance is the key to success. As a teacher, I have realized over the past years that success in IITJEE requires hard work and proper guidance. One must be able to draw a line of demarcation among what to study and what not to.', 1, '2021-08-08 08:20:51', 1, 7, 'all', ''),
(167, 14, 0, 'JJA Sir Mathematics Notes for JEE', 0, 'jja-sir-mathematics-notes-for-jee', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/5577-2021-08-08.png', '', 'JJA Sir\'s notes provides a complete study package to students. His notes are accurate, satisfactory and upto the mark for any exam preparation.', 1, '2021-08-08 08:23:50', 1, 7, 'all', ''),
(168, 14, 0, 'VKR Sir Complete Mathematics Notes for JEE preparation', 0, 'vkr-sir-complete-mathematics-notes-for-jee-preparation', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/9589-2021-08-08.png', '', 'Vinay Kumar (VKR Sir) B.Tech (mechanical engineering), IIT Delhi Passed in 1998 Science in engineers India Ltd. Teaching IIT Mathematics since 2000. Worked in various organizations like Pre Education New Delhi, Career Point, Resonance, Insight, Motion in Kota. Being a top-ranked (AIR 360, IIT JEE 1994) history he knows any of getting good ranker in IIT-JEE.\r\n\r\nMost of the students think that It is very difficult to get success in competitions like IIT-JEE. Any Competitive Exam needs proper planning, a good teaching concept, and practice under proper guidance. Our institute “VKR CLASSES” cemented all your gaps in course of preparation and give a concrete foundation. The real direction of teaching will help you a lot to hit the exact target without wastage of energy and time.\r\n\r\nWe think presently the aspirants have entered a blind and dreaded tunnel where they search endless direction but fail to find a proper route to overcome the darkening. The aspirants from different parts of the land approach here but get highly confused knowing such type of low-grade marketing of education. It goes without saying that the teacher’s group occupies an eminent position in our society. They are responsible for shaping the society and providing it a fine infrastructure because doctors, engineers, officers, and almost all personalities, which are an integral part of our society and further in-country, are produced by teachers.', 1, '2021-08-08 08:26:04', 1, 7, 'all', ''),
(169, 14, 0, 'AGL Sir Mathematics Notes for JEE', 0, 'agl-sir-mathematics-notes-for-jee', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/5002-2021-08-08.png', '', 'Mr. Ayush Goyal, Experienced Mathematics Department Head with a demonstrated history of working in the education industry. Have handled a strong Maths department of over 200 faculties for 10 years. Skilled in Academic Planning, Educational Technology, Curriculum Development, Faculty Training, and Educational Leadership. Taught many top 100 AIR students for IIT JEE. Strong education professional with an M.S. in Chemical Engineering from Purdue University, USA and BTech from IIT Madras.', 1, '2021-08-08 08:27:44', 1, 7, 'all', ''),
(170, 14, 0, 'VG Sir Mathematics Notes for JEE', 0, 'vg-sir-mathematics-notes-for-jee', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/7728-2021-08-08.png', '', 'A calm and quiet man, gentling leading the students through the complexities of Mathematics is an IITian from IIT-Guwahati in Mechanical Engineering. Mr. Vikas Gupta is a co-founder, Director and HOD of Mathematics. He has been a part of this profession for the last 18 years. His exclusive methodology and guidance is a great help for those who wish to fly high and achieve greater goals in life.\r\n\r\nTo overcome the further challenges he has written “Advance Problems in Coordinate Geometry” and “Advance Problems in Mathematics”. Ever ready to help the students, he is a beacon of knowledge and fortitude, very popular amongst his students', 1, '2021-08-08 08:29:19', 1, 7, 'all', ''),
(171, 14, 0, 'ANNA Sir Mathematics Notes for JEE', 0, 'anna-sir-mathematics-notes-for-jee', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/7185-2021-08-08.png', '', 'ANNA SIR NOTES – Mr. Amarnath Anand, a graduate from IIT Delhi is a Co-founder, Director who conveys the beauty and the “infectious enthusiasm” for the subject through his magnetic persona. Very few math teachers can be that charismatic. He believes that it is possible to show students the wonder of extracting a simple answer from a seemingly difficult question. He is the writer of the two books, one is ‘Thomas Calculus’ which is a benchmark book in calculus, and the other is ‘Problem and Solution in Algebra’ for IIT-JEE which is a collection of a large number of congenital problems which help students in clearing JEE and various Olympiads. He had taught Chitrang Murdia (AIR-1, IIT-JEE 2014) and Govind Lahoti (AIR-3, IIT-JEE 2014).\r\n\r\nAmarnath Anand Sir which is also known as ANNA Sir. He is the Best teacher of Mathematics in Kota. He was the Ex – Hod of Allen Carrier Institute and Now In Nucleus Education Kota Centre of Intelligence (Co-Founder of Nucleus Education). He is Known For his unique teaching style. He has more than 12 years of teaching experience in various prominent institutions for JEE. His great passion for his subject led him to impart guidance to IIT-JEE aspirants on a regular basis. And we can not compare these teachers because they are legends.\r\n\r\nHe will teach you the concept from very basics……Then advances level gradually. You can score full marks in MATHEMATICS if you follow Amarnath Anand Sir Properly.\r\n\r\nBUT….the only condition is you should be hardworking and regularly complete his homework before the discussion, seriously you will be the best in the subject.', 1, '2021-08-08 08:31:05', 1, 7, 'all', ''),
(172, 15, 0, 'A Handbook on Civil Engineering IES, GATE, PSUs', 0, 'a-handbook-on-civil-engineering-ies-gate-psus-1', 2, 1, 1, 'Made Easy', 'India', 1, 1, 'shipped', 'upload/images/0479-2021-08-08.jpg', '', '<p>A Handbook on Civil Engineering - IES, GATE, PSUs &amp; Other Competitive Exams 1st Edition is a comprehensive guide which is revised and updates for candidates who are applying for competitive exams like IES, GATE and PSUs. The book makes it easy to learn and remember</p>', 1, '2021-08-08 09:25:53', 1, 7, 'all', ''),
(173, 15, 0, 'A Textbook of Strength of Materials', 0, 'a-textbook-of-strength-of-materials-1', 2, 1, 1, 'R.K Bansal', 'India', 1, 1, 'shipped', 'upload/images/7371-2021-08-08.jpg', '', '<p>Reading books is a kind of enjoyment. Reading books is a good habit. We bring you a different kinds of books. You can carry this book where ever you want. It is easy to carry. It can be an ideal gift to yourself and to your loved ones. Care instruction keep away from fire</p>', 1, '2021-08-08 09:40:25', 1, 7, 'all', ''),
(174, 15, 0, 'Basic Structural Analysis', 0, 'basic-structural-analysis-1', 2, 0, 1, 'C.S Reddy', 'India', 1, 1, 'shipped', 'upload/images/8862-2021-08-08.jpg', '', '<p>The new edition of this book presents the basic principles of classical and matrix structural analysis. It provides a smooth transition from the classical approaches that are based on physical behaviour of structures in terms of their deflected shapes to a formal treatment of a general class of structures by means of matrix formulation in order to understand how the structural problems can be formulated in order to make them suitable for computer programming.</p>', 1, '2021-08-08 09:45:17', 1, 7, 'all', ''),
(175, 15, 0, 'R.C.C. Designs', 0, 'r-c-c-designs-1', 2, 0, 1, 'Laxmi', 'India', 1, 1, 'shipped', 'upload/images/0668-2021-08-08.jpg', '', '<p>Reinforced concretes take up a prominent place in modern construction. To get a proper reinforced concrete in a construction work, there should be a thorough understanding of the structure of the concrete, the knowledge of its characteristics, and also the limitations the construction materials possesses. R.C.C. Designs (Reinforced Concrete Structures), in its tenth edition, contains on the whole forty eight chapters, talking in detail about reinforced concrete structures. These concepts of the book are based on the recommendations by IS 456-2000. Every chapter begins with detailed definitions and clear statements, along with design principles, design procedures, and theories. All the definitions come with various design examples and illustrations. This book is useful for people like students, teachers, and engineers.</p>\r\n\r\n<p>The book is divided into six parts and ends with four appendices. The names of the parts are Working Stress Method, Water Tanks, Miscellaneous Structures, Concrete Bridges, Limit State Design, and Prestressed Concrete and Miscellaneous Topics. Some of the topics in the part one are Theory of Reinforced Beams and Slabs, Shear and Bond, Torsio, T and L Beams, Design of Stair Cases, Combined Footings, Pile Foundations, and Retaining Walls. Part two contains chapters like Domes, Beams Curved in Plan, and Water Tanks. Part three contains Reinforced Concrete Pipes, Bunkers and Silos, and Building Frames. Part four contains Aqueducts and Box Culverts and Concrete Bridges. Part five contains Design Concretes, Singly Reinforced Sections, Axially Loaded Columns, Two-way Slabs, Circular Slabs, and Foundations. Part 6 contains Prestressed Concrete, Shrinkage and Creep, Form-work, and Test for Cement and Concrete.</p>\r\n\r\n<p>R.C.C. Designs (Reinforced Concrete Structures) was published by Laxmi in the year 2006. It is available in paperback.</p>', 1, '2021-08-08 09:48:44', 1, 7, 'all', ''),
(176, 15, 0, 'Soil Mechanics and Foundation Engineering', 0, 'soil-mechanics-and-foundation-engineering-1', 2, 1, 1, 'PEARSON', 'India', 1, 1, 'shipped', 'upload/images/2422-2021-08-08.jpg', '', '<p>This book presents the principles of soil mechanics and foundation engineering in a simplified, yet elegant style that assumes no prior knowledge of the subject in the student reader. It lines up all the material required for a firm background in the subject in logical order, reinforcing theoretical aspects with sound practical applications</p>', 1, '2021-08-08 09:51:19', 1, 7, 'all', ''),
