(181, 15, 0, 'Building Materials', 0, 'building-materials-1', 2, 0, 1, 'Wiley', 'India', 1, 1, 'shipped', 'upload/images/5184-2021-08-08.jpg', '', '<p>Building materials imparts in-depth knowledge to the students about the subject. It deals with all the relevant information regarding stones, bricks and Tiles, Lime, cement, aggregates, mortar and concrete, timber, metals, paint and Varnish, bituminous products, and Miscellaneous materials. The illustrations and sketches of the materials and techniques have been included as per relevant Indian standards. Suitable concrete mix design techniques have been illustrated with appropriate examples. An exclusive br&gt;Chapter has been included on the utilization of waste materials in construction.</p>', 1, '2021-08-08 10:06:33', 1, 7, 'all', ''),
(182, 15, 0, 'The Essentials of Instructional Design', 0, 'the-essentials-of-instructional-design-1', 2, 0, 1, 'Routledge', 'India', 1, 1, 'shipped', 'upload/images/4544-2021-08-08.jpg', '', '<p><em>The Essentials of Instructional Design, 4th Edition</em> introduces the fundamental elements, principles, and practice of instructional design (ID) to students new to ID. Key procedures within the ID process―learner analysis, task analysis, needs analysis, developing goals and objectives, organizing instruction, developing instructional activities, assessing learner achievement, and evaluating the success of the instructional design―are covered comprehensively and enriched with descriptions and examples of how these procedures are accomplished using the best-known models.</p>\r\n\r\n<p>Unlike most other ID books, <em>The Essentials of Instructional Design </em>provides an overview of the principles and practice of ID without placing emphasis on any one ID model. Offering the voices of instructional designers from a number of professional settings and providing real-life examples from across sectors, students learn how professional organizations put the various ID processes into practice. This revised edition features new activities, quizzes, and content on professional development.</p>\r\n\r\n<p>Offering a variety of possible approaches for each step in the ID process and clearly explaining the strengths and challenges associated with each, this book prepares students with the information they need to make informed decisions as they design and develop instruction.</p>', 1, '2021-08-08 10:11:35', 1, 7, 'all', ''),
(183, 14, 0, 'AM Sir Biology Notes for NEET', 0, 'am-sir-biology-notes-for-neet', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/1635-2021-08-08.png', '', 'Dr. Ashish Maheshwari (AM Sir) Known as one of the best teachers, nationwide, in teaching the subjects of BOTANY and GENETICS for 18 years in a row now, he has made a niche for himself in the teaching world and among the hearts of his students. He completed his Ph.D. in Genetics and has been into teaching since then. He is HOD of Botany\r\n\r\nHis interactive and intelligent approach in teaching these subjects helps students to understand the subject while clearing their doubts simultaneously. He believes that “LEARNING is an opportunity to grow emotionally, mentally, and spiritually, and so it’s better done seriously.”', 1, '2021-08-08 10:31:40', 1, 7, 'all', ''),
(184, 14, 0, 'Aakash Toppers Complete Biology Notes for NEET', 0, 'aakash-toppers-complete-biology-notes-for-neet', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/4337-2021-08-08.png', '', 'Making good notes is an art, but finding good notes is even better, it’s smart. We have done all the hard work for you by creating NEET Toppers Notes, a collection of best notes on NEET written by previous year NEET toppers. What separates a topper from an average student is the ability to study smart and not only hard. They create their notes highlighting the concepts which should be focused on during the first read and later, marking key takeaways for each chapter. What makes handwritten notes so valuable is the fact that.\r\n\r\nThe flow of the notes matches the way a topic is taught in the class by an expert teacher. Contains solved problems on the most important and most asked concepts. Made by toppers and taught by subject experts, which makes these notes a perfect learning tool to gain benefits from.', 1, '2021-08-08 10:34:27', 1, 7, 'all', ''),
