(189, 14, 0, 'AG Sir Class XII Physics Notes for JEE', 0, 'ag-sir-class-xii-physics-notes-for-jee', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/5918-2021-08-09.png', '', 'Mr. Amit Gupta, a mastermind from IIT Delhi, Co-founder and Director has a revolutionary new methodology for Physics learning. He has designed content of physics for BANSAL classes, and later on for ALLEN also as the senior-most faculty who created the overall curriculum of IIT-JEE preparation. He is the co-author of Resnick Halliday, the world-renowned textbook of physics for the last 80 years.\r\n\r\nThe book has been modified for the requirements of IIT-JEE. He added many new Chapters, reworked and supplemented all the worked-out examples according to the need of the students. He had taught Chitrang Murdia (AIR-1, IIT-JEE 2014) and Govind Lahoti (AIR-3, IIT-JEE 2014). Two of his students have scored full marks in IIT-JEE ADVANCED. Chitrang Murdia (2014), Shubham Tulsani (2009) and Pulkit Jadon (2012) have represented India in Physics Olympiad under his guidance and mentorship.', 1, '2021-08-09 04:12:41', 1, 7, 'all', ''),
(190, 14, 0, 'MKS Sir Physics Notes for JEE', 0, 'mks-sir-physics-notes-for-jee', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/4091-2021-08-09.png', '', 'Manish Kumar Singhal AKA MKS sir! Yeah definitely him! Well you sit in his class and you get a lot much interested in physics. And he will be the most respected teacher by you for your entire life. His honesty and sincerity towards his job and worth looking out for. He himself is a CS grad from IITD and an ex-IPS officer.\r\n\r\nBelieve me you will never forget his teachings of work for your entire life. He is an inspiration for students to work sincerely for their interests and for their goals in life.', 1, '2021-08-09 04:14:21', 1, 7, 'all', ''),
(191, 14, 0, 'MB Sir Physics Notes for JEE', 0, 'mb-sir-physics-notes-for-jee', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/0367-2021-08-09.png', '', 'Mohit Bhargava (MB Sir) first rule is:- Leave Physics apart, first use your Common sense. He is also known as Jugaad Sir. He is the most intelligent teacher that I have come across. Despite being a Physics tutor, each year, he solves all the calculus problems in one go in the simplest way, just for his own satisfaction.\r\n\r\nHe made us solve Irodov (the toughest book of Physics for IIT aspirants) in a very simple manner and some questions even without using any concept of Physics. He taught us the concept rather than formulae.', 1, '2021-08-09 04:21:03', 1, 7, 'all', ''),
(192, 14, 0, 'NMS Physics Handwritten Notes for JEE', 0, 'nms-physics-handwritten-notes-for-jee', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/1840-2021-08-09.png', '', 'NMS Sir (Neelmani Srivastava) is a Physics expert for JEE Main and Advanced. He initially got a break with Infosys in their education and research wing, but as the destiny drives the world, he became a part of the teaching fraternity.\r\n\r\nOver the years he has refined his skills and can relate physics with practical life. He believes in “Make mistakes but do not repeat them”', 1, '2021-08-09 04:22:48', 1, 7, 'all', ''),
(193, 14, 0, 'Nitin Jain (NJ) Sir Physics Notes for JEE', 0, 'nitin-jain-nj-sir-physics-notes-for-jee', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/1330-2021-08-09.png', '', 'A very simple yet rock-solid person, Mr. Nitin Jain is a Co-founder, Director, and HOD of Physics. His method of teaching is unique and he is idolized by his students. He possesses the experience of teaching in this field for more than 22 years.\r\n\r\nBeing an alumnus of BITS Pilani, his contribution to this eminent institution in Kota provides expert guidance and the best solutions to the students for IIT-JEE. His book “University Physics for the JEE”, provides proper insight and encourages the aspirants to appear in National Level Competitions.\r\n\r\nVery gentle and helpful by nature Ninja Sir – as he is addressed by his students lovingly, is a very popular teacher indeed.', 1, '2021-08-09 04:24:27', 1, 7, 'all', ''),
(194, 14, 0, 'DB Singh Sir Physics Notes for JEE', 0, 'db-singh-sir-physics-notes-for-jee', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/0147-2021-08-09.png', '', 'More than 20 Years of experience. Senior-most individual physics faculty in Kota. It’s impossible to sleep in his class. He has written many books including solutions to irodov. Unparalleled in electricity and magnetism part.', 1, '2021-08-09 04:26:29', 1, 7, 'all', ''),
