(196, 14, 0, 'ASP Sir Physics Notes for NEET', 0, 'asp-sir-physics-notes-for-neet', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/6995-2021-08-09.png', '', 'Damn, he’s the one with bold attitude. I mean not only by his teaching methodology, we guys were a fan of him because of his bold attitude and little jokes he used to crack in between the topics just to develop interest.', 1, '2021-08-09 04:38:02', 1, 7, 'all', ''),
(197, 14, 0, 'DJ Sir Physics Handwritten Notes for NEET', 0, 'dj-sir-physics-handwritten-notes-for-neet', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/7386-2021-08-09.png', '', 'The man with the most charming smile that can blow away all your worries. His “desi” tricks will leave you spellbound. He has the most innovative ideas of teaching. He’s always there to solve even the most tiny doubt.', 1, '2021-08-09 04:40:43', 1, 7, 'all', ''),
(198, 14, 0, 'PMP Sir Physics Handwritten Notes for NEET', 0, 'pmp-sir-physics-handwritten-notes-for-neet', 9, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/9371-2021-08-09.png', '', 'No one can beat Praveen mehndiratta sir here. known as PMP sir ( PMP Sir).. He is exceptional. He was ex faculty of career point, Sarvottam. 20 years of experience. & he has tricks for every single type of problem.\r\n\r\nIn Allen, there is a saying that “ PMP se padhe ho, Physics me to 150+ pakke”.', 1, '2021-08-09 05:28:10', 1, 7, 'all', ''),
(199, 10, 0, 'The Diary of a young girl - Anne Frank', 0, 'the-diary-of-a-young-girl-anne-frank', 4, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/9078-2021-08-09.jpeg', '', 'I haven\'t written for a few days,because I wanted first of all to think about my diary. It\'s an odd idea for someone like me to keep a diary; not only because i have never never done so before, but because I have never done so before ,but because it seems to me that neither I- nor for that matter anyone else- will be interested in the unbosoming of a thirteen -year -old schoolgirl. Still , what does that matter? I want to write, but more than that, I want to bring out all kinds of things that lie buried deep in my heart.\" Anne Frank.\r\n\r\nThe Diary of Anne Frank is the story of a 13- year-old Jewish girl and her family who are forced into hiding by the Nazis during World War II.\r\n\r\nAnne Frank\'s world famous diary charts two years of her life from 1942 to 1944, when her family were hiding in Amsterdam life from German Nazis. The diary begins just before the family retreated into their \'Secret Annexe.\' Anne Frank recorded mostly her hopes, frustrations, clashes with her parents and observation of her companions. Its first version, which appeared in 1947, was edited by Anne\'s father, Otto Frank. The book has recieved widespread critical and popular attention worldwide ever since.', 1, '2021-08-09 08:26:27', 1, 7, 'all', ''),
(202, 10, 0, 'No Matter What . . . I will always love you!', 0, 'no-matter-what-i-will-always-love-you', 4, 0, 1, 'Rohit Dewasar', 'India', 0, 0, '', 'upload/images/1980-2021-08-09.jpg', '', '<p><em>An ordinary-turned-extraordinary tale about the magic of love..</em><br />\r\nFrom romantic escapes in the beaches of Goa to witnessing the beautiful Manali sky lit up with fireworks on a Diwali night, Rishi and Mishika’s lives were like an exciting roller-coaster ride every moment that they were together.<br />\r\nBut when Mishika disappears on the morning of their engagement without leaving so much as a wisp of a trace behind, Rishi finds himself alone and adrift in a dark sea of doubts and fears. Was this one of those pranks that Mishika loved to pull on him to test his love for her? Or had something happened to her?<br />\r\nJoin Rishi as he tries to look for answers in an unforgiving world where holding on to even the slightest bit of hope is a daily struggle. Will he ever find Mishika? Was she even alive? What unbelievable things would his love for her make him do?<br />\r\nFrom the bestselling author of <em>The Stupid Somebody</em> comes yet another gripping story that will make you laugh, cry, and reaffirm your faith in the strength of love.</p>', 1, '2021-08-09 13:24:51', 1, 0, 'all', ''),
