(210, 10, 0, 'Animal Farm by George Orwell', 0, 'animal-farm-by-george-orwell', 4, 0, 0, 'George Orwell', '', 1, 1, 'shipped', 'upload/images/4235-2021-08-09.jpg', '', 'Product Description\r\nWhen the oppressed animals of Manor Farm defeat their master, Mr. Jones and take over the farm for themselves, they envisage it to be the beginning of independence and abundance. However, a devious and heartless elite among the animals starts to take control and the other animals find themselves helplessly trapped as another gradually replaces one form of dictatorship. Orwell’s frightening ‘fairy story’ is a timeless and overwhelming satire of idealism deceived by power and corruption. Although, it almost remained unpublished due to its savage attack on Stalin, Britain’s then ally and got turned down by publisher after publisher, today it’s known to be one of Orwell’s best works and a world-famous classic.\r\n\r\nAbout the Author\r\n George Orwell, was an English novelist, essayist, journalist and critic. His work is marked by lucid prose, awareness of social injustice, opposition to totalitarianism and outspoken support of democratic socialism.', 1, '2021-08-09 17:13:42', 1, 7, 'all', ''),
(211, 10, 0, 'The Kite Runner by Khaled Husseini', 0, 'the-kite-runner-by-khaled-husseini', 4, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/2657-2021-08-10.jpg', '', 'Afghanistan, 1975: Twelve-year-old Amir is desperate to win the local kite-fighting tournament and his loyal friend Hassan promises to help him. But neither of the boys can foresee what will happen to Hassan that afternoon, an event that is to shatter their lives. After the Russians invade and the family is forced to flee to America, Amir realises that one day he must return to Afghanistan under Taliban rule to find the one thing that his new world cannot grant him: redemption.\r\n\r\nAmazon.com Review\r\n“‘A devastating, masterful and painfully honest story ... it is a novel of great hidden intricacy and wisdom, like a timeless Eastern tale. It speaks the most harrowing truth about the power of evil\'” – Daily Telegraph\r\n\r\n“‘Hosseini\'s ability to reach the core of experiences of love and loss places him in the company of such fine chroniclers of the new America as Chang-rae Lee. The Kite Runner is a first novel of unusual generosity, honesty and compassion\' ” – Independent\r\n\r\n“\'Unforgettable ... extraordinary. It is so powerful that for a long time after everything I read seemed bland\'” – Isabel Allende\r\n\r\n“‘The shattering first novel by Khaled Hosseini... a rich and soul-searching narrative ... a sharp, unforgettable taste of the trauma and tumult experienced by Afghanis as their country buckled\'” – Observer\r\n\r\nReview\r\n\'Hosseini\'s ability to reach the core of\r\nexperiences of love and loss places him in the company of such fine chroniclers of the new America as Chang-rae Lee. The Kite Runner is a first novel of unusual generosity, honesty and compassion\'\r\n\r\n( Independent)\r\n\r\n\'The shattering first novel by Khaled Hosseini... a rich and soul-searching narrative ... a sharp, unforgettable taste of the trauma and tumult experienced by Afghanis as their country buckled\' ( Observer)\r\n\r\n\'A devastating, masterful and painfully honest story ... it is a novel of great hidden intricacy and wisdom, like a timeless Eastern tale. It speaks the most harrowing truth about the power of evil\' ( Daily Telegraph)\r\n\r\nUnforgettable ... extraordinary. It is so powerful that for a long time after everything I read seemed bland ( Isabel Allende)\r\nBook Description\r\nOver 21 million copies sold worldwide\r\n\r\nAbout the Author\r\nKhaled Hosseini was born in Kabul, Afghanistan and moved to the United States in 1980. His first novel, The Kite Runner,\r\nwas an international bestseller, published in thirty-four countries. In\r\n2006 he was named a US goodwill envoy to the United Nations Refugee\r\nAgency. He lives in northern California.', 1, '2021-08-10 13:18:52', 1, 7, 'all', '');
