(212, 10, 0, 'Ikigai - The Japanese Secret to a Long and Happy Life', 0, 'ikigai-the-japanese-secret-to-a-long-and-happy-life', 4, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/2215-2021-08-10.jpg', '', 'Product Description\r\nLos Angeles Times bestseller • More than 1.5 million copies sold\r\n\r\n“If hygge is the art of doing nothing, ikigai is the art of doing something—and doing it with supreme focus and joy.” —New York Post\r\n\r\nBring meaning and joy to all your days with this internationally bestselling guide to the Japanese concept of ikigai (pronounced ee-key-guy)—the happiness of always being busy—as revealed by the daily habits of the world’s longest-living people.\r\n\r\n*And from the same authors, don’t miss The Book of Ichigo Ichie—about making the most of every moment in your life.*\r\n\r\n*          *          *\r\n\r\nWhat’s your ikigai?\r\n\r\n“Only staying active will make you want to live a hundred years.” —Japanese proverb\r\n \r\nAccording to the Japanese, everyone has an ikigai—a reason for living. And according to the residents of the Japanese village with the world’s longest-living people, finding it is the key to a happier and longer life. Having a strong sense of ikigai—the place where passion, mission, vocation, and profession intersect—means that each day is infused with meaning. It’s the reason we get up in the morning. It’s also the reason many Japanese never really retire (in fact there’s no word in Japanese that means retire in the sense it does in English): They remain active and work at what they enjoy, because they’ve found a real purpose in life—the happiness of always being busy.\r\n \r\nIn researching this book, the authors interviewed the residents of the Japanese village with the highest percentage of 100-year-olds—one of the world’s Blue Zones. Ikigai reveals the secrets to their longevity and happiness: how they eat, how they move, how they work, how they foster collaboration and community, and—their best-kept secret—how they find the ikigai that brings satisfaction to their lives. And it provides practical tools to help you discover your own ikigai. Because who doesn’t want to find happiness in every day?\r\n\r\nA PENGUIN LIFE TITLE\r\n\r\nReview\r\n“ Ikigai urges individuals to simplify their lives by pursuing what sparks joy for them. . . . Much in the same way that  The Life-Changing Magic of Tidying Up emphasizes ‘choosing what we want to keep, and not what we want to get rid of,’ [ Ikigai] demonstrates that aging could be an opportunity to  keep working , keep smiling,  keep active, and  keep being social.” — KonMari Newsletter\r\n\r\n“Want to live longer? Keep super busy. If hygge is the art of doing nothing, ikigai is the art of doing something—and doing it with supreme focus and joy. . . . Pack up those cozy blankets and candles you purchased in last year’s hygge-fueled Ikea spree. Fall’s biggest imported lifestyle trend is ikigai, and it might help you live to 100.” — New York Post\r\n\r\n“Busy-ness is a concept I’m familiar with and fascinated by, especially living in New York City. . . . The Japanese concept of ikigai (the happiness of being busy) [is] attainable and even an important key to living longer.” — Mia Feitel, Elle.com\r\n\r\n“Discovering your ikigai, or passion, can be one of the greatest journeys you will embark on.” — Forbes\r\n\r\n“Definitely worth the time it will take you to enjoy a cup or two of green tea as you digest this small, charming book.” — Minneapolis Star Tribune\r\n\r\n“A must-follow lifestyle hack,  ikigai makes  hygge look like a trip to Ikea. . . . Think  feng shui with Venn diagrams—although this time there is no need to move the front door.” — The Guardian\r\n\r\n“You’ve tried hygge and lagom—but it turns out ikigai is the key to happiness.” — The Independent (London)\r\n\r\n“Forget hygge. It’s all about ikigai.” — The Times (London)\r\n\r\n“ Ikigai is what allows you to look forward to the future even if you’re miserable right now. . . . It might just help you live a more fulfilling life.” — BBC\r\n \r\n“Originating from a country with one of the world’s oldest populations, ikigai is becoming popular outside of Japan as a way to live longer and better. . . . [It] is helping people live longer on Okinawa as it gives them purpose.” — World Economic Forum\r\n \r\n“ Ikigai. Ick-ee-guy. It’s a word you’ll be hearing quite often come autumn. . . . It’s Japanese, and it means something like ‘purpose in life,’ or ‘thing that you live for,’ or ‘thing that gets you out of bed in the morning.’ . . . An extended lifespan, according to the long-life expert Dan Buettner, is what awaits havers-of- ikigai.” — The Sunday Telegraph\r\n\r\n“A refreshingly simple recipe for happiness.” — Stylist\r\n\r\n“The most eye-catching autumn lifestyle trend is the Japanese concept of  ikigai, which translates as ‘reason to live.’ . . . An attractive and absorbing book.” — The Bookseller\r\n\r\n“A Japanese concept that offers a new perspective on finding happiness.” — The Debrief\r\n\r\n“Persuasively shows that small changes can help readers find more joy and purpose in their lives [with] clear, succinct information . . . skillfully compiled . . . into an engaging, easily accessible format with lists, charts, and illustrations.” — Publishers Weekly\r\n\r\n“ Ikigai gently unlocks simple secrets we can all use to live long, meaningful, happy lives. Science-based studies weave beautifully into honest, straight-talking conversation you won’t be able to put down. Warm, patient, and kind, this book pulls you gently along your own journey rather than pushing you from behind.” — Neil Pasricha, New York Times bestselling author of The Book of Awesome and The Happiness Equation\r\n\r\nAbout the Author\r\nHéctor García and Francesc Miralles are the coauthors of  The Book of Ichigo Ichie: The Art of Making the Most of Every Moment, the Japanese Way. Héctor is a citizen of Japan, where he has lived for over a decade, and is the author of  A Geek in Japan, a #1 bestseller in Japan. Francesc is the author of a number of bestselling self-help and inspirational books and of the novel  Love in Lowercase, which has been translated into twenty languages.', 1, '2021-08-10 13:21:30', 1, 7, 'all', ''),
(213, 10, 0, 'Brief Answers to the Big Questions by Stephen Hawking', 0, 'brief-answers-to-the-big-questions-by-stephen-hawking', 4, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/6289-2021-08-10.jpg', '', 'Product Description\r\nTHE NO.1 SUNDAY TIMES BESTSELLER\r\n\r\n\'A beautiful little book by a brilliant mind\' DAILY TELEGRAPH\r\n\r\n\'Effortlessly instructive, absorbing, up to the minute and - where it matters - witty\' GUARDIAN\r\n\r\nThe world-famous cosmologist and #1 bestselling author of A Brief History of Time leaves us with his final thoughts on the universe\'s biggest questions in this brilliant posthumous work.\r\n\r\nIs there a God?\r\nHow did it all begin?\r\nCan we predict the future?\r\nWhat is inside a black hole?\r\nIs there other intelligent life in the universe?\r\nWill artificial intelligence outsmart us?\r\nHow do we shape the future?\r\nWill we survive on Earth?\r\nShould we colonise space?\r\nIs time travel possible?\r\n\r\nThroughout his extraordinary career, Stephen Hawking expanded our understanding of the universe and unravelled some of its greatest mysteries. But even as his theoretical work on black holes, imaginary time and multiple histories took his mind to the furthest reaches of space, Hawking always believed that science could also be used to fix the problems on our planet.\r\n\r\nAnd now, as we face potentially catastrophic changes here on Earth - from climate change to dwindling natural resources to the threat of artificial super-intelligence - Stephen Hawking turns his attention to the most urgent issues for humankind.\r\n\r\nWide-ranging, intellectually stimulating, passionately argued, and infused with his characteristic humour, BRIEF ANSWERS TO THE BIG QUESTIONS, the final book from one of the greatest minds in history, is a personal view on the challenges we face as a human race, and where we, as a planet, are heading next.\r\n\r\nA percentage of all royalties will go to charity.\r\n\r\nReview\r\nA beautiful book from a brilliant mind ( Daily Telegraph)\r\n\r\nAlmost everything in Brief Answers is effortlessly instructive, absorbing, up to the minute and - where it matters - witty ( Guardian)\r\n\r\nThe best, most mind-bending sort of physics: black holes, time travel, the origins of the universe ( The Times)\r\n\r\nIt is that ultra-distinctive voice (modest, profound, sometimes very funny) that knits this book together ( Sunday Times)\r\n\r\nBook Description\r\nThe final book from Professor Stephen Hawking, the bestselling author of A BRIEF HISTORY OF TIME and arguably the most famous scientist of our age, BRIEF ANSWERS TO THE BIG QUESTIONS is a profound, accessible and timely reflection on the biggest questions in science.\r\n\r\nAbout the Author\r\nSTEPHEN HAWKING was a brilliant theoretical physicist and is generally considered to have been one of the world\'s greatest thinkers. He held the position of Lucasian Professor of Mathematics at the University of Cambridge for thirty years and is the author of A Brief History of Time which was an international bestseller. His other books for the general reader include A Briefer History of Time, the essay collection Black Holes and Baby Universes, The Universe in a Nutshell, The Grand Design and Black Holes: The BBC Reith Lectures. He died on 14 March, 2018.', 1, '2021-08-10 13:25:18', 1, 7, 'all', ''),
(214, 10, 0, 'Thinking Fast and Slow by Daniel Kahneman', 0, 'thinking-fast-and-slow-by-daniel-kahneman', 4, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/6077-2021-08-10.jpg', '', 'Product Description\r\nMajor New York Times bestseller\r\nOver two million copies sold\r\nSelected by the New York Times Book Review as one of the ten best books of 2011\r\nSelected by The Wall Street Journal as one of the best nonfiction books of 2011\r\n2013 Presidential Medal of Freedom Recipient\r\nDaniel Kahneman\'s work with Amos Tversky is the subject of Michael Lewis\'s best-selling The Undoing Project: A Friendship That Changed Our Minds\r\n\r\nIn his mega bestseller, Thinking, Fast and Slow, Daniel Kahneman, world-famous psychologist and winner of the Nobel Prize in Economics, takes us on a groundbreaking tour of the mind and explains the two systems that drive the way we think.\r\n\r\nSystem 1 is fast, intuitive, and emotional; System 2 is slower, more deliberative, and more logical. The impact of overconfidence on corporate strategies, the difficulties of predicting what will make us happy in the future, the profound effect of cognitive biases on everything from playing the stock market to planning our next vacation―each of these can be understood only by knowing how the two systems shape our judgments and decisions.\r\n\r\nEngaging the reader in a lively conversation about how we think, Kahneman reveals where we can and cannot trust our intuitions and how we can tap into the benefits of slow thinking. He offers practical and enlightening insights into how choices are made in both our business and our personal lives―and how we can use different techniques to guard against the mental glitches that often get us into trouble. Topping bestseller lists for almost ten years, Thinking, Fast and Slow is a contemporary classic, an essential book that has changed the lives of millions of readers.\r\n\r\nReview\r\n“It is an astonishingly rich book: lucid, profound, full of intellectual surprises and self-help value. It is consistently entertaining . . . So impressive is its vision of flawed human reason that the New York Times columnist David Brooks recently declared that Kahneman and Tversky\'s work ‘will be remembered hundreds of years from now,\' and that it is ‘a crucial pivot point in the way we see ourselves.\'”\r\n―Jim Holt, The New York Times Book Review\r\n\r\n“There have been many good books on human rationality and irrationality, but only one masterpiece. That masterpiece is Daniel Kahneman\'s Thinking, Fast and Slow . . . This is one of the greatest and most engaging collections of insights into the human mind I have read.”\r\n―William Easterly, Financial Times\r\n\r\n“I will never think about thinking quite the same. [Thinking, Fast and Slow] is a monumental achievement.”\r\n―Roger Lowenstein, Bloomberg/Businessweek\r\n\r\n“Brilliant . . . It is impossible to exaggerate the importance of Daniel Kahneman\'s contribution to the understanding of the way we think and choose. He stands among the giants, a weaver of the threads of Charles Darwin, Adam Smith and Sigmund Freud. Arguably the most important psychologist in history, Kahneman has reshaped cognitive psychology, the analysis of rationality and reason, the understanding of risk and the study of happiness and well-being.”\r\n―Janice Gross Stein, The Globe and Mail\r\n\r\n\"Everyone should read Thinking, Fast and Slow.”\r\n―Jesse Singal, Boston Globe\r\n\r\n“[Thinking, Fast and Slow] is wonderful. To anyone with the slightest interest in the workings of his own mind, it is so rich and fascinating that any summary would seem absurd.”\r\n―Michael Lewis, Vanity Fair\r\n\r\n“Profound . . . As Copernicus removed the Earth from the centre of the universe and Darwin knocked humans off their biological perch, Mr. Kahneman has shown that we are not the paragons of reason we assume ourselves to be.”\r\n―The Economist\r\n\r\n“[A] tour de force of psychological insight, research explication and compelling narrative that brings together in one volume the high points of Mr. Kahneman\'s notable contributions, over five decades, to the study of human judgment, decision-making and choice . . . Thanks to the elegance and force of his ideas, and the robustness of the evidence he offers for them, he has helped us to a new understanding of our divided minds―and our whole selves.”\r\n―Christoper F. Chabris, The Wall Street Journal\r\n\r\n“A major intellectual event . . . The work of Kahneman and Tversky was a crucial pivot point in the way we see ourselves.”\r\n―David Brooks, The New York Times\r\n\r\n“For anyone interested in economics, cognitive science, psychology, and, in short, human behavior, this is the book of the year. Before Malcolm Gladwell and Freakonomics, there was Daniel Kahneman, who invented the field of behavior economics, won a Nobel . . . and now explains how we think and make choices. Here\'s an easy choice: read this.”\r\n―The Daily Beast\r\n\r\n“Daniel Kahneman is one of the most original and interesting thinkers of our time. There may be no other person on the planet who better understands how and why we make the choices we make. In this absolutely amazing book, he shares a lifetime\'s worth of wisdom presented in a manner that is simple and engaging, but nonetheless stunningly profound. This book is a must read for anyone with a curious mind.”\r\n―Steven D. Levitt, William B. Ogden Distinguished Service Professor of Economics at the University of Chicago; co-author of Freakonomics and SuperFreakonomics\r\n\r\n“Thinking, Fast and Slow is a masterpiece―a brilliant and engaging intellectual saga by one of the greatest psychologists and deepest thinkers of our time. Kahneman should be parking a Pulitzer next to his Nobel Prize.”\r\n―Daniel Gilbert, Harvard University Professor of Psychology, author of Stumbling on Happiness, host of the award-winning PBS television series \"This Emotional Life\"\r\n\r\n“This is a landmark book in social thought, in the same league as The Wealth of Nations by Adam Smith and The Interpretation of Dreams by Sigmund Freud.”\r\n―Nassim Taleb, author of The Black Swan\r\n\r\n“Daniel Kahneman is among the most influential psychologists in history and certainly the most important psychologist alive today. He has a gift for uncovering remarkable features of the human mind, many of which have become textbook classics and part of the conventional wisdom. His work has reshaped social psychology, cognitive science, the study of reason and of happiness, and behavioral economics, a field that he and his collaborator Amos Tversky helped to launch. The appearance of Thinking, Fast and Slow is a major event.”\r\n―Steven Pinker, Harvard College Professor of Psychology, Harvard University, and author of How the Mind Works and The Better Angels of our Nature\r\n\r\nAbout the Author\r\nDaniel Kahneman is Eugene Higgins Professor of Psychology Emeritus at Princeton University and a professor of public affairs at the Woodrow Wilson School of Public and International Affairs. He received the 2002 Nobel Prize in Economic Sciences for his pioneering work with Amos Tversky on decision-making. He is the author of the international bestseller Thinking, Fast and Slow.', 1, '2021-08-10 13:27:40', 1, 7, 'all', ''),
(215, 10, 0, 'Chanakya Neeti with Chanakya Sutras', 0, 'chanakya-neeti-with-chanakya-sutras', 4, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/1587-2021-08-10.jpg', '', 'Chanakya, also known as Vishnu Gupta or Kautilya was an Indian professor of political science and economics at Takshashila University in the ancient times. He was also a chief advisor to the Mauryan emperors between 350-275 BC. Chanakya Neeti is the English translation of Chanakya\'s Neetishastra. It is a result of Chanakya\'s in-depth study and understanding of the Indian way of life. The book is a set of tenets that spell out the ideal way for an individual to behave and deal with the society around them. He does so by way of Neeti Sutras (originally in Sanskrit), which are short sentences but have a powerful message in them. The book has these Neeti Sutras listed with their relevant English translation. The book is used as a guide to achieve success in any area of life. Chanakya Neeti is a useful guide even in the present times, showing an individual the ideal way of living in relation to their family, society and country.', 1, '2021-08-10 13:30:08', 1, 7, 'all', ''),
(216, 10, 0, 'The Intelligent Investor by Benjamin Graham', 0, 'the-intelligent-investor-by-benjamin-graham', 4, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/2613-2021-08-10.jpg', '', 'About the Author About the Author: Benjamin Graham was born on May 8th, 1894 and died on September 21st, 1976. He was known as the father of Value Investing. Graham was an American and was born in Britain. His love for finance kept burning bright, as he taught at the Columbian Business School. His keen interest in finance is what has made our present day investments fruitful.', 1, '2021-08-10 13:34:28', 1, 7, 'all', ''),
(217, 10, 0, 'One Arranged Murder by Chetan Bhagat', 0, 'one-arranged-murder-by-chetan-bhagat', 4, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/2607-2021-08-10.jpg', '', 'Product Description\r\nKeshav has set up an investigation agency with his best friend, Saurabh. Can the two amateur detectives successfully solve another murder case that affects them personally? And where will it leave their friendship?\r\n\r\n‘Ever since you found Prerna, I lost my best friend’ is what I told Saurabh.\r\nHi, this is Keshav, and Saurabh, my best friend, flatmate, colleague and business partner, won’t talk to me. Because I made fun of him and his fiancée.\r\nSaurabh and Prerna will be getting married soon. It is an arranged marriage. However, there is more cheesy romance between them than any love-marriage couple.\r\nOn Karva Chauth, she fasted for him. She didn’t eat all day. In the evening, she called him and waited on the terrace for the moon and for Saurabh to break her fast. Excited, Saurabh ran up the steps of her three-storey house. But when he reached …\r\nWelcome to One Arranged Murder, an unputdownable thriller from India’s highest-selling author. A story about love, friendship, family and crime, it will keep you entertained and hooked right till the end.\r\n\r\nAbout the Author\r\nChetan Bhagat is the author of eleven blockbuster books. These include eight novels—Five Point Someone (2004), One Night @ the Call Center (2005), The 3 Mistakes of My Life (2008), 2 States (2009), Revolution 2020 (2011), Half Girlfriend (2014), One Indian Girl (2016) and The Girl in Room 105 (2018)—and the non-fiction titles What Young India Wants (2012), Making India Awesome (2015) and India Positive (2019). Several of his novels have been adapted into successful Bollywood films.\r\n\r\nThe New York Times called him the ‘the biggest-selling English language novelist in India’s history’. Time named him amongst the ‘100 most influential people in the world’, and Fast Company, USA, listed him as one of the world’s ‘100 most creative people in business’.\r\n\r\nChetan writes columns for leading English and Hindi newspapers, focusing on youth and national development issues. He is also a motivational speaker and screenplay writer.', 1, '2021-08-10 13:37:16', 1, 7, 'all', ''),
(218, 10, 0, 'The Art of Public Speaking by Dale Carnegie', 0, 'the-art-of-public-speaking-by-dale-carnegie', 4, 0, 0, 'Dale Carnegie', '', 1, 1, 'shipped', 'upload/images/5332-2021-08-10.jpeg', '', 'Product Description\r\nOriginally published in 1915, Dale Carnegie’s The Art of Public Speaking has been the go-to guide for those who want to better their speaking abilities for more than a century.\r\n\r\nDo you have trouble getting up in front of an audience? Are you struggling to get your point across? Public speaking can be nerve-wracking, especially if you’re a naturally nervous person or if you’re underprepared.\r\n\r\nFeatured within this classic manual are hundreds of tips and tricks on how to become an efficient and effective public speaker. The sections included address:\r\nTone\r\nDelivery\r\nEnthusiasm\r\nConfidence\r\nConcentration\r\nCharm\r\nPrecision\r\nGesturing\r\nPreparation\r\nAnd much more!\r\n\r\nStop putting your audience to sleep. Pick up your copy of The Art of Public Speaking and learn to captivate any audience today!\r\nAbout the Author\r\nDale Carnegie (1888-1955) described himself as a \"simple country boy\" from Missouri but was also a pioneer of the self-improvement genre. He authored several self-improvement titles, but is best known for How to Win Friends and Influence People.', 1, '2021-08-10 13:40:12', 1, 7, 'all', ''),
(219, 10, 0, 'The Miracle Morning by Hel Elrod', 0, 'the-miracle-morning-by-hel-elrod', 4, 0, 0, 'Hel Elrod', '', 1, 1, 'shipped', 'upload/images/8938-2021-08-10.jpg', '', 'What\'s being widely regarded as \"one of the most life changing books ever written\" may be the simplest approach to achieving everything you\'ve ever wanted, and faster than you ever thought possible\r\n\r\n\'Hal Elrod is a genius and his book The Miracle Morning has been magical in my life\' Robert Kiyosaki, bestselling author of Rich Dad Poor Dad\r\n\r\nWhat if you could wake up tomorrow and any - or EVERY - area of your life was beginning to transform? What would you change? The Miracle Morning is already transforming the lives of tens of thousands of people around the world by showing them how to wake up each day with more ENERGY, MOTIVATION, and FOCUS to take your life to the next level. It\'s been right here in front of us all along, but this book has finally brought it to life.\r\n\r\nAre you ready? The next chapter of YOUR life-the most extraordinary life you\'ve ever imagined-is about to begin. It\'s time to WAKE UP to your full potential...\r\n\r\n\'Every once in a while, you read a book that changes the way you look at life, but it is so rare to find a book that changes the way you live your life\' Tim Sanders, New York Times bestselling author of The Likeability Factor\r\n\r\n\'To read The Miracle Morning is to give yourself the gift of waking up each day to your full potential. It\'s time to stop putting off creating the life you want and deserve to live. Read this book and find out how\' Dr Ivan Misner, CEO and Founder of BNI®\r\n\r\nReview\r\n\"Hal Elrod is a genius and his book The Miracle Morning has been magical in my life\"― Robert Kiyosaki, bestselling author of Rich Dad Poor Dad\r\n\r\n\"Every once in a while, you read a book that changes the way you look at life, but it is so rare to find a book that changes the way you live your life\"― Tim Sanders, New York Times bestselling author of The Likeability Factor\r\n\r\n\"To read The Miracle Morning is to give yourself the gift of waking up each day to your full potential. It\'s time to stop putting off creating the life you want and deserve to live. Read this book and find out how\"― Dr Ivan Misner, CEO and Founder of BNI®\r\n\r\nBook Description\r\nYou\'re about to discover how you can create the most extraordinary life you\'ve ever imagined... Right NOW\r\nThe Miracle Morning shows how a morning routine built around 6 key practices known as \"Life S.A.V.E.R.S\" - silence, affirmations, visualisation, exercise, reading and scribing - can help you get more done and live your best life. Most people don\'t think they have time to change their lives or achieve their goals but Hal has proven you can start achieving your goals today by devoting only 1 minute to each of these practices every day. The Miracle Morning system now has thousands of fans who have transformed their lives by spending just one minute on each of these activities every morning.\r\n\r\nAbout the Author\r\nAt age 20, Hal Elrod was hit head-on by a drunk driver at 70 mph, was dead for six minutes, and doctors told his parents that if Hal ever came out of his coma, he would have permanent brain damage and may never walk again. After six days fighting for his life, Hal proved that we all have the ability to overcome any obstacle and create the life of our dreams. Not only did he walk, he became an ultra-marathon runner, hall of fame business achiever, international keynote speaker, success coach, husband, father, hip-hop recording artist, and multiple-time #1 bestselling author of The Miracle Morning: The 6 Habits That Will Transform Your Life Before 8AM and Taking Life Head On: How To Love the Life You Have While You Create the Life of Your Dreams - two of the highest rated and most acclaimed books on Amazon.com (just read a few of the 200+ five-star reviews, and you\'ll see why!).\r\n\r\nHal has appeared on dozens of radio and TV shows, and he\'s been featured in numerous books, including The Education of Millionaires, Cutting Edge Sales, Living College Life in the Front Row, The Author\'s Guide To Building An Online Platform, The 800-Pound Gorilla of Sales and the bestselling Chicken Soup for the Soul series.\r\n\r\nTo contact Hal about media appearances, speaking at your event, or if you just want to receive free training videos and resources, visit www.YoPalHal.com. To connect with Hal on Twitter, follow @HalElrod, and on Facebook at www.Facebook.com/YoPalHal.', 1, '2021-08-10 13:43:54', 1, 7, 'all', ''),
(220, 10, 0, 'The 5 AM Club by Robin Sharma', 0, 'the-5-am-club-by-robin-sharma', 4, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/8428-2021-08-10.jpg', '', 'Legendary leadership and elite performance expert Robin Sharma introduced The 5am Club concept over twenty years ago, based on a revolutionary morning routine that has helped his clients maximize their productivity, activate their best health and bulletproof their serenity in this age of overwhelming complexity.\r\n\r\nNow, in this life-changing book, handcrafted by the author over a rigorous four-year period, you will discover the early-rising habit that has helped so many accomplish epic results while upgrading their happiness, helpfulness and feelings of aliveness.\r\n\r\nThrough an enchanting―and often amusing―story about two struggling strangers who meet an eccentric tycoon who becomes their secret mentor, The 5am Club will walk you through:\r\n\r\nHow great geniuses, business titans and the world’s wisest people start their mornings to produce astonishing achievements\r\nA little-known formula you can use instantly to wake up early feeling inspired, focused and flooded with a fiery drive to get the most out of each day\r\nA step-by-step method to protect the quietest hours of daybreak so you have time for exercise, self-renewal and personal growth\r\nA neuroscience-based practice proven to help make it easy to rise while most people are sleeping, giving you precious time for yourself to think, express your creativity and begin the day peacefully instead of being rushed\r\n‘Insider-only’ tactics to defend your gifts, talents and dreams against digital distraction and trivial diversions so you enjoy fortune, influence and a magnificent impact on the world\r\nPart manifesto for mastery, part playbook for genius-grade productivity and part companion for a life lived beautifully, The 5am Club is a work that will transform your life. Forever.\r\n\r\nAbout the Author\r\nRobin Sharma, LL.B., LL.M., is one of the world\'s top experts on leadership and personal development, having helped millions of people to live their best lives. He is the author of 11 major international bestsellers, including The Monk Who Sold His Ferrari and The Greatness Guide. His work has been published in over 60 countries and in nearly 70 languages, making him one of the most widely read authors in the world.', 1, '2021-08-10 13:47:15', 1, 7, 'all', ''),
(221, 10, 0, 'The Richest Man in Babylon', 0, 'the-richest-man-in-babylon', 4, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/0528-2021-08-10.jpg', '', 'If you have a lean purse and are looking for financial wisdom, you’ve picked the perfect book!\r\n“A PART OF ALL YOU EARN IS YOURS TO KEEP.”\r\nFrom the importance of savings to the essentials on how to become wealthy, this collection of famous Babylonian parables imparts timeless financial wisdom. It offers insights on how to become wealthy and how to attract good luck and discusses the five laws of gold.\r\nA perfect guide to understanding finances and a powerhouse of time-tested principles to gain and retain personal wealth, The Richest Man in Babylon has been inspiring readers for generations. It continues to remain a classic bestseller.\r\n\r\nAbout the Author\r\nGeorge Samuel Clason was born in Louisiana, Missouri, on November 7, 1874. He attended the University of Nebraska and served in the United States Army during the Spanish-American War. Beginning a long career in publishing, he founded the Clason Map Company of Denver, Colorado and published the first road atlas of the United States and Canada. In 1926, he issued the first of a famous series of pamphlets on thrift and financial success, using parables set in ancient Babylon to make each of his points. These were distributed in large quantities by banks and insurance companies and became familiar to millions, the most famous being “The Richest Man in Babylon,” the parable from which the present volume takes its title. These “Babylonian parables” have become a modern inspirational classic.', 1, '2021-08-10 13:49:55', 1, 7, 'all', ''),
(222, 10, 0, 'A Brief History of Time by Stephen Hawking', 0, 'a-brief-history-of-time-by-stephen-hawking', 4, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/8145-2021-08-10.jpg', '', 'Was there a beginning of time?\r\nCould time run backwards?\r\nIs the universe infinite or does it have boundaries?\r\n\r\nThese are just some of the questions considered in an internationally acclaimed masterpiece which begins by reviewing the great theories of the cosmos from Newton to Einstein, before delving into the secrets which still lie at the heart of space and time.\r\n\r\nReview\r\nThis app/book version of Hawking\'s famous laymen book is just an amazing piece of learning. This makes much more accessible and understandable the complex and awesome topics dealt by Hawking as he explains how our universe works. I am just in awe at how creative he is to produce one of a kind e-book like this. The pace, illustrations and connections of topics within the book are so helpful and so appropriate for the new generation used to tweets and small bites of information. You can flip over some topics when you have some time, learn some amazing fact, and come back later which no rush or worry about how fast you are progressing through the book. Hope other books on complex topics are translated to this format. And I love the updates of the latest science since the publication of the original book. We have learned so much in the last decade that I agree with Hawking, it is an honour to live in this times. ― Ribozyme\r\n\r\n\'Master of the Universe...One scientist\'s courageous voyage to the frontiers of the Cosmos\' ― Newsweek\r\n\r\n\'This book marries a child\'s wonder to a genius\'s intellect. We journey into Hawking\'s universe, while marvelling at his mind\' ― The Sunday Times\r\n\r\n\'He can explain the complexities of cosmological physics with an engaging combination of clarity and wit...His is a brain of extraordinary power\' ― Observer\r\n\r\n\'To follow such a fine mind as it exposes such great problems is an exciting experience\' ― The Sunday Times\r\n\r\nAbout the Author\r\nSTEPHEN HAWKING was a brilliant theoretical physicist and is generally considered to have been one of the world\'s greatest thinkers. He held the position of Lucasian Professor of Mathematics at the University of Cambridge for thirty years and is the author of A Brief History of Time which was an international bestseller. His other books for the general reader include A Briefer History of Time, the essay collection Black Holes and Baby Universe, The Universe in a Nutshell, The Grand Design, and Black Holes: The BBC Reith Lectures.\r\nHe died on 14 March, 2018.', 1, '2021-08-10 13:52:00', 1, 7, 'all', ''),
(223, 10, 0, 'Eleven Minutes - Paulo Coelho', 0, 'eleven-minutes-paulo-coelho', 4, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/5327-2021-08-10.jpg', '', '‘Eleven minutes’ is the masterpiece of Brazilian bestselling author Paulo Coelho. This novel is based on a fictional account of a woman named Maria who lives in Rio, but moves to Geneva. She is poor and has to do menial jobs to survive in Geneva. Fate led her to be a prostitute. She has accepted her life in this way and keeps on going with it displaying great strength. It is during one of her walks down a street that she feels a sexual awakening inside her. The quest for physical pleasure leads her into some interesting situations, where she tries to find her own body and desires. While she is living a life of a prostitute, trying to understand herself sexually, she comes across a man. She crosses path with a young painter. She is instantly smitten by his charm and he is captivated by Maria too. There is a chance that she might fall in love. At this strange time, love has found her door, will she let it in? Or will it be another sexual adventure for her? This honest tale of a woman\'s journey to understand her physically and emotionally is bound to keep you hooked till the last page. The descriptions are vivid and yet leave a lot to the imagination. You cannot categorize this as an erotica, rather it will stir your soul and will force you to think and look within. Maria is not alone in this experience and many of us share it at some point or the other. Paulo Coelho deals with the complex and taboo issues of sexual awakening, love and a combination of both. How well can one keep the physical desire and platonic love boxed together in one relationship forms the crux of this book. It was originally written in Portuguese, but was later translated in many languages across the globe.\r\n\r\nAbout the author\r\nPaulo Coelho is a Brazilian author who is known for his complex style of writing and bold outlook on issues. His novels “The Alchemist”, “Veronica decides to die” and many others are international bestsellers, translated into many languages.\r\n\r\nThe book is available online for convenient shopping. You can buy this book from Amazon.in today by following a few easy steps.\r\n\r\nAbout the Author\r\nPaulo Coelho, born in Rio de Janeiro in 1947, is one of the bestselling and most influential authors in the world. The Alchemist, The Pilgrimage, The Valkyries, Brida, Veronika Decides to Die, Eleven Minutes, The Zahir, The Witch of Portobello and The Winner Stands Alone, among others, have sold 115 million copies in more than 160 countries.', 1, '2021-08-10 13:56:42', 1, 7, 'all', ''),
(224, 10, 0, 'Steve Jobs - The Man who thought Different', 0, 'steve-jobs-the-man-who-thought-different', 4, 0, 0, 'Karen Blumenthal', '', 1, 1, 'shipped', 'upload/images/8296-2021-08-10.jpg', '', 'Steve Jobs: The Man Who Thought Different is a biography on one of the pioneers of the twenty-first century, who lived to change the world and left the world transformed. Behind such a transformative soul was a bereaved childhood and a hardworking youth who started colouring the world with his own shade at the age of twenty and almost touched every sphere of human comfort with his discovery of Apple in his foster parent’s garage with his friend Steve Wozniak. Steve did not stop there, as he also invented Pixar. This biography of Steve is unbiased as Blumenthal covers the dark as well as the brilliant aspects of this hardware-software guru of all the ages.\r\n\r\nVarious facets of Steve Jobs can be known from the biography. Blumenthal’s untiring efforts and detailed research on Steve Jobs have revealed him a passionate father, a caring husband, and a devoted Buddhist. The biography also covers that dark phase of his life when he was bravely fighting against cancer for a decade. The book highlights those qualities of Steve Jobs which have made him a perfectionist and a great software and business figure of the century.\r\n\r\nSteve Jobs: The Man Who Thought Different was published by Bloomsbury India Private Limited in the year 2013. It is available in paperback.\r\n\r\nKey Features:\r\n\r\nThe book is written in a very different style. Blumenthal has provided certain details about Steve in illustrative boxes.\r\nThe information provided is unbiased and authentic since she has used Steve’s own speech for Stanford in 2005 on himself as a resource.\r\nAbout the Author\r\nThe author of the book Karen Blumenthal had worked for the Wall Street Journal for more than twenty years. She had also supervised journalists during 9/11 attack correspondents. Her contribution towards edition of 9/11 attack stories have gained the prestigious Pulitzer Prize in 2002. From 2008 to 2011, Blumenthal had been a columnist on finance in the newspaper named Getting Going.', 1, '2021-08-10 13:59:20', 1, 7, 'all', ''),
(225, 10, 0, 'The Art of War - Sun Tzu', 0, 'the-art-of-war-sun-tzu', 4, 0, 0, 'Sun Tzu', '', 1, 1, 'shipped', 'upload/images/3037-2021-08-10.jpg', '', 'Discover the Spirituality Incisive Strategies for Peacefully Resolving Conflict in this Masterpiece of Military Strategy. Written 2,500 years ago by Chinese general Sun Tzu, The Art of War is a poetic and potent treatise on military strategy still in use in war colleges around the world. Yet its principles transcend warfare and have practical applications to all the conflicts and crises we face in our lives -in our workplaces, our families, even within ourselves. Thomas Huynh guides you through Sun Tzu\'s masterwork, highlighting principles that encourage a perceptive and spiritual approach to conflict, enabling you to: Prevent conflicts before they arise, peacefully and quickly resolve conflicts when they do arise, act with courage, intelligence and benevolence in adversarial situations, convert potential enemies into friends, control your emotions before they control you. Now you can experience the effectiveness of Sun Tzu\'s teachings even if you have no previous knowledge of the Art of War. Insightful yet unobtrusive facing-page commentary explains the subtleties of the text, allowing you to unlock the power of its teachings and help prevent and resolve the conflicts in your own life.', 1, '2021-08-10 14:03:05', 1, 7, 'all', ''),
(226, 10, 0, 'Tales from Shakespeare', 0, 'tales-from-shakespeare', 4, 0, 0, 'Mary Ann Lamb & Charles Lamb', '', 1, 1, 'shipped', 'upload/images/0442-2021-08-10.jpg', '[\"upload/other_images/1628604331.192-703.jpg\"]', 'A retelling of the comedies and tragedies of Shakespeare, Tales from Shakespeare by Charles and Mary Lamb brings together twenty stories, simplified for the young reader. Beginning with ‘The Tempest’ and ending with ‘Pericles, Prince of Trye’, it includes the summaries of some of Shakespeare’s most memorable and influential works.\r\nWhile the comedies have been written by Mary, the tragedies have been penned down by Charles.\r\nOne of the bestselling books of the nineteenth century, Tales from Shakespeare continues to remain a popular children’s classic more than two centuries after its first publication in 1807.\r\n\r\nAbout the Author\r\nMary Ann Lamb (1764–1847) and Charles Lamb (1775–1834) were born in London to John and Elizabeth Lamb. While Mary was the third of the seven children, Charles was the youngest. Their father, John Lamb, worked for Samuel Salt, an English lawyer and politician. The young Lambs were allowed access to Salt’s library. At a very young age, Charles was taught to read by Mary.\r\nIn 1806, they wrote Tales from Shakespeare to familiarize the young with Shakespeare’s plays. While Mary was responsible for the comedies, Charles wrote the tragedies. A collection of twenty stories, it was published in 1807 and has never been out of print.\r\nThe following year, Mary wrote and published her collection of tales titled Mrs. Leicester’s School. Poems for Children, another work by Charles and Mary, was published in 1810. Charles began writing essays which first appeared in The London Magazine in 1820. His collection titled Essays of Elia was published in 1823.\r\nThe second volume of his essays titled Last Essays of Elia were published by the publisher Edward Moxon in 1833. Charles breathed his last on December 27, 1834 and was buried at the All Saints’ Churchyard, Edmonton. Mary outlasted him by more than a decade. She died on May 20, 1847 and was buried next to Charles in the Churchyard.', 1, '2021-08-10 14:05:31', 1, 7, 'all', ''),
(227, 10, 0, 'Harry Potter and The Cursed Child', 0, 'harry-potter-and-the-cursed-child', 4, 0, 0, 'J.K. Rowling, Jack Thorne & John Tiffany', '', 1, 1, 'shipped', 'upload/images/9833-2021-08-10.jpg', '', 'The official playscript of the original West End production of Harry Potter and the Cursed Child.\r\n\r\nIt was always difficult being Harry Potter and it isn\'t much easier now that he is an overworked employee of the Ministry of Magic, a husband, and father of three school-age children.\r\n\r\nWhile Harry grapples with a past that refuses to stay where it belongs, his youngest son Albus must struggle with the weight of a family legacy he never wanted. As past and present fuse ominously, both father and son learn the uncomfortable truth: sometimes, darkness comes from unexpected places.\r\n\r\nThe playscript for Harry Potter and the Cursed Child was originally released as a \'special rehearsal edition\' alongside the opening of Jack Thorne\'s play in London\'s West End in summer 2016. Based on an original story by J.K. Rowling, John Tiffany and Jack Thorne, the play opened to rapturous reviews from theatregoers and critics alike, while the official playscript became an immediate global bestseller.\r\n\r\nThis revised paperback edition updates the \'special rehearsal edition\' with the conclusive and final dialogue from the play, which has subtly changed since its rehearsals, as well as a conversation piece between director John Tiffany and writer Jack Thorne, who share stories and insights about reading playscripts. This edition also includes useful background information including the Potter family tree and a timeline of events from the wizarding world prior to the beginning of Harry Potter and the Cursed Child.\r\n\r\nReview\r\nWhether encountered on stage or on the page, this trip back into the magical world of Hogwarts is thrilling, The Telegraph\r\n\r\nFans can breathe easy knowing this play has been respectfully and lovingly wrought. Tensions thrum, spells fly but at center stage, as always in the Potterverse, is the overriding importance of love and friendship, especially in the face of danger, Booklist, starred review\r\n\r\nBook Description\r\nThe Eighth Story. Nineteen Years Later.\r\nBased on an original new story by J.K. Rowling, John Tiffany and Jack Thorne, a play by Jack Thorne.\r\n\r\nAbout the Author\r\nJ.K. Rowling is the author of the much-loved series of seven Harry Potter novels, originally published between 1997 and 2007. Along with the three companion books written for charity, the series has sold over 500 million copies, been translated into over 80 languages, and made into eight blockbuster films.\r\n\r\nOriginally written by J.K. Rowling in aid of Comic Relief as a Hogwarts textbook, Fantastic Beasts and Where to Find Them became the inspiration behind a new and original five-film series for Warner Bros., the first of which was released in 2016. The second film in the series, Fantastic Beasts: The Crimes of Grindelwald, was released in November 2018.\r\n\r\nJ.K. Rowling has collaborated with playwright Jack Thorne and director John Tiffany on a stage play, Harry Potter and the Cursed Child, which opened in London\'s West End in 2016 and on Broadway in 2018, and will have further worldwide openings in 2019.\r\n\r\nJ.K. Rowling also writes the Cormoran Strike crime novels, under the pseudonym Robert Galbraith. The fourth in this series was published in autumn 2018. The Strike books have been adapted for television for BBC and HBO television by Brontë Film & Television. J.K. Rowling is also the author of The Casual Vacancy, a standalone novel for adults, published in 2012.\r\n\r\n\r\n\r\nJohn Tiffany directed Once, for which he was the recipient of multiple awards both in the West End and on Broadway. As Associate Director of the Royal Court, his work includes The Twits, Hope and The Pass. He was the director of Let the Right One In for the National Theatre of Scotland, which transferred to the Royal Court, West End and St Ann\'s Warehouse. His other work for the National Theatre of Scotland includes Macbeth (also Broadway), Enquirer, The Missing, Peter Pan, The House of Bernarda Alba, Transform Caithness: Hunter, Be Near Me, Nobody Will Ever Forgive Us, The Bacchae, Black Watch, for which he won the Olivier and Critics\' Circle Best Director Awards, Elizabeth Gordon Quinn and Home: Glasgow. Other recent credits include The Glass Menagerie at ART and on Broadway and The Ambassador at BAM. Tiffany was Associate Director of the National Theatre of Scotland from 2005 to 2012, and was a Radcliffe Fellow at Harvard University in the 2010-2011 academic year.', 1, '2021-08-10 14:08:17', 1, 7, 'all', ''),
(228, 10, 0, 'The Jungle Book', 0, 'the-jungle-book', 4, 0, 0, 'Rudyard Kipling', '', 1, 1, 'shipped', 'upload/images/0680-2021-08-10.jpg', '', 'Adventures in the wild\r\n\r\nOn a warm evening in the Seeonee hills, a family of wolves finds someone at the threshold of their cave–a human child, who knows nothing of the world of men. Adopted by Father Wolf, the man-cub Mowgli grows up with the pack in the Jungle.\r\n\r\nMowgli begins his journey and learns the law of the Jungle with the help of his new-found friends: Bagheera the wise Panther and lovable old Baloo. Together they face many dangers and adventures, as Mowgli comes face-to-face with Shere Khan the tiger and the Bandar-Log.\r\n\r\nEmbark on this adventurous journey with Mowgli, Rikki-tikki-tavi, Little Toomai and many others, as you read the enchanting \'The Jungle Book\'. As you go from one thrilling escapade to the other, let Kipling take you into a world of fantasy.', 1, '2021-08-10 14:10:53', 1, 7, 'all', '');
INSERT INTO `products` (`id`, `seller_id`, `row_order`, `name`, `tax_id`, `slug`, `category_id`, `subcategory_id`, `indicator`, `manufacturer`, `made_in`, `return_status`, `cancelable_status`, `till_status`, `image`, `other_images`, `description`, `status`, `date_added`, `is_approved`, `return_days`, `type`, `pincodes`) VALUES
(229, 10, 0, 'A Tale of Two Cities by Charles Dickens', 0, 'a-tale-of-two-cities-by-charles-dickens', 4, 0, 0, 'Charles Dickens', '', 1, 1, 'shipped', 'upload/images/3144-2021-08-10.jpg', '', 'A Tale of Two Cities (1859) is a novel by Charles Dickens, set in London and Paris before and during the French Revolution. With well over 200 million copies sold, it ranks amongst the most famous works in the history of literary fiction.The novel depicts the plight of the French peasantry demoralised by the French aristocracy in the years leading up to the revolution, the corresponding brutality demonstrated by the revolutionaries toward the former aristocrats in the early years of the revolution, and many unflattering social parallels with life in London during the same time period. It follows the lives of several characters through these events. The 45-chapter novel was published in 31 weekly instalments in Dickens\'s new literary periodical titled All the Year Round. From April 1859 to November 1859, Dickens also republished the chapters as eight monthly sections in green covers. All but three of Dickens\'s previous novels had appeared only as monthly instalments. The first weekly instalment of A Tale of Two Cities ran in the first issue of All the Year Round on 30 April 1859. The last ran thirty weeks later, on 26 November.\r\n\r\nReview\r\nI shall treasure the richly detailed explanatory notes. It\'s an edition which will surely sell to the general reader; yet many truer Dickens specialists than I will be excited by the scope and subtlety of the introduction. --Dr P. Merchant, Christ Church College, Canterbury\r\n\r\nThe large clear print, very full notes, and inclusion of Dickens\'s number plans make it the best paperback available for student use. --Professor Norman Page, University of Nottingham\r\n\r\nI read it every other year. It is the best story of the best hero. It does not pale. --You (Mail on Sunday Magazine)\r\n\r\nAbout the Author\r\nBiography Charles John Huffam Dickens (7 February 1812 9 June 1870) was an English writer and social critic. He created some of the world\'s most memorable fictional characters and is generally regarded as the greatest novelist of the Victorian period. During his life, his works enjoyed unprecedented fame, and by the twentieth century his literary genius was broadly acknowledged by critics and scholars. His novels and short stories continue to be widely popular. Born in Portsmouth, England, Dickens left school to work in a factory after his father was thrown into debtors\' prison. Over his career he edited a weekly journal for 20 years, wrote 15 novels, 5 novellas and hundreds of short stories and non-fiction articles, lectured and performed extensively, was an indefatigable letter writer, and campaigned vigorously for children\'s rights, education, and other social reforms. Dickens sprang to fame with the 1836 serial publication of The Pickwick Paper. Within a few years he had become an international literary celebrity, famous for his humour, satire, and keen observation of character and society. His novels, most published in monthly or weekly installments, pioneered the serial publication of narrative fiction, which became the dominant Victorian mode for novel publication. The installment format allowed Dickens to evaluate his audience\'s reaction, and he often modified his plot and character development based on such feedback. For example, when his wife\'s chiropodist expressed distress at the way Miss Mowcher in David Copperfield seemed to reflect her disabilities, Dickens went on to improve the character with positive features. Fagin in Oliver Twist apparently mirrors the famous fence Ikey Solomon; His caricature of Leigh Hunt in the figure of Mr Skimpole in Bleak House was likewise toned down on advice from some of his friends, as they read episodes. In the same novel, both Lawrence Boythorne and Mooney the beadle are drawn from real life Boythorne from Walter Savage Landor and Mooney from \'Looney\', a beadle at Salisbury Square. His plots were carefully constructed, and Dickens often wove in elements from topical events into his narratives. Masses of the illiterate poor chipped in happiness to have each new monthly episode read to them, opening up and inspiring a new class of readers.', 1, '2021-08-10 14:13:45', 1, 7, 'all', ''),
(230, 10, 0, 'The Warren Buffett Way', 0, 'the-warren-buffett-way', 4, 0, 0, 'Robert G. Hagstrom', '', 1, 1, 'shipped', 'upload/images/5620-2021-08-10.jpg', '', 'Warren Buffett is the most famous investor of all time and one of today’s most admired business leaders. He became a billionaire and investment sage by looking at companies as businesses rather than prices on a stock screen. The first two editions of The Warren Buffett Way gave investors their first in-depth look at the innovative investment and business strategies behind Buffett’s spectacular success. The new edition updates readers on the latest investments by Buffett. And, more importantly, it draws on the new field of behavioral finance to explain how investors can overcome the common obstacles that prevent them from investing like Buffett. \r\n\r\nNew material includes: \r\n\r\nHow to think like a long-term investor – just like Buffett\r\nWhy “loss aversion”, the tendency of most investors to overweight the pain of losing money, is one of the biggest obstacles that investors must overcome.\r\nWhy behaving rationally in the face of the ups and downs of the market has been the key to Buffett’s investing success\r\nAnalysis of Buffett’s recent acquisition of H.J. Heinz and his investment in IBM stock \r\nThe greatest challenge to emulating Buffett is not in the selection of the right stocks, Hagstrom writes, but in having the fortitude to stick with sound investments in the face of economic and market uncertainty. The new edition explains the psychological foundations of Buffett’s approach, thus giving readers the best roadmap yet for mastering both the principles and behaviors that have made Buffett the greatest investor of our generation.', 1, '2021-08-10 14:16:21', 1, 7, 'all', ''),
(231, 10, 0, 'Travelling to Infinity by Jane Hawking', 0, 'travelling-to-infinity-by-jane-hawking', 4, 0, 0, 'Jane Hawking', '', 1, 1, 'shipped', 'upload/images/4361-2021-08-10.jpg', '', 'Professor Stephen Hawking is one of the most famous and remarkable scientists of our age and author of the scientific bestseller \"A Brief History of Time\", which sold over 25 million copies across the world and will be adapted as a children\'s book in the Autumn of next year. In this compelling memoir his first wife, Jane Hawking, relates the inside story of their extraordinary marriage. As Stephen\'s academic renown soared, his body was collapsing under the assaults of motor neurone disease, and Jane\'s candid account of trying to balance his 24-hour care with the needs of their growing family will be inspirational to anyone dealing with family illness. The inner-strength of the author, and the self-evident character and achievements of her husband, make for an incredible tale that is always presented with unflinching honesty; the author\'s candour is no less evident when the marriage finally ends in a high-profile meltdown, with Stephen leaving Jane for one of his nurses, while Jane goes on to marry an old family friend. In this exceptionally open, moving and often funny memoir, Jane Hawking confronts not only the acutely complicated and painful dilemmas of her first marriage, but also the faultlines exposed in a relationship by the pervasive effects of fame and wealth. The result is a book about optimism, love and change that will resonate with readers everywhere.\r\n\r\nAbout the Author\r\nJane Hawking, who was Stephen Hawking\'s wife formore than25 years, is a writer, lecturer, and the author of\"At Home in France.\"\"', 1, '2021-08-10 15:50:02', 1, 7, 'all', ''),
(232, 10, 0, 'Win or Die Lessons for Life from Game of Thrones', 0, 'win-or-die-lessons-for-life-from-game-of-thrones', 4, 0, 0, 'Bruce Craven', '', 1, 1, 'shipped', 'upload/images/0532-2021-08-11.jpg', '', 'Why do people follow Jon snow into battle? What makes Tyrion Lannister such an effective advisor? How has Daenerys Targaryen overcome so many challengers? And, in stressful life situations, how can you avoid losing your own head? Westeros is a harsh, volatile and bloody landscape, but so is the real world. Everyday you\'re presented with challenges; decisions on which roads to take, which risks to confront and whether you should answer the call to adventure and go for the option that\'s outside of your comfort Zone. From the middle of the battleground, it can be difficult to see where the victory lies. In this fascinating book, leading business expert Bruce Craven analyses the various players in the game of Thrones world, following their moves as they learn how to face conflict, build resilience, develop contextual and emotional intelligence, improve their long-term vision and more. An entertaining and accessible guide through our dangerous work, home and social lives, win or die shows that even when enemies are at the city Gates and dragons circle above, you too can turn threat into opportunity, win the mental battle and get to the top of your game.\r\n\r\nAbout the Author\r\nBruce Craven teaches his popular elective \'Leadership Through Fiction\' at Columbia Business School, w here he also serves as the Director of Columbia\'s Advanced Management Program. He has taught workshops in resilience and flexible thinking for organisations in the United States and Europe. He studied Politics and Literature at the University of California at Santa Cruz and has an MFA in Writing from Columbia University. He lives with his wife and two sons in the Coachella Valley in California', 1, '2021-08-11 07:38:49', 1, 7, 'all', ''),
(233, 10, 0, 'Rich Dad Poor Dad', 0, 'rich-dad-poor-dad', 4, 0, 0, 'Robert T. Kiyosaki', '', 1, 1, 'shipped', 'upload/images/2771-2021-08-11.jpg', '', 'Rich Dad Poor Dad is the #1 personal finance book of all time. Listen today to set yourself up for a wealthy, happy future.\r\n\r\nRobert Kiyosaki’s easy tips and straight talk will…\r\n\r\nExplode the myth that you need to earn a high income to become rich\r\nChallenge the belief that your house is an asset\r\nDefine once and for all an asset and a liability\r\nShow parents why they can’t rely on the school system to educate kids about money\r\nClearly lay out what to teach kids about money for their future financial success\r\nWith an incredible number of 5-star reviews, Rich Dad Poor Dad has challenged and changed the way tens of millions of people around the world think about money. With perspectives that often contradict conventional wisdom, Kiyosaki has earned a reputation for irreverence and courage. He is regarded worldwide as a passionate advocate for financial education. His easy-to-understand audiobook empowers you to make changes now - and enjoy the results for years to come.\r\n\r\n\"The main reason people struggle financially is because they have spent years in school but learned nothing about money. The result is that people learn to work for money… but never learn to have money work for them.\"\r\n--Robert Kiyosaki Rich Dad Poor Dad - The #1 Personal Finance Book of All Time!\r\n\r\n“Rich Dad Poor Dad is a starting point for anyone looking to gain control of their financial future.”\r\n--USA Today', 1, '2021-08-11 07:41:10', 1, 7, 'all', ''),
(234, 10, 0, 'The Monk who sold his Ferrari', 0, 'the-monk-who-sold-his-ferrari', 4, 0, 0, 'Robin Sharma', '', 1, 1, 'shipped', 'upload/images/4741-2021-08-11.jpg', '', 'A renowned inspirational fiction, The Monk Who Sold His Ferrari is a revealing story that offers the readers a simple yet profound way to live life. The plot of this story revolves around Julian Mantle, a lawyer who has made his fortune and name in the profession. A sudden heart-attack creates havoc in the successful lawyer’s life. Jolted by the sudden onset of the illness, his practice comes to a standstill. He ponders over material success being worth it all, renounces all of it and leaves for India.\r\n\r\nA visit to India about a spiritual awakening that opens up new vistas and Julian begins to view life in a different perspective. He decides to live his life once again but in a way that is much more fulfilling and meaningful than before.\r\n\r\nIn the book, the reader goes through a spiritual journey and into a very old culture that has gathered much wisdom over the millennia. The book advocates about how to live happily, think deep and rightly, value time and relationships, be more disciplined, follow the heart’s call and live every moment of the life.\r\n\r\nWritten in simple words, the book has turned out to be a bestseller and is more than just an endearing story. Through storytelling, Robin Sharma showcases the miracles and wonders of living a fulfilling life. In the process, the book introduces readers to enlightening yet simple principles that vouch to make life better, happier and more meaningful.\r\n\r\nA bestselling novel, what readers all over the globe appreciate about this book is its deft amalgam of the philosophies from both western and eastern worlds. The book has been followed by important personalities around the world.\r\n\r\nAbout the Author\r\nRobin Sharma, the bestselling author of \'The Monk Who Sold His Ferrari\', first published in 1999, is an International Leadership Professional Guru who is credited with having written 15 books on leadership. He has been guiding people to live a better life, by drawing inspiration from his own life experiences. The Leader Who Had No Title, The Leader Who Had No Title, The Greatness Guide and The Saint and The Saint are among his best books. He heads the Sharma Leadership International Inc, a firm that trains people in leadership. A former litigation lawyer, Robin holds a law degree from Dalhousie Law School, Canada. This book along with The Greatness Guide has been among the world’s bestsellers and has been translated in as many as 70 languages all over the world.\r\n\r\nReview\r\nEveryone loves a good fable, and this is certainly one. The protagonist is Julian Mantle, a high-profile attorney with a whacked-out schedule and a shameful set of spiritual priorities. Of course it takes a crisis (heart attack) to give Mantle pause. And pause he does--suddenly selling all his beloved possessions to trek India in pursuit of a meaningful existence. The Himalayan gurus along the way give simple advice, such as, \"What lies behind you and what lies before you is nothing compared to what lies within you.\" Yet it is easy to forgive the story\'s simplicity because each kernel of wisdom is framed to address the persistent angst of Western white-collar professionals.\r\n\r\nHere is the story of Julian Mantle, a superstar lawyer whose out-of-balance lifestyle leads him to a near-fatal heart attack in a packed courtroom. His physical collapse brings him into a spiritual crisis that forces him to confront the condition of his life. Hoping to find happiness and fulfillment, he embarks upon an extraordinary odyssey to an ancient culture, where he discovers a powerful system to release the potential of his mind, body, and soul and learns to live with passion, purpose, and peace. Brilliantly blending ancient spiritual wisdom of the east with contemporary success principles of the West, this inspiring tale provides a step-by-step approach to living with greater courage, balance, abundance and joy.', 1, '2021-08-11 07:44:16', 1, 7, 'all', ''),
(235, 10, 0, 'The Fault in our Stars', 0, 'the-fault-in-our-stars-1', 4, 0, 0, 'John Green', '', 1, 1, 'shipped', 'upload/images/5442-2021-08-11.jpg', '', 'The beloved, #1 global bestseller by John Green, author of The Anthropocene Reviewed and Turtles All the Way Down\r\n\r\n“John Green is one of the best writers alive.” –E. Lockhart, #1 bestselling author of We Were Liars\r\n\r\n“The greatest romance story of this decade.″ –Entertainment Weekly\r\n\r\n#1 New York Times Bestseller • #1 Wall Street Journal Bestseller • #1 USA Today Bestseller • #1 International Bestseller\r\n\r\nDespite the tumor-shrinking medical miracle that has bought her a few years, Hazel has never been anything but terminal, her final chapter inscribed upon diagnosis. But when a gorgeous plot twist named Augustus Waters suddenly appears at Cancer Kid Support Group, Hazel’s story is about to be completely rewritten.\r\n\r\nFrom John Green, #1 bestselling author of The Anthropocene Reviewed and  Turtles All the Way Down, The Fault in Our Stars is insightful, bold, irreverent, and raw. It brilliantly explores the funny, thrilling, and tragic business of being alive and in love.\r\n\r\nReview\r\nCRITICAL ACCLAIM FOR THE FAULT IN OUR STARS:\r\n \r\n“Damn near genius . . . The Fault in Our Stars is a love story, one of the most genuine and moving ones in recent American fiction, but it’s also an existential tragedy of tremendous intelligence and courage and sadness.” — Lev Grossman, TIME Magazine\r\n \r\n“This is a book that breaks your heart—not by wearing it down, but by making it bigger until it bursts.”\r\n— The Atlantic\r\n \r\n“A story about two incandescent kids who will live a long time in the minds of the readers who come to know them.”\r\n—People\r\n \r\n“Remarkable . . . A pitch-perfect, elegiac comedy.”\r\n—USA Today\r\n \r\n“A smarter, edgier Love Story for the Net Generation.”\r\n—Family Circle\r\n \r\n“Because we all need to feel first love again. . . . Sixteen-year-old Hazel faces terminal cancer with humor and pluck. But it isn’t until she meets Augustus in a support group that she understands how to love or live fully.”\r\n—Oprah.com, a Best Book selection and one of “5 Books Every Woman Needs to Read Before Her Next Birthday”\r\n \r\n“[Green’s] voice is so compulsively readable that it defies categorization. You will be thankful for the little infinity you spend inside this book.”\r\n—NPR.org\r\n \r\n“Hilarious and heartbreaking . . . reminds you that sometimes when life feels like it’s ending, it’s actually just beginning.”\r\n—Parenting magazine\r\n \r\n“John Green deftly mixes the profound and the quotidian in this tough, touching valentine to the human spirit.”\r\n—The Washington Post\r\n \r\n“[Green] shows us true love—two teenagers helping and accepting each other through the most humiliating physical and emotional ordeals—and it is far more romantic than any sunset on the beach.”\r\n— New York Times Book Review\r\n \r\n“In its every aspect, this novel is a triumph.”\r\n— Booklist, starred review\r\n \r\n \r\n“You know, even as you begin the tale of their young romance, that the end will be 100 kinds of awful, not so much a vale as a brutal canyon of tears. . . . Green’s story of lovers who aren’t so much star-crossed as star-cursed leans on literature’s most durable assets: finely wrought language, beautifully drawn characters and a distinctive voice.”\r\n— Frank Bruni, The New York Times\r\n \r\n“A novel of life and death and the people caught in between, The Fault in Our Stars is John Green at his best. You laugh, you cry, and then you come back for more.”\r\n— Markus Zusak, bestselling and Printz Honor–winning author of The Book Thief\r\n \r\n“ The Fault in Our Stars takes a spin on universal themes—Will I be loved? Will I be remembered? Will I leave a mark on this world?—by dramatically raising the stakes for the characters who are asking.”\r\n— Jodi Picoult, bestselling author of My Sister’s Keeper and Sing You Home\r\n \r\n“John Green is one of the best writers alive.”\r\n— E. Lockhart, National Book Award Finalist and Printz Honor–winning author of The Disreputable History of Frankie Landau-Banks and We Were Liars\r\n \r\n\r\nAbout the Author\r\nJohn Green is the award-winning, #1 bestselling author of books including  Looking for Alaska,  The Fault in Our Stars, and  Turtles All the Way Down. His books have received many accolades, including a Printz Medal, a Printz Honor, and an Edgar Award. John has twice been a finalist for the LA Times Book Prize and was selected by  TIME magazine as one of the 100 Most Influential People in the World. He is also the writer and host of the critically acclaimed podcast  The Anthropocene Reviewed. With his brother, Hank, John has co-created many online video projects, including Vlogbrothers and the educational channel Crash Course. He lives with his family in Indianapolis, Indiana. You can visit John online at johngreenbooks.com.', 1, '2021-08-11 07:46:51', 1, 7, 'all', ''),
(236, 10, 0, 'Aleph by Paulo Coelho', 0, 'aleph-by-paulo-coelho', 4, 0, 0, 'Paulo Coelho', '', 1, 1, 'shipped', 'upload/images/1358-2021-08-11.jpg', '', 'Another stunning novel by the author of The Alchemist.\r\n\r\nAleph marks a return to Paulo Coelho’s beginnings. In a frank and surprising personal story, one of the world’s most beloved authors embarks on a remarkable and transformative journey of self-discovery.\r\n\r\nFacing a grave crisis of faith, and seeking a path of spiritual renewal and growth, Paulo decides to start over: to travel, to experiment, to reconnect with people and the world. On this journey through Europe, Africa, and Asia, he will again meet Hilal―the woman he loved 500 years before―an encounter that will initiate a mystical voyage through time and space, through past and present, in search of himself.\r\n\r\nAleph is an encounter with our fears and our sins; a search for love and forgiveness, and the courage to confront the inevitable challenges of life.\r\n\r\nReview\r\n‘His books have had a life-enhancing impact on millions of people.’\r\nTHE TIMES\r\n\r\n‘One of the few to deserve the term Publishing Phenomenon.’\r\nINDEPENDENT ON SUNDAY\r\n\r\n‘Coelho’s writing is beautifully poetic but his message is what counts…he gives me hope and puts a smile on my face.’\r\nDAILY EXPRESS\r\n\r\n‘Paulo Coelho is a literary superstar’ THE IRISH TIMES\r\n\r\n‘A beacon of spiritual enlightenment’ THE BIG ISSUE\r\n\r\nAbout the Author\r\nPaulo Coelho, born in Rio de Janeiro in 1947, is one of the bestselling and most influential authors in the world. The Alchemist, The Pilgrimage, The Valkyries, Brida, Veronika Decides to Die, Eleven Minutes, The Zahir, The Witch of Portobello and The Winner Stands Alone, among others, have sold 115 million copies in more than 160 countries.', 1, '2021-08-11 07:48:26', 1, 7, 'all', ''),
(237, 10, 0, 'Zero to One : Notes on startups, or How to build the future', 0, 'zero-to-one-notes-on-startups-or-how-to-build-the-future', 4, 0, 0, 'Peter Thiel', '', 1, 1, 'shipped', 'upload/images/2850-2021-08-11.jpg', '', 'What Valuable Company is Nobody Building?\r\n\r\nThe next Bill Gates will not build an operating system. The next Larry Page or Sergey Brin won’t make a search engine. If you are copying these guys, you aren’t learning from them. It’s easier to copy a model than to make something new: doing what we already know how to do takes the world from 1 to n, adding more of something familiar. Every new creation goes from 0 to 1. This book is about how to get there.\r\n\r\nReview\r\n‘Peter Thiel has built multiple breakthrough companies, and Zero to One shows how.’ - Elon Musk, CEO of SpaceX and Tesla\r\n\r\n‘This book delivers completely new and refreshing ideas on how to create value in the world.’ - Mark Zuckerberg, CEO of Facebook\r\n\r\n‘When a risk taker writes a book, read it. In the case of Peter Thiel, read it twice. Or, to be safe, three times. This is a classic.’ - Nassim Nicholas Taleb, author of The Black Swan\r\n\r\nAbout the Author\r\nPeter Thiel is an entrepreneur and investor. He started PayPal in 1998, led it as CEO, and took it public in 2002, defining a new era of fast and secure online commerce. In 2004 he made the first outside investment in Facebook, where he serves as a director. The same year he launched Palantir Technologies, a software company that harnesses computers to empower human analysts in fields like national security and global finance. He has provided early funding for LinkedIn, Yelp, and dozens of successful technology startups, many run by former colleagues who have been dubbed the “PayPal Mafia.” He is a partner at Founders Fund, a Silicon Valley venture capital firm that has funded companies like SpaceX and Airbnb. He started the Thiel Fellowship, which ignited a national debate by encouraging young people to put learning before schooling, and he leads the Thiel Foundation, which works to advance technological progress and long- term thinking about the future.', 1, '2021-08-11 07:51:19', 1, 7, 'all', ''),
(238, 10, 0, 'The Alchemist : Paulo Coelho', 0, 'the-alchemist-paulo-coelho', 4, 0, 0, 'Paulo Coelho', '', 1, 1, 'shipped', 'upload/images/1791-2021-08-11.jpg', '', 'Paulo Coelho\'s enchanting novel has inspired a devoted following around the world. This story, dazzling in its powerful simplicity and inspiring wisdom, is about an Andalusian shepherd boy named Santiago who travels from his homeland in Spain to the Egyptian desert in search of a treasure buried in the Pyramids. Along the way he meets a Gypsy woman, a man who calls himself\r\n\r\nReview\r\n‘An exceptional writer.\' -- USA Today\r\n\r\n‘His books have had a life-enhancing impact on millions of people.’ -- The Times\r\n\r\n‘One of the few to deserve the term Publishing Phenomenon.’ -- Independent On Sunday\r\n\r\n‘Coelho’s writing is beautifully poetic but his message is what counts… he gives me hope and puts a smile on my face.’ -- Daily Express\r\n\r\n\r\n\r\nLike the one-time bestseller Jonathan Livingston Seagull, The Alchemist presents a simple fable, based on simple truths and places it in a highly unique situation. And though we may sniff a bestselling formula, it is certainly not a new one: even the ancient tribal storytellers knew that this is the most successful method of entertaining an audience while slipping in a lesson or two. Brazilian storyteller Paulo Coehlo introduces Santiago, an Andalusian shepherd boy who one night dreams of a distant treasure in the Egyptian pyramids. And so he\'s off: leaving Spain to literally follow his dream.\r\n\r\nAlong the way he meets many spiritual messengers, who come in unassuming forms such as a camel driver and a well-read Englishman. In one of the Englishman\'s books, Santiago first learns about the alchemists--men who believed that if a metal were heated for many years, it would free itself of all its individual properties, and what was left would be the \"Soul of the World.\" Of course he does eventually meet an alchemist, and the ensuing student-teacher relationship clarifies much of the boy\'s misguided agenda, while also emboldening him to stay true to his dreams. \"My heart is afraid that it will have to suffer,\" the boy confides to the alchemist one night as they look up at a moonless night.\r\n\r\nAbout the Author\r\nBorn in Brazil, Paulo Coelho started his career as a lyricist and theatre director and later left it to become an author. Paulo has written and published over 30 books and is also an avid blogger. He is active on numerous other social media platforms. Paulo Coelho was named the Messenger of Peace of the United Nations in 2007 and has bagged numerous prestigious awards like the Crystal Award by the World Economic Forum, The Honorable Award of the President of the Republic by the President of Bulgaria and so on.', 1, '2021-08-11 07:53:22', 1, 7, 'all', ''),
(239, 10, 0, 'The 7 Habits of Highly Effective People', 0, 'the-7-habits-of-highly-effective-people', 4, 0, 0, 'R. Stephen Covey', '', 1, 1, 'shipped', 'upload/images/2404-2021-08-11.jpg', '', 'An ideal guide to building your personality by altering your habits\r\n\r\nIt is rightly said that habits make or break a man. If you want to know why you are not doing something right, sometimes all you need is to perform an analysis of your habits and consider altering them. Because sometimes it’s not about what you do, but more about how you do it! And that’s where your habits play a very important role.\r\n\r\n\'The 7 habits of Highly Effective People\' is a book that aims at providing its readers with the importance of character ethics and personality ethics. The author talks about the values of integrity, courage, a sense of justice and most importantly, honesty. The book is a discussion about the seven most essential habits that every individual must adopt to in order to live a life which is more fulfilling.\r\n\r\nContent of the book:\r\n\r\nThe author continues to take the readers through the journey of character development. He elaborates how the development of the character of a being ranges from the time of his birth to the years until he grows independent. The first three habits demark the development one goes from dependence to independence. The next three habits describe in detail about interdependence while the final seventh habit deals with the new self, that is renewal.\r\n\r\nThe book is highly recommended for people of all ages. It also holds a record of having over 25 million copies sold in about as many as 40 languages all over the world.\r\n\r\nAbout the Author:\r\n\r\nStephen R Covey, the author of the book, is known to hold an MBA from the Harvard University. In his previous years of schooling, Covey also has studied Religious Education and Business Administration. It was in his doctoral thesis that Covey came across a contrast in the literature regarding self-help. His observations marked that the books post 1920’s focused highly on personality traits while the ones before that focused on character development. That is when the author put forth his belief about how a balance between the two is more essential than the two in isolation.\r\n\r\nYou can bag this book from Amazon.in today by following a few easy steps.\r\n\r\nAbout the Author\r\nAbout the Author: Stephen R. Covey\'s educational qualifications include B.S in Business Administration from the University of Utah, Doctorate of Religious Education from Brigham Young University and MBA from Harvard University. He is a self-help author and a speaker. Some of Stephen\'s other books are Spiritual Roots of Human Relations, Principle Centered Leadership and The 8th Habit: From Effectiveness to Greatness. Stephen has bagged numerous awards like the Golden Gavel Award, The Sikhs 1998 International Man of Peace Award and the International Entrepreneur of the Year Award.', 1, '2021-08-11 08:16:27', 1, 7, 'all', ''),
(240, 10, 0, 'The Leader in You : Dale Carnegie', 0, 'the-leader-in-you-dale-carnegie', 4, 0, 0, '', '', 1, 1, 'shipped', 'upload/images/7527-2021-08-11.jpg', '', 'Dale Carnegie & Associates, Inc., have shown success for centuries —This has been proved by a millions of satisfied graduates, 3, 000-plus enrollment chart per week and book sales, including the mega-bestseller How to Win Friends and Influence People, totaling over thirty million copies. This book The Leader in You, coauthors Stuart R. Levine and Michael A. Crom speaks about the how regardless of the of his or her job, humans can harness creativity and enthusiasm to work more productively.\r\n\r\nTaking deep understanding from the leading figures in the corporate, entertainment, sports, academic and political arenas and covering interviews and advices from important personalities like Lee Iacocca and Margaret Thatcher, this unique book talks about strategies to help you identify your leadership strengths, achieve your goals and increase your self-confidence, completely remove an “us vs. them” mentality, become a team player and strengthen cooperation among associates, balance work and leisure, control your worries and charge your life. This book would be a great buy for all and is available in paperback format on the Amazon site.\r\n\r\nAbout the author\r\nDale Breckenridge Carnegie was an American writer and lecturer and the developer of famous courses in self-improvement, salesmanship, corporate training, public speaking and interpersonal skills. He was born on a farm in Missouri. He was the author of \'’How to Win Friends and Influence People’’, that was first published in 1936. It was a bestsellerand is popular even today. He also wrote a biography of Abraham Lincoln, titled \'’Lincoln the Unknown’’, as well as several other books.\r\n\r\nAbout the Author\r\nDale Carnegie (1888-1955) described himself as a \"simple country boy\" from Missouri but was also a pioneer of the self-improvement genre. Since the 1936 publication of his first book, How to Win Friends and Influence People, he has touched millions of readers and his classic works continue to impact lives to this day.', 1, '2021-08-11 11:36:42', 1, 7, 'all', ''),
(241, 10, 0, 'The Power of Habit', 0, 'the-power-of-habit', 4, 0, 0, 'Charles Duhigg', '', 1, 1, 'shipped', 'upload/images/6646-2021-08-11.jpg', '', 'There\'s never been a better time to set new habits. This book will change your life.\r\n\r\n______________________________\r\n\r\nWhy do we do develop habits? And how can we change them?\r\n\r\nWe can always change. In The Power of Habit, award-winning New York Times business reporter Charles Duhigg translates cutting-edge behavioural science into practical self-improvement action, distilling advanced neuroscience into fascinating narratives of transformation.\r\n\r\nWhy can some people and companies change overnight, and some stay stuck in their old ruts? The answer lies deep in the human brain, and The Power of Habits reveals the secret pressure points that can change a life. From Olympic swimmer Michael Phelps to Martin Luther King Jr., from the CEO of Starbucks to the locker rooms of the NFL, Duhigg explores the incredible results of keystone habits, and how they can make all the difference between billions and millions, failure and success – or even life and death.\r\n\r\nThe Power of Habit makes an exhilarating case: the key to almost any door in life is instilling the right habit. From exercise to weight loss, childrearing to productivity, market disruption to social revolution, and above all success, the right habits can change everything.\r\n\r\nHabits aren\'t destiny. They’re science, one which can transform our businesses, our communities, and our lives.\r\n\r\n______________________________\r\n\r\n\'Plenty of business books that try to tap into the scientific world manage to distil complicated research into readable prose. But few take the next step and become essential manuals for business and living. The Power of Habit is an exception.\' ANDREW HILL, FINANCIAL TIMES\r\n\r\nReview\r\nSharp, provocative, and useful. -- Jim Collins\r\n\r\nFew [books] become essential manuals for business and living. The Power of Habit is an exception. Charles Duhigg not only explains how habits are formed but how to kick bad ones and hang on to the good. ― Financial Times\r\n\r\nOnce you read this book, you’ll never look at yourself, your organisation, or your world quite the same way.\r\n\r\nAbsolutely fascinating. ― Wired\r\n\r\nEntertaining . . . enjoyable . . . fascinating . . . a serious look at the science of habit formation and change. ― The New York Times Book Review\r\n\r\nThis is a first-rate book – based on an impressive mass of research, written in a lively style and providing just the right balance of intellectual seriousness with practical advice on how to break our bad habits. ― The Economist\r\n\r\nI have been spinning like a top since reading The Power of Habit, New York Times journalist Charles Duhigg\'s fascinating best-seller about how people, businesses and organizations develop the positive routines that make them productive-and happy. ― The Washington Post\r\n\r\nIn this fascinating book, Charles Duhigg reveals the myriad ways in which our habits shape our lives. Do you want to know why Febreze became a bestselling product? Or how the science of habits can be used to improve willpower? Read this book.\r\n\r\nA fresh examination of how routine behaviours take hold and whether they are susceptible to change . . . The stories that Duhigg has knitted together are all fascinating in their own right, but take on an added dimension when wedded to his examination of habits. ― Associated Press\r\n\r\nDuhigg gives a compelling insight in to the world of subconscious behaviour. This is no homespun remedy, Duhigg\'s observations have real, scientific gravitas. ― Woman & Home\r\n\r\nInspiring stuff! ― Counsel\r\n\r\nThe Power of Habit steps sideways into science and brain chemistry to back up its key message: that identifying and implementing keystone habits is the difference between success and failure, whatever your goals. So if you’re a procrastinator, or a sleeper-inner, pick it up – and see how quickly you can morph those habits into habitual success. When you get around to it, obviously. ― Stylist\r\n\r\nThis fascinating book by a New York Times journalist explores how people get stuck in a rut and delves into psychological and neuroscientific research to find out what it takes to change our most deeply ingrained habits. ― Guardian\r\n\r\nCue: see cover. Routine: read book. Reward: fully comprehend the art of manipulation. ― Bloomberg Businessweek\r\n\r\nThere\'s been a lot of research over the past several years about how our habits shape us, and this work is beautifully described in the new book The Power of Habit. -- David Brooks ― The New York Times\r\n\r\nIf Duhigg is right about the nature of habits, which I think he is, then trying to get rid of these bad habits won\'t work. Instead, what is needed is to teach the managers to identify the cues that lead to these bad habits and rewards, and then learn alternative routines that lead to similar rewards, i.e. business and personal success. ― Forbes\r\n\r\nThe Power of Habit is chock-full of fascinating anecdotes . . . how an early twentieth century adman turned Pepsodent into the first bestselling toothpaste by creating the habit of brushing daily, how a team of marketing mavens at Procter & Gamble rescued Febreze from the scrapheap of failed products by recognizing that a fresh smell was a fine reward for a cleaning task, how Michael Phelps\' coach instilled habits that made him an Olympic champion many times over, and how Tony Dungy turned the Indianapolis Colts into a Super Bowl-winning team. ― Los Angeles Times\r\n\r\nIn his book The Power of Habit Charles Duhigg approaches the subject of what habits are and how we can ultimately change them. Written in an engaging style, with just the right balance of scientific fact and actual examples... ― The Book Garden Blog\r\n\r\nThere is a reason this book has been an international bestseller . . . I was hooked from the first page. ― VIP Magazine\r\n\r\nAbout the Author\r\nAbout The Author\r\n\r\nCharles Duhigg is an American Pulitzer prize winning staff writer at the New York Times. He studied at Yale and holds an MBA degree from Harvard Business School. Charles is also a frequent contributor to This American Life, NPR, PBS News Hour and the Frontline. He had a keen interest in observing Habits years ago when he worked as a reporter in Iraq.', 1, '2021-08-11 11:38:46', 1, 7, 'all', ''),
(242, 10, 0, 'Who will cry when you die : Robin Sharma', 0, 'who-will-cry-when-you-die-robin-sharma', 4, 0, 0, 'Robin Sharma', '', 1, 1, 'shipped', 'upload/images/7671-2021-08-11.jpg', '', 'Life Lessons From The Monk Who Sold His Ferrari\r\n\r\nDo You Feel that life is slipping by so fast that you might never get the chance to live with the meaning, happiness and joy you know you deserve? If so, then this book will be the guiding light that leads you to a brilliant new way of living.\r\n\r\nIn this easy-to-read yet wisdom-rich manual, the author offers 101 simple solutions to life’s most complex problems, ranging from a little-known method for beating stress and worry to a powerful way to enjoy the journey while you create a legacy that lasts.\r\n\r\n“When You Were Born, You Cried While The World Rejoiced. Live Your Life In Such A Way That When You Die, The World Cries While You Rejoice.”\r\nAncient Sanskrit Saying\r\n\r\nAbout the Author\r\nRobin Sharma is a globally respected humanitarian. Widely considered one of the world’s top leadership and personal optimization advisors, his clients include famed billionaires, professional sports superstars, and many Fortune 100 companies. The author’s #1 bestsellers, such as The Monk Who Sold His Ferrari, The Greatness Guide and The Leader Who Had No Title are in over 92 languages, making him one of the most broadly read writers alive today. Go to robinsharma.com for more inspiration + valuable resources to upgrade your life.', 1, '2021-08-11 11:41:07', 1, 7, 'all', ''),
(243, 10, 0, 'Atomic Habits', 0, 'atomic-habits', 4, 0, 0, 'James Clear', '', 1, 1, 'shipped', 'upload/images/3659-2021-08-11.jpg', '', '‘ A supremely practical and useful book. James Clear distils the most fundamental information about habit formation, so you can accomplish more by focusing on less.’ Mark Manson, author of The Subtle Art of Not Giving A F*ck\r\n________________________________\r\n\r\nPeople say when you want to change your life, you need to set big goals. But they’re wrong.\r\n\r\nWorld-renowned habits expert James Clear has discovered a simpler system for transforming your life. He knows that lasting change comes from the compound effect of hundreds of small decisions – doing two push-ups a day, waking up five minutes early, or holding a single short phone call. He calls them atomic habits.\r\n\r\nIn this ground-breaking book, Clear reveals how these tiny changes will help you get 1 percent better every day. He uncovers a handful of simple life hacks (the forgotten art of Habit Stacking, the unexpected power of the Two Minute Rule, or the trick to entering the Goldilocks Zone) and delves into cutting-edge psychology and neuroscience to explain why they matter. Along the way, he tells inspiring stories of Olympic gold medalists, leading CEOs and distinguished scientists who have used the science of small habits to stay productive, motivated and happy.\r\n\r\nThese small changes will have a revolutionary effect on your career, your relationships and your life.\r\n\r\n________________________________\r\n\r\n‘James Clear has spent years honing the art and studying the science of habits. This engaging, hands-on book is the guide you need to break bad routines and make good ones.’ Adam Grant, author of Originals\r\n\r\n‘A special book that will change how you approach your day and live your life.’ Ryan Holiday, author of The Obstacle is the Way\r\n\r\nReview\r\nA supremely practical and useful book. James Clear distils the most fundamental information about habit formation, so you can accomplish more by focusing on less. -- Mark Manson, author of The Subtle Art of Not Giving a F*ck\r\n\r\nAtomic Habits is a step-by-step manual for changing routines . . . Inspiring real-life stories. -- Books of the Month ― Financial Times\r\n\r\nJames Clear has spent years honing the art and studying the science of habits. This engaging, hands-on book is the guide you need to break bad routines and make good ones. -- Adam Grant, author of Originals\r\n\r\nA special book that will change how you approach your day and live your life. -- Ryan Holiday, author of The Obstacle is the Way\r\n\r\nExcellent . . . I’m almost done with my PhD in organisational psychology and James did a brilliant job describing much of the science in psychology and neuroscience. ― Inc.\r\n\r\nI’d attribute about 60 per cent of my good habits to [James Clear’s] blog and this book is rapidly filling in the other 40 per cent. -- Tim Urban, creator of Wait But Why\r\n\r\nZeroes in on the science behind building good habits and breaking bad ones . . . enlightening. ― Business Insider\r\n\r\nAtomic Habits [is] a new book by James Clear that I’m relying on to develop realistic goals. ― Financial Times\r\n\r\nIn Atomic Habits, author and self-improvement guru James Clear outlines a practical framework for improving just about every aspect of your life through the power of habit. ― Globe and Mail\r\n\r\nJames Clear argues that the key [to changing your behaviour] is in making tiny changes that, over time, compound into large transformations. This book shows you how. -- Books of the Year ― Fast Company\r\n\r\nWant to improve your fitness this year? Start with small ambitions – the results will be better . . . It’s a theory that has caught the imagination of James Clear, the author of a new book called Atomic Habits. ― The Times\r\n\r\nIlluminating . . . The attractive message . . . is that life doesn’t have to be a chore or a bore . . . The first move toward order might be a step as small as putting on your exercise clothes. ― Wall Street Journal\r\n\r\nYou may have heard the key to habit formation is starting small. But you’ve likely never considered starting as small as James Clear suggests in his new book Atomic Habits. ― New York Times\r\n\r\nFull of practical insights and tips, this will inspire you to make that tiny change today. ― Sun\r\n\r\nIf you are someone looking to gain some knowledge about creativity, happiness, health, productivity, picking this book is the right choice. [Clear’s] book is the proper blueprint that tells how to form some good habits, let go of your bad ones and what little changes one needs to bring to become better. And in case you thought it is all talk, let us tell you the book is packed with evidence-based strategies. Clear’s book actually has the potential to change a lot of things. ― Entrepreneur\r\n\r\nWhen talking about habits we can’t enter the habit debate without James Clear . . . It was satisfying to read this book as it felt like I was getting validation from this guy . . . Powerful sh*t. -- The James Smith Podcast\r\n\r\nA no-nonsense, pragmatic guide that draws on proven frameworks from biology, psychology and neuroscience to determine how to build long-lasting good habits and decisively break bad ones . . . Clear imparts a vast supply of practical advice that enables readers to take concrete steps towards achieving their goals. ― Oxford Student\r\n\r\nSimple and practical ideas . . . written in easy-to-follow steps with plenty of examples and facts. ― Business and Management Magazine\r\n\r\n[It\'s] all about neuroscience and about how you can programme your brain into forming small little habits that will greatly affect your life -- James Kavanagh’s current read ― Spin 1038\r\n\r\nAbout the Author\r\nJames Clear is an expert on habits and decision making. He made his name as the author of one of the fastest-growing email newsletters in history, which grew from zero to 100,000 subscribers in under two years. Today, his newsletter has over 400,000 subscribers and his articles at jamesclear receive 10 million hits each year. His work frequently appears in publications including the New York Times, Forbes and Business Insider.', 1, '2021-08-11 11:43:22', 1, 7, 'all', ''),
(244, 10, 0, 'Great Expectations : Charles Dickens', 0, 'great-expectations-charles-dickens', 4, 0, 0, 'Charles Dickens', '', 1, 1, 'shipped', 'upload/images/7290-2021-08-11.jpg', '', 'When seven-year-old orphan Pip meets Estella, the adopted daughter of the wealthy spinster Miss Havisham, he falls in love with her despite her cold and contemptuous ways. Pip is determined to escape poverty and become a gentleman to win Estella’s affections. Miss Havisham, however, arranges for him to become merely a common labourer in his brother-in-law’s business, disappointing Pip greatly. But the arrival of a lawyer from London gives Pip hope when he learns that he has a secret, wealthy benefactor. Pip travels to London to begin his education as a gentleman, still hoping to endear himself to Estella. Then, one day, a boyhood kind deed returns, altering the course of Pip’s life when he learns the identity of his benefactor…Great Expectations is one of Charles Dickens’s finest and most well received novels – a coming-of-age story about social ambition, love, crime and the disappointment of expectations.\r\n\r\nAbout the Author\r\nCharles John Huffam Dickens; 7 February 1812 – 9 June 1870) was an English writer and social critic. He created some of the world\'s best-known fictional characters and is regarded by many as the greatest novelist of the Victorian era. [1] His works enjoyed unprecedented popularity during his lifetime and by the 20th century critics and scholars had recognised him as a literary genius. His novels and short stories enjoy lasting popularity.', 1, '2021-08-11 11:45:59', 1, 7, 'all', '');
