(245, 10, 0, 'Harry Potter : The complete box set (collection of all 7 books)', 0, 'harry-potter-the-complete-box-set-collection-of-all-7-books', 4, 0, 0, 'J.K. Rowling', '', 1, 1, 'shipped', 'upload/images/6287-2021-08-11.jpg', '[\"upload/other_images/1628685056.236-498.jpg\"]', 'A beautiful boxed set containing all seven Harry Potter novels in paperback. These new editions of the classic and internationally bestselling, multi-award-winning series feature instantly pick-up-able new jackets by Jonny Duddle, with huge child appeal, to bring Harry Potter to the next generation of readers. It\'s time to PASS THE MAGIC ON .\r\n\r\nReview\r\nI\'ve yet to meet a ten-year-old who hasn\'t been entranced by its witty, complex plot and the character of the eponymous Harry ( Independent)\r\n\r\nSpellbinding, enchanting, bewitching stuff ( Mirror)\r\n\r\nTeachers say a chapter can silence the most rowdy of classes ( Guardian)\r\n\r\nOne of the greatest literary adventures of modern times ( Sunday Telegraph)\r\n\r\nThe Harry Potter stories will join that small group of children\'s books which are read and reread into adulthood ( TLS)\r\n\r\nBook Description\r\nIt\'s time to PASS THE MAGIC ON - with brand new children\'s editions of the classic and internationally bestselling series\r\n\r\nAbout the Author\r\nHarry Potter and the Philosopher\'s Stone was J.K. Rowling\'s first novel, followed by the subsequent six titles in the Harry Potter series, as well as three books written for charity: Fantastic Beasts and Where to Find Them, Quidditch Through the Ages and The Tales of Beedle the Bard. The Harry Potter novels have now sold over 450 million copies worldwide and been translated into 77 languages.', 1, '2021-08-11 12:30:56', 1, 7, 'all', ''),
(246, 10, 0, 'The Lord of the Rings complete book set : J.R.R. Tolkien', 0, 'the-lord-of-the-rings-complete-book-set-j-r-r-tolkien', 4, 0, 0, 'J.R.R. Tolkien', '', 0, 1, 'shipped', 'upload/images/4174-2021-08-11.jpg', '', 'The Lord of the Rings is a fantasy trilogy written by English author J R R Tolkien, modelled on the format of the classical Greek epic involving a quest, journeys, adventures, and the ultimate victory of good over evil. Beginning off as a sequel to Tolkien\'s 1937 children\'s fantasy novel The Hobbit, this series went above and beyond the scope of its predecessor to become an iconic piece of popular literature, becoming a favourite of both children and adults alike.\r\n\r\nIt is the story of the Hobbit, Frodo, who is left a ring by his uncle, Bilbo Baggins, unaware that it is the powerful One Ring created by the Dark Lord Sauron in a previous age as a weapon to corrupt its wearers and subsequently rule over the world. Encouraged by the wizard Gandalf the Grey, who identifies the Ring, Frodo and a few friends set off to take the Ring away from Sauron, and to destroy it so that he cannot establish his reign of evil again.\r\n\r\nThe novel was published in three volumes, and is hence commonly referred to as a trilogy. The three volumes were titled The Fellowship Of The Ring, The Two Towers, and The Return of the King. The Lord Of The Rings was published by Harpercollins in 2012. This is the film tie-in international edition and each of the three books in the box set comes in paperback.\r\n\r\nKey Features:\r\n\r\nIt is the second most best-selling series of all time, with over 150 million copies sold. This series has been reprinted many times since and has also been translated into over thirty languages.\r\nThe Lord Of The Rings has been adapted for award-winning films, radio, television, and has inspired artwork, music, video games, and critical studies as well as popular literature.\r\nReview\r\n‘A flawless masterpiece’ The Times\r\n\r\n‘Tolkien was a storyteller of genius’ Literary Review\r\n\r\n‘Amongst the greatest works of imaginative fiction of the twentieth century’ Sunday Telegraph\r\n\r\nAbout the Author\r\nJohn Ronald Reuel Tolkien, was an English writer, poet, philologist, and university professor, best known as the author of the classic high fantasy works The Hobbit, The Lord Of The Rings, and The Silmarillion.', 1, '2021-08-11 12:35:33', 1, 7, 'all', ''),
