(265, 17, 0, 'All in one English, SRT, Science', 0, 'all-in-one-english-srt-science', 38, 0, 0, '', '', 1, 1, 'processed', 'upload/images/7400-2021-08-18.jpg', '[\"upload/other_images/1629301668.272-347.jpg\"]', '<div class=\"sui-box-settings-slim-row sui-sm\" style=\"outline: 0px; font-variant-ligatures: none; text-rendering: optimizelegibility; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.01) 0px 0px 1px; box-sizing: border-box; position: relative; margin-bottom: 10px; display: flex; color: rgb(102, 102, 102); font-family: Roboto, Arial, sans-serif; letter-spacing: -0.25px;\">\r\n<div class=\"sui-box-settings-col-2\" >Old but good condition</span></div>\r\n</div>\r\n\r\n<p><span style=\"color:rgb(136, 136, 136); font-family:roboto,arial,sans-serif; font-variant-ligatures:none; letter-spacing:-0.25px\">All book are in good condition</span></p>\r\n\r\n<p>Note : description is given by student.</p>', 1, '2021-08-18 15:47:52', 1, 7, 'all', ''),
(266, 15, 0, 'Netter\'s Clinical Anatomy (Netter Basic Science)', 0, 'netter-s-clinical-anatomy-netter-basic-science-1', 2, 12, 1, 'Elsevier', 'USA', 1, 1, 'shipped', 'upload/images/3826-2021-08-18.jpg', '', '<p>Focus on the clinically relevant aspects of anatomy and bridge normal anatomy to common clinical conditions with <em>Netter&#39;s Clinical Anatomy, 4th Edition</em>. This <strong>easy-to-read, visually stunning text</strong> features <strong>nearly 600 superb Netter-style illustrations that provide essential descriptions of anatomy, embryology, and pathology</strong> to help you <strong>understand their clinical relevance</strong>. Authored by John Hansen, PhD, an Honored Member of the American Association of Clinical Anatomists, this book is an ideal anatomy reference for students who want to make the most of their study time or need a concise review of clinical anatomy.</p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<ul>\r\n	<li>Clinical Focus boxes present <strong>hundreds of illustrated clinical correlations that bridge anatomy to pathophysiology</strong>. Every clinical correlation – more than 200 in all – is illustrated.</li>\r\n	<li>Features and Characteristics boxes explain <strong>the relation between structure and function.</strong></li>\r\n	<li><strong>Muscle/Ligament/Joint tables</strong> summarize attachment points, actions, and other key information related to each structure.</li>\r\n	<li>Both<strong> USMLE-style review questions and short answer questions</strong> online help you gauge your mastery of the material and identify areas where you may need further study.</li>\r\n	<li><strong>Portable book size</strong> makes it easy to carry on the go.</li>\r\n</ul>\r\n\r\n<p> </p>\r\n\r\n<ul>\r\n	<li><strong>More review questions</strong>, including figure- and image-based questions</li>\r\n	<li><strong>More Clinical Focus boxes</strong></li>\r\n	<li><strong>eBook version included with purchase. </strong>This<strong> enhanced eBook experience </strong>includes additional multiple-choice questions, 3D models, and fully searchable text and images.</li>\r\n</ul>', 1, '2021-08-18 17:48:52', 1, 7, 'all', ''),
(267, 15, 0, 'Med School Confidential', 0, 'med-school-confidential-1', 2, 12, 1, 'St. Martin\'s Griffin', 'USA', 1, 1, 'shipped', 'upload/images/8948-2021-08-18.jpg', '', '<p><em>Med School Confidential </em>from Robert H. Miller and Daniel M. Bissell uses the same chronological format and mentor-based system that have made <em>Law School Confidential </em>and <em>Business School Confidential</em> such treasured and popular guides. It takes the reader step-by-step through the entire med school process--from thinking about, applying to, and choosing a medical school and program, through the four-year curriculum, internships, residencies, and fellowships, to choosing a specialty and finding the perfect job.<br />\r\nWith a foreword by Chair of the Admissions Committee at Dartmouth Medical School Harold M. Friedman, M.D., <em>Med School Confidential </em>provides what no other book currently does: a comprehensive, chronological account of the full medical school experience.</p>', 1, '2021-08-18 17:53:24', 1, 7, 'all', ''),
(268, 15, 0, 'Netter\'s Anatomy Flash Cards', 0, 'netter-s-anatomy-flash-cards-1', 2, 12, 1, 'Elsevier', 'USA', 1, 1, 'shipped', 'upload/images/5202-2021-08-18.jpg', '', '<p>Learn the essential anatomy you need to know – quickly and easily! Each flash card in this full-color deck features <strong>high-quality Netter art (and several new paintings by Dr. Carlos Machado), numbered labels (with hidden answers), and concise comments and clinical notes</strong> for the most commonly tested anatomy terms and concepts. Focusing on clinically relevant anatomy, this easy-to-use, portable study tool helps you learn anatomical structures with confidence!</p>\r\n\r\n<ul>\r\n	<li><strong>Pre-punched holes</strong> make it easy to carry selected groups of cards with you.</li>\r\n	<li>A perfect study aid and complement to <em>Netter’s Clinical Anatomy, 4rd Edition</em> concise textbook and Netter’s <em>Atlas of Human Anatomy, 7th Edition</em>.</li>\r\n</ul>\r\n\r\n<p> </p>\r\n\r\n<ul>\r\n	<li><strong>New card design</strong> makes it easy to sort cards by Region (primary color-coded organization) or System (icons).</li>\r\n	<li><strong>Student Consult™ eBook version included with purchase. </strong>This<strong> enhanced eBook experience </strong>allows you to study the cards on your phone, tablet, or computer and includes over 400 multiple-choice questions. Quiz yourself on structure names as well as their anatomical and clinical significance.</li>\r\n</ul>', 1, '2021-08-18 17:57:07', 1, 7, 'all', ''),
(269, 15, 0, 'Clinically Oriented Anatomy', 0, 'clinically-oriented-anatomy-1', 2, 12, 1, 'Lippincott Williams and Wilkins', 'USA', 1, 1, 'shipped', 'upload/images/3586-2021-08-18.jpg', '', '<p>\"Clinically Oriented Anatomy, Sixth Edition\", provides first-year medical and allied health students with the clinically oriented anatomical information that they need in study and practice. This best-selling textbook is renowned for its comprehensive coverage of anatomy, presented as it relates to the practice of medicine, dentistry, and physical therapy. The Sixth Edition features a modified interior design with new and improved artwork that further enhances the user-friendliness of the text. The clinical Blue Boxes - with topical coverage of health, clinical procedures, physical examination, and development - are now grouped to reduce interruption of text and are categorized with icons to promote easier comprehension of clinical information. The Bottom Line summaries have been refined to clearly call out key points for quick study. A companion Website offers the fully searchable text, interactive USMLE-style questions, and video animations. Online faculty resources include an Image Bank, Test Generator, and Course Outlines.</p>', 1, '2021-08-18 18:01:48', 1, 7, 'all', ''),
(270, 15, 0, 'Grant’s Dissector', 0, 'grant-s-dissector-1', 2, 12, 1, 'Wolters Kluwer India', 'India', 1, 1, 'shipped', 'upload/images/1571-2021-08-18.jpg', '', '<p>Dissection overviews include numbered, step-by-step instructions to guide you through relevant surface anatomy and osteology. Dissection instructions each step is carefully worded to clarify and improve the dissection experience. More than 30 summary tables provide an excellent review resource and make the dissection steps more task-oriented and concise. Dissection follow-up sections contain a numbered list of tasks to perform following the dissection..</p>', 1, '2021-08-18 18:07:52', 1, 7, 'all', ''),
(271, 15, 0, 'High-Yield Embryology', 0, 'yield-embryology', 2, 12, 1, 'Lippincott Williams and Wilkins', 'USA', 1, 1, 'shipped', 'upload/images/8625-2021-08-18.jpg', '', '<p>This series extracts the most important information on each topic and presents it in a concise, uncluttered fashion to prepare students for the USMLE. High-Yield means exactly that!<br />\r\nHigh-Yield Embryology, Fifth Edition provides a concentrated, efficient review of embryology material tested on the USMLE Step 1. Concepts are presented in a streamlined outline format with tables, diagrams, photos, and radiographs to clarify important material.<br />\r\nIn response to student feedback, the Fifth Edition features:</p>\r\n\r\n<ul>\r\n	<li>New and updated figures</li>\r\n	<li>Additional USMLE-style case studies at the end of each chapter</li>\r\n	<li>An expanded section on early development</li>\r\n</ul>', 1, '2021-08-18 18:12:40', 1, 7, 'all', ''),
(272, 15, 0, 'Lippincott\'s Illustrated Reviews Biochemistry', 0, 'lippincott-s-illustrated-reviews-biochemistry-1', 2, 12, 1, 'Wolters Kluwer India', 'India', 1, 1, 'shipped', 'upload/images/0229-2021-08-18.jpg', '', '<p>Reading books is a kind of enjoyment. Reading books is a good habit. We bring you a different kinds of books. You can carry this book where ever you want. It is easy to carry. It can be an ideal gift to yourself and to your loved ones. Care instruction keep away from fire.</p>', 1, '2021-08-18 18:16:38', 1, 7, 'all', ''),
(273, 15, 0, 'First Aid for the Basic Sciences: General Principles', 0, 'first-aid-for-the-basic-sciences-general-principles-1', 2, 12, 1, 'McGraw-Hill Education / Medical', 'India', 1, 1, 'shipped', 'upload/images/8270-2021-08-23.jpg', '', '<p><em>First Aid for the Basic Sciences: General Principles, Third Edition</em> provides readers with a solid understanding of the basic science principles with which all medical students must be familiar. Delivering a comprehensive single-source review of the entire first year of medical school, the book assumes little prior knowledge, and includes important background material most other reviews leave out. Delivers comprehensive single-source coverage of the entire first year of medical school written in easy-to-understand, non-technical language.</p>\r\n\r\n<p>• An essential companion during your first two years of medical school<br />\r\n• Includes important foundational content most other reviews leave out<br />\r\n• Focuses on the high-yield topics and facts tested on the USMLE Step 1<br />\r\n• Enhanced by full-color images, learning aids, tables, and concise text to streamline your study and help you excel in coursework and on the USMLE Step 1<br />\r\n• Provides a complete framework for understanding biochemistry, microbiology, immunology, pathology, pharmacology, and public health sciences<br />\r\n• Mirrors the table of contents of First Aid for the USMLE Step 1 to facilitate side-by-side study<br />\r\n• Written by students who aced the USMLE and reviewed by top faculty</p>', 1, '2021-08-23 05:18:01', 1, 7, 'all', ''),
(275, 11, 0, 'NEET Explorer', 0, 'neet-explorer-1', 2, 12, 1, 'MTG', 'INDIA', 1, 1, 'shipped', 'upload/images/9717-2021-08-29.jpg', '', '<p>Mtg NEET Explorer is a guide to practice and analyze preparation for medical entrance Exam I.E. Neet. It accommodates 10 similar question papers along with 18-year (2003 – 2020) AIPMT/NEET solved papers with detailed solutions and br&gt;Chapter wise analysis. Neet Explorer is a book devised specially for medical aspirants with an aim to impart full practice of paper similar with NEET and Previous year papers to give complete understanding of this exam to its readers. Br&gt;<br />\r\ntable of content:- very-similar papers (1-10) very-similar Paper - 1 very-similar Paper - 2 very-similar Paper - 3 very-similar Paper - 4 very-similar Paper - 5 very-similar Paper - 6 very-similar Paper - 7 very-similar Paper - 8 very-similar Paper - 9 very-similar Paper - 10 Solved Papers (2003-2020) AIPMT solved Paper 2003 AIPMT solved Paper 2004 AIPMT solved Paper 2005 AIPMT solved Paper 2006 AIPMT solved Paper 2007 AIPMT solved Paper 2008 AIPMT solved Paper 2009 AIPMT solved Paper (Prelims) 2010 AIPMT solved Paper (Mains) 2010 AIPMT solved Paper (Prelims) 2011 AIPMT solved Paper (Mains) 2011 AIPMT solved Paper (Prelims) 2012 AIPMT solved Paper (Mains) 2012 NEET solved paper 2013 NEET (Karnataka) solved Paper 2013 AIPMT solved Paper 2014 AIPMT solved Paper 2015 AIPMT solved Paper 2015 (Re-Exam) NEET solved paper 2016 (phases) NEET solved paper 2016 (phase-2) NEET solved paper 2017 NEET solved paper 2018 NEET solved paper 2019 NEET solved paper 2020.</p>', 1, '2021-08-29 17:17:17', 1, 7, 'all', ''),
(276, 11, 0, 'Combination of MTG 33 Years solved papers for NEET (Bundle of 3 Books) Physics, Chemistry, Biology', 0, 'combination-of-mtg-33-years-solved-papers-for-neet-bundle-of-3-books-physics-chemistry-biology-1', 2, 12, 1, 'MTG', 'INDIA', 1, 1, 'shipped', 'upload/images/8631-2021-08-29.jpg', '', '<p>combination of MTG 33 years Solved papers for NEET (bundle of 3 books) Physics, Chemistry, Biology.</p>', 1, '2021-08-29 17:20:03', 1, 7, 'all', ''),
(277, 11, 0, '33 Years NEET-AIPMT Chapterwise Solutions - Chemistry', 0, 'aipmt-chapterwise-solutions-2', 2, 12, 1, 'MTG', 'INDIA', 1, 1, 'shipped', 'upload/images/4159-2021-08-29.jpg', '', '<p>Mtg 33 years NEET/AIPMT br&gt;Chapter wise solutions Chemistry is a br&gt;Chapter wise Question Bank having questions from past 33 years NEET/AIPMT exam. This book is updated with the questions of nta conducted NEET 2020 exam and br&gt;Chapter wise questions of last 33 years’ (1988-2020) of AIPMT/NEET with detailed answers for easy and clear understanding of NEET exam pattern. Br&gt;chapter wise questions gives a clear idea regarding br&gt;Chapter weight age. Once after completing the br&gt;Chapter, attempting questions from previous years exams give a real indication of the efforts required. This book also contains a QR code which you can use for online preparation. Use this code to get the maximum benefits of this book at no extra cost. Table of content: 1. Some basic Concepts of Chemistry 2. Structure of Atom 3. Classification of Elements and Periodicity in Properties 4. Chemical Bonding and Molecular Structure 5. States of Matter: gases and Liquids 6. Thermodynamics 7. Equilibrium 8. Redox Reactions 9. Hydrogen 10. The s-Block Elements 11. The p-Block Elements (group 13 and 14) 12. Organic Chemistry – some basic Principles and techniques 13. Hydrocarbons 14. Environmental Chemistry 15. Solid state 16. Solutions 17. Electrochemistry 18. Chemical Kinetics 19. Surface Chemistry 20. General Principles and Processes of Isolation of Elements 21. The p-Block Elements (group 15 to 18) 22. The d-and f-Block elements 23. Coordination Compounds 24. Haloalkanes and Haloarenes 25. Alcohols, Phenols and Ethers 26. Aldehydes, Ketones and Carboxylic Acids 27. Organic Compounds Containing Nitrogen 28. Biomolecules 29. Polymers 30. Chemistry in Everyday life 31. Nuclear Chemistry.</p>', 1, '2021-08-29 17:27:13', 1, 7, 'all', ''),
(278, 11, 0, '29 Years NEET-AIPMT Chapterwise Solutions - Biology', 0, 'aipmt-chapterwise-solutions-1', 2, 12, 1, 'MTG', 'INDIA', 1, 1, 'shipped', 'upload/images/6690-2021-08-29.jpg', '', '<p>Table Of Content:</p>\r\n\r\n<p>1. General Biology<br />\r\n2. Biological Classification<br />\r\n3. Kingdom Monera<br />\r\n4. Kingdom Fungi<br />\r\n5. Plant Kingdom<br />\r\n6. Cell and Its Structural Components<br />\r\n7. Cell Reproduction<br />\r\n8. Cellular Respiration<br />\r\n9. Biomolecules<br />\r\n10. Principles of Inheritance and Variation<br />\r\n11. Molecular Basis of Inheritance<br />\r\n12. Plant Anatomy<br />\r\n13. Plant Morphology<br />\r\n14. Plant Physiology<br />\r\n15. Plant Reproduction<br />\r\n16. Animal Kingdom<br />\r\n17. Animal Tissues<br />\r\n18. Nutrition and Digestive System<br />\r\n19. Respiratory System<br />\r\n20. Circulatory System<br />\r\n21. Excretion and Osmoregulation<br />\r\n22. Musculo-Skeletal System<br />\r\n23. Nervous System and Sense Organs<br />\r\n24. Endocrine System<br />\r\n25. Reproduction and Embryonic Development<br />\r\n26. Human Health and Diseases<br />\r\n27. Evolution<br />\r\n28. Ecology and Environment<br />\r\n29. Biotechnology<br />\r\n30. Applied Biology<br />\r\nSOLVED PAPER : AIPMT 2014<br />\r\nSOLVED PAPER : AIPMT 2015<br />\r\nNEET Phase 1 Paper (1st May 2016)<br />\r\nNEET Phase 2 Paper (24th July 2016)</p>', 1, '2021-08-29 17:31:36', 1, 7, 'all', ''),
(279, 11, 0, '29 Years NEET-AIPMT Chapterwise Solutions - Physics', 0, 'aipmt-chapterwise-solutions', 2, 12, 1, 'MTG', 'INDIA', 1, 1, 'shipped', 'upload/images/3252-2021-08-29.jpg', '', '<p>Table Of Content:</p>\r\n\r\n<p>1. Units and Measurement<br />\r\n2. Motion in a Straight Line<br />\r\n3. Motion in a Plane<br />\r\n4. Laws of Motion<br />\r\n5. Work, Energy and Power<br />\r\n6. System of Particles and Rotational Motion<br />\r\n7. Gravitation<br />\r\n8. Properties of Matter<br />\r\n9. Thermodynamics and Kinetic Theory<br />\r\n10. Oscillations<br />\r\n11. Waves<br />\r\n12. Electrostatics<br />\r\n13. Current Electricity<br />\r\n14. Moving Charges and Magnetism<br />\r\n15. Magnetism and Matter<br />\r\n16. Electromagnetic Induction and Alternating Current<br />\r\n17. Electromagnetic Waves<br />\r\n18. Optics<br />\r\n19. Dual Nature of Radiation and Matter<br />\r\n20. Atoms and Nuclei<br />\r\n21. Semiconductor Electronics : Materials, Devices and Simple Circuits<br />\r\nSOLVED PAPER : AIPMT 2014<br />\r\nSOLVED PAPER : AIPMT 2015<br />\r\nNEET Phase 1 Paper (1st May 2016)<br />\r\nNEET Phase 2 Paper (24th July 2016)</p>', 1, '2021-08-29 17:40:17', 1, 7, 'all', ''),
(280, 11, 0, 'NEET Success Blueprint', 0, 'neet-success-blueprint-1', 2, 12, 1, 'MTG', 'INDIA', 1, 1, 'shipped', 'upload/images/0287-2021-08-29.jpg', '', '<ul>\r\n	<li>Publisher ‏ : ‎ MTG Learning Media Private Limited (1 January 2016)</li>\r\n	<li>Language ‏ : ‎ English</li>\r\n	<li>Paperback ‏ : ‎ 124 pages</li>\r\n</ul>', 1, '2021-08-29 17:43:58', 1, 7, 'all', ''),
(281, 11, 0, 'MTG JEE 30 days physics', 0, 'mtg-jee-30-days-physics-1', 2, 1, 1, 'MTG', 'INDIA', 1, 1, 'shipped', 'upload/images/7804-2021-08-29.jpg', '', '<p>Mtg 30 days JEE Main Physics provides a speedy revision plan for complete Physics in 30 days. It comes with concise review of all the concepts as per the latest syllabus and emphasis on the formulas and facts in an easy and tabular form. It is a focused programme of study for the JEE aspirants full preparation. Salient features of this book: This book divides complete syllabus into 30 days equally. After every segment 20 MCQs and 5 Numerical value type questions are given with detailed solutions for better understanding and comprehension of the topics learned. It also includes br&gt;Unit tests after day 07, day 14, day 19 and day 24 and day 29 for total insight of the stronger and the weaker areas of the student. At the end of the book, 3 Mock Test Papers designed as per latest nta JEE Main exam and solved Paper of JEE Main 2020 January session are given for complete practice. Content: day 1 Physical world and Measurement day 2 motion in one dimension day 3 motion in a Plane day 4 laws of Motion day 5 Work, Energy and Power day 6 system of Particles and Rotational Motion day 7 Gravitation br&gt;Unit test 1 day 8 Mechanical Properties of Solids day 9 Mechanical Properties of fluids day 10 thermal properties of Matter day 11 Thermodynamics day 12 Kinetic Theory day 13 Oscillations day 14 waves br&gt;Unit test 2 day 15 electric Charges and fields day 16 Electrostatic potential and Capacitance day 17 Current Electricity day 18 moving Charges and Magnetism day 19 Magnetism and Matter br&gt;Unit test 3 day 20 electromagnetic Induction day 21 Alternating Current day 22 electromagnetic Waves day 23 Ray Optics and Optical Instruments day 24 wave Optics br&gt;Unit test 4 day 25 dual Nature of Radiation and Matter day 26 Atoms and Nuclei day 27 semiconductor electronics: materials, devices and simple circuits day 28 communication systems day 29 practical Physics br&gt;Unit test 5 day 30 Mock Test Papers answer keys (br&gt;Unit tests) solved Paper (JEE Main 2020).</p>', 1, '2021-08-29 17:47:44', 1, 7, 'all', ''),
(282, 11, 0, '30 Days JEE main Chemistry - 30 Days A Revision cum Crash Course', 0, '30-days-a-revision-cum-crash-course-1', 2, 0, 1, 'MTG', 'INDIA', 1, 1, 'shipped', 'upload/images/8567-2021-08-30.jpg', '', '<p>Mtg 30 days JEE Main Chemistry provides a speedy revision plan for complete Chemistry in 30 days. It comes with concise review of all the concepts as per the latest syllabus and emphasis on the formulas and facts in an easy and tabular form. It is a focused programme of study for the JEE aspirants full preparation. Salient features of this book: This book divides complete syllabus into 30 days equally. After every segment 20 MCQs and 5 Numerical value type questions are given with detailed solutions for better understanding and comprehension of the topics learned. It also includes br&gt;Unit tests after day 08, day 13, day 18 and day 22 and day 29 for total insight of the stronger and the weaker areas of the student. At the end of the book, 3 Mock Test Papers designed as per latest nta JEE Main exam and solved Paper of JEE Main 2020 January session are given for complete practice. Content: day 1 some basic Concepts of Chemistry day 2 structure of Atom day 3 classification of Elements and Periodicity in Properties day 4 Chemical Bonding and Molecular Structure day 5 states of Matter (gases and Liquids) day 6 Thermodynamics day 7 Equilibrium day 8 Redox Reactions br&gt;Unit test 1 day 9 Hydrogen and the s-Block Elements day 10 The p-Block Elements (groups 13 to 14) day 11 Organic chemistry-some basic principles and techniques day 12 Hydrocarbons day 13 environmental Chemistry br&gt;Unit test 2 day 14 The solid state day 15 solutions day 16 Electrochemistry day 17 Chemical Kinetics day 18 surface Chemistry br&gt;Unit test 3 day 19 General Principles and processed of Isolation of Elements day 20 The p-Block Elements (group 15 to 18) day 21 The d-Block and f-Block elements day 22 coordination Compounds br&gt;Unit test 4 day 23 Alkanes and Haloarenes day 24 Alcohols, Phenols and Ethers day 25 Aldehydes, Ketones and Carboxylic Nitrogen day 26 Organic Compounds and containing Nitrogen day 27 Biomolecules day 28 Polymers day 29 Chemistry in Everyday life and practical Chemistry br&gt;Unit test 5 day 30 Mock Test Papers answer keys (br&gt;Unit tests) solved Paper (JEE Main 2020).</p>', 1, '2021-08-29 18:46:00', 2, 7, 'all', ''),
(283, 11, 0, '30 Days JEE main Chemistry - 30 Days A Revision cum Crash Course', 0, '30-days-a-revision-cum-crash-course', 2, 1, 1, 'MTG', 'INDIA', 1, 1, 'shipped', 'upload/images/4206-2021-08-30.jpg', '', '<p>Mtg 30 days JEE Main Chemistry provides a speedy revision plan for complete Chemistry in 30 days. It comes with concise review of all the concepts as per the latest syllabus and emphasis on the formulas and facts in an easy and tabular form. It is a focused programme of study for the JEE aspirants full preparation. Salient features of this book: This book divides complete syllabus into 30 days equally. After every segment 20 MCQs and 5 Numerical value type questions are given with detailed solutions for better understanding and comprehension of the topics learned. It also includes br&gt;Unit tests after day 08, day 13, day 18 and day 22 and day 29 for total insight of the stronger and the weaker areas of the student. At the end of the book, 3 Mock Test Papers designed as per latest nta JEE Main exam and solved Paper of JEE Main 2020 January session are given for complete practice. Content: day 1 some basic Concepts of Chemistry day 2 structure of Atom day 3 classification of Elements and Periodicity in Properties day 4 Chemical Bonding and Molecular Structure day 5 states of Matter (gases and Liquids) day 6 Thermodynamics day 7 Equilibrium day 8 Redox Reactions br&gt;Unit test 1 day 9 Hydrogen and the s-Block Elements day 10 The p-Block Elements (groups 13 to 14) day 11 Organic chemistry-some basic principles and techniques day 12 Hydrocarbons day 13 environmental Chemistry br&gt;Unit test 2 day 14 The solid state day 15 solutions day 16 Electrochemistry day 17 Chemical Kinetics day 18 surface Chemistry br&gt;Unit test 3 day 19 General Principles and processed of Isolation of Elements day 20 The p-Block Elements (group 15 to 18) day 21 The d-Block and f-Block elements day 22 coordination Compounds br&gt;Unit test 4 day 23 Alkanes and Haloarenes day 24 Alcohols, Phenols and Ethers day 25 Aldehydes, Ketones and Carboxylic Nitrogen day 26 Organic Compounds and containing Nitrogen day 27 Biomolecules day 28 Polymers day 29 Chemistry in Everyday life and practical Chemistry br&gt;Unit test 5 day 30 Mock Test Papers answer keys (br&gt;Unit tests) solved Paper (JEE Main 2020).</p>', 1, '2021-08-29 18:49:59', 1, 7, 'all', ''),
(284, 11, 0, '42 Years Chapterwise Topicwise Solved Papers (2020-1979) IIT JEE Physics', 0, '1979-iit-jee-physics-1', 2, 1, 1, 'DC PANDEY', 'INDIA', 1, 1, 'shipped', 'upload/images/2209-2021-08-30.jpg', '', '<p>\"1. 42 Years’ Chapterwise and Topicwise Solved papers for JEE Main &amp; Advanced<br />\r\n2. This book deals with Physics subject<br />\r\n3. The book is divided into 17 Chapters<br />\r\n4. Ample Questions are given [2020-1979] for practice<br />\r\n5. JEE Advanced Solved Papers are provided to know the paper pattern<br />\r\n6. Selected Questions 2020 from Jan &amp; Sept attempt to know the important questions</p>\r\n\r\n<p>Cracking up one of the most difficult National Level Entrance Exams like IIT JEE is not an easy task. Thorough practice is required from the previous years’ question papers to get an idea about paper pattern and questions asked.</p>\r\n\r\n<p>Prepared under the vision of our expert faculty, presenting the updated edition of “42 Years’ Chapterswise Topicwise Solved Papers [2020-1979]” of Physics for IIT JEE Main &amp; Advanced is a one stop solution for the preparation of engineering entrances. Covering the entire syllabus in 17 Chapters of both Main &amp; Advanced, this book is supplemented with good number of questions from 1979 to 2020 in a Chapterwise and Topicwise manner. For further practice ‘Previous Years’ Solved Papers and Selected Questions of JEE Main (Jan &amp; Sept) 2020’ are given at the end of the book to help aspirants for the forthcoming exam.</p>\r\n\r\n<p>TABLE OF CONTENT</p>\r\n\r\n<p>General Physics, Kinematics, Laws of Motion, Work, Power and Energy, Centre of Mass, Rotation, Gravitation, Simple Harmonic Motion, Properties of Matter, Wave Motion, Heat and Thermodynamics, Optics, Current Electricity, Electrostatics, Magnetics, Electromagnetic Induction and Alternating Current, Modern Physics, JEE Advanced Solved Paper 2019, JEE Advanced Solved Paper 2020, Selected Question of JEE Main (Jan &amp; Sep) 2020.\"</p>', 1, '2021-08-29 19:01:27', 1, 7, 'all', ''),
(285, 11, 0, '19 Years JEE Main Chapterwise Solution- Chemistry', 0, 'chemistry-1', 2, 1, 1, 'MTG', 'INDIA', 1, 1, 'shipped', 'upload/images/2014-2021-08-30.jpg', '', '<p>MTG’s 19 Years JEE Main Chapterwise Solutions is an excellent practice resource for all JEE aspirants. The book contains 19-years’ chapter wise solved papers of Chemistry of AIEEE from 2002 to 2020 and JEE Main offline and online exam from 2013 to 2020. This book also includes exclusively solved papers of NTA conducted JEE Main 2019 January &amp; September online exams. The questions have been solved with sample explanations so as to provide better understanding of the concepts on which the questions are based. Solving questions of previous year papers gives a prompt idea to CBSE and non-CBSE students, about the type and important questions asked from various NCERT chapters in engineering exams. It is strictly based on JEE Main Exam pattern and gives a thorough practice of exam questions. It gives clear cut understanding of weightage of chapters in the competitive exams. All in all, 19 Year JEE Main Chapter wise Solutions presents a detailed understanding of the questions asked in 19 years of JEE/AIEEE Exams. Content:- 1. Some Basic Concepts in Chemistry 2. States of Matter 3. Atomic Structure 4. Chemical Bonding and Molecular Structure 5. Chemical Thermodynamics 6. Solutions 7. Equilibrium 8. Redox Reactions and Electrochemistry 9. Chemical Kinetics 10. Surface Chemistry 11. Nuclear Chemistry 12. Classification of Elements and Periodicity in Properties 13. General Principles and Processes of Isolation of Metals 14. Hydrogen 15. s-Block Elements 16. p-Block Elements 17. d- and f -Block Elements 18. Coordination Compounds 19. Environmental Chemistry 20. Purification and Characterisation of Organic Compounds 21. Some Basic Principles of Organic Chemistry 22. Hydrocarbons 23. Organic Compounds Containing Halogens 24. Alcohols, Phenols and Ethers 25. Aldehydes, Ketones and Carboxylic Acids 26. Organic Compounds Containing Nitrogen 27. Polymers 28. Biomolecules 29. Chemistry in Everyday Life 30. Principles Related to Practical Chemistry</p>', 1, '2021-08-29 19:04:09', 1, 7, 'all', ''),
(286, 11, 0, 'Oswaal JEE Main Solved Papers Chapterwise & Topicwise (2019 & 2020 All shifts 32 Papers) Mathematics Book', 0, 'oswaal-jee-main-solved-papers-chapterwise-topicwise-2019-2020-all-shifts-32-papers-mathematics-book-1', 2, 1, 1, 'OSWAAL', 'INDIA', 1, 1, 'shipped', 'upload/images/1027-2021-08-30.jpg', '', '<p>Based on the Scheme of examination issued by the nta on 16th Dec 2020 JEE Main exam 2019 &amp; 2020 question papers with solutions Chapter-wise &amp; Topic-wise presentation for systematic learning subjective (integer types) questions for extensive practice revision notes for quick revision concept videos for hybrid learning commonly Made Errors to polish concepts mind Maps for better retention</p>', 1, '2021-08-29 19:15:10', 1, 7, 'all', ''),
(287, 11, 0, '32 Years NEET Chapter-wise & Topic-wise Solved Papers Physics, Chemistry & Biology (2019 - 1988) 14th Edition', 0, 'wise-topic-2', 2, 12, 1, 'DISHA', 'INDIA', 1, 1, 'shipped', 'upload/images/0955-2021-08-30.jpg', '', '<p>Table of Contents: book 1 - Physics # NEET 2019 and 2018 Solved Paper # NEET 2017-1988 divided into 28 chapters book 2 - Chemistry # NEET 2019 and 2018 Solved Paper # NEET 2017-1988 divided into 38 chapters book 3 - Biology # NEET 2019 and 2018 Solved Paper # NEET 2017-1988 divided into 38 chapters.</p>', 1, '2021-08-29 19:23:26', 1, 7, 'all', ''),
(288, 11, 0, '30 Years NEET Chapter-wise & Topic-wise Solved Papers Chemistry (2017 - 1988)', 0, 'wise-topic', 2, 12, 1, 'DISHA', 'INDIA', 1, 1, 'shipped', 'upload/images/2991-2021-08-30.jpg', '', '<p>• NEET Topic-wise Solved Papers Chemistry contains the past year papers of NEET, 1988 to 2017 distributed in 31 Topics.<br />\r\n• The Topics have been arranged exactly in accordance to the NCERT books so as to make it 100 percent convenient to Class 11 and 12 students.<br />\r\n• The fully solved CBSE Mains papers of 2011 and 2012 (the only Objective CBSE Mains paper held) have also been incorporated in the book topic-wise.<br />\r\n• The book also contains NEET 2013 along with the Karnataka NEET 2013 paper.<br />\r\n• The detailed solutions of all questions are provided at the end of each chapter to bring conceptual clarity.<br />\r\n• The book contains around 1600+ milestone problems in Physics.</p>', 1, '2021-08-29 19:29:15', 1, 7, 'all', ''),
(289, 11, 0, '35 Years IIT-JEE + 11 yrs AIEEE TOPICWISE SOLVED PAPERS Chemistry', 0, 'jee-11-yrs-aieee-topicwise-solved-papers-chemistry-1', 2, 1, 1, 'DISHA', 'INDIA', 1, 1, 'shipped', 'upload/images/9681-2021-08-30.jpg', '', '<p>• The book “39 Years IIT-JEE Advanced + 15 years JEE Main/ AIEEE Topic-wise Solved Paper MATHEMATICS with Free e-book” is the first integrated book, which contains topic-wise collection of past JEE advanced (including 1978-2012 IIT-JEE and 2013-16 JEE advanced) questions from 1978 to 2016 and past JEE main (including 2002-2012 AIEEE and 2013-16 JEE Main) questions from 2002 to 2016<br />\r\n• The new edition has been designed in 2-colour layout and comes with a Free e-book which gives you the power of accessing your book anywhere - anytime through web and tablets<br />\r\n• The book is divided into 22 chapters, the flow of chapters has been aligned as per the NCERT books<br />\r\n• Each chapter divides the questions into 9 categories (as per the NEW IIT pattern) - &#39;Fill in the Blanks, True/False, MCQ 1 correct, MCQ more than 1 correct, Passage Based, Assertion-Reason, Multiple Matching, Integer Answer and Subjective Questions&#39;<br />\r\n• All the screening and mains papers of IIT-JEE have been incorporated in the book<br />\r\n• Detailed solution of each and every question has been provided for 100% conceptual clarity of the student, well elaborated detailed solutions with user friendly language provided at the end of each chapter<br />\r\n• Solutions have been given with enough diagrams, proper reasoning to bring conceptual clarity<br />\r\n• The students are advised to attempt questions of a topic immediately after they complete a topic in their class/school/home, the book contains around 3400+ &#39;Milestone Problems&#39; in Mathematics<br />\r\n<br />\r\nHow does the free e-book help?<br />\r\n• Provides the digital version of the book which can be accessed through tablets and web in both online and offline mediums<br />\r\n• Also provides the AIEEE rescheduled 2011 paper and 1997 IIT-JEE cancelled paper<br />\r\n• Alternate solutions to a number of questions<br />\r\n• Quick revision material</p>', 1, '2021-08-29 19:33:31', 1, 7, 'all', '');
