(290, 11, 0, '39 Years JEE Advanced (IIT-JEE)+15 Yrs (2002-2016) JEE MAIN (AIEEE)CHEMISTRY.12th Edition', 0, 'jee-15-yrs-2002', 2, 0, 0, 'DISHA', 'INDIA', 1, 1, 'shipped', 'upload/images/5398-2021-08-30.jpg', '', '<p>• The book “39 Years IIT-JEE Advanced + 15 yrs. JEE Main/AIEEE Topic-wise Solved Paper Chemistry with Free eBook” is the first integrated book, which contains Topic-wise collection of past JEE Advanced (including 1978-2012 IIT-JEE and 2013-16 JEE Advanced) questions from 1978 to 2016 and past JEE Main (including 2002-2012 AIEEE and 2013-16 JEE Main) questions from 2002 to 2016<br />\r\n• The new edition has been designed in 2-colour layout and comes with a Free eBook which gives you the power of accessing your book anywhere - anytime through web and tablets.<br />\r\n• The book is divided into 23 chapters. The flow of chapters has been aligned as per the NCERT books<br />\r\n• Each divides the questions into 9 categories (as per the new IIT pattern) - Fill in the Blanks, True/False, MCQ 1 correct, MCQ more than 1 correct, Passage Based, Assertion-Reason, Multiple Matching, Integer<br />\r\n<br />\r\nAnswer MCQs and Subjective Questions:<br />\r\n<br />\r\n• All the Screening and Mains papers of IIT-JEE have been incorporated in the book<br />\r\n• Detailed solution of each and every question has been provided for 100% conceptual clarity of the student. Well elaborated detailed solutions with user friendly language provided at the end of each chapter<br />\r\n• Solutions have been given with enough diagrams, proper reasoning to bring conceptual clarity<br />\r\n• The students are advised to attempt questions of a topic immediately after they complete a topic in their class/school/home. The book contains around 3200+ &#39;Milestone Problems&#39; in Chemistry<br />\r\n<br />\r\n </p>', 1, '2021-08-29 19:40:14', 1, 7, 'all', ''),
(291, 11, 0, '36 Years IIT-JEE Advanced + 12 Years JEE Main Topic-Wise Solved Paper (Chemistry)', 0, 'jee-advanced-12-years-jee-main-topic', 2, 0, 1, 'DISHA', 'INDIA', 1, 1, 'shipped', 'upload/images/1642-2021-08-30.jpg', '', '<p>A must for every engineering aspirant.</p>\r\n\r\n<p>From the year 2013 onwards, AIEEE (earlier conducted by the CBSE) is known as JEE Main (also conducted by CBSE), the single common engineering entrance in India. The first JEE Main was held in April, 2013. The IIT-JEE exam, in the same year, was replaced by JEE Advanced to be conducted for 1.5 lakh students to be shortlisted on the basis of scores in JEE Advanced. Topic-wise Solved Papers are the most important resources must for every student for 3 reasons:</p>\r\n\r\n<p>This book \"36 Years IIT-JEE Advanced + 12 years JEE Main Topic-wise Solved Paper CHEMISTRY\" is the first integrated book, which contains Topic-wise collection of past JEE Advanced (including 1978-2012 IIT-JEE and 2013 JEE Advanced) questions from 1978 to 2013 and past JEE Main (including 2002-2012 AIEEE and 2013 JEE Main) questions from 2002 to 2013.</p>\r\n\r\n<ul>\r\n	<li>They show what types of questions have been asked in the actual exam - knowledge or understanding or application or analytical, theoretical or numerical, Simple MCQ or Assertion-Reason or Passage based MCQ or Matching MCQ or Picture based or Statement based MCQ.</li>\r\n	<li>They show the trend of the paper over the past years - helps in understanding the examiner&#39;s psyche to understand what to expect and what not to expect in the exam.</li>\r\n	<li>To spot the most important and least important topics for the exam - the number of questions asked from each topic in the various years.\r\n	<ul style=\"list-style-type:disc\">\r\n		<li>The book is divided into 23 chapters. The flow of chapters has been aligned as per the NCERT books.</li>\r\n		<li>Each chapter divides the questions into 9 categories (as per the NEW IIT pattern) - Fill in the Blanks, True or False, MCQ 1 correct, MCQ more than 1 correct, Passage Based, Assertion-Reason, Multiple Matching, Integer Answer MCQs and Subjective Questions.</li>\r\n		<li>Detailed solution of each and every question has been provided for 100% conceptual clarity of the student. Well elaborated detailed solutions with user friendly language provided at the end of each chapter.</li>\r\n		<li>Solutions have been given with enough diagrams, proper reasoning to bring conceptual clarity.</li>\r\n	</ul>\r\n	</li>\r\n	<li>The students are advised to attempt questions of a topic immediately after they complete a topic in their class or school or home. The book contains around 1400 milestone problems in physics. MCQs from all the years divided into the following chapters. Solutions provided immediately after the questions in each chapter.\r\n	<p>Table of Contents</p>\r\n\r\n	<ul style=\"list-style-type:disc\">\r\n		<li>Chapter 1 Classification of Elements and Periodicity in Properties</li>\r\n		<li>Chapter 2 Chemical Bonding and Molecular Structure</li>\r\n		<li>Chapter 3 States of Matter</li>\r\n		<li>Chapter 4 Thermodynamics</li>\r\n		<li>Chapter 5 Equilibrium</li>\r\n		<li>Chapter 6 The s-Block Elements</li>\r\n		<li>Chapter 7 Organic Chemistry—Some Basic Principles and Techniques</li>\r\n		<li>Chapter 8 Hydrocarbons</li>\r\n		<li>Chapter 9 The Solid State and Surface Chemistry</li>\r\n		<li>Chapter 10 Solutions</li>\r\n		<li>Chapter 11 Electrochemistry</li>\r\n		<li>Chapter 12 Chemical Kinetics and Nuclear Chemistry</li>\r\n		<li>Chapter 13 General Principles of Isolation of Elements</li>\r\n		<li>Chapter 14 The p-Block Elements</li>\r\n		<li>Chapter 15 The d-, f-Block Elements and Co-ordination Compounds</li>\r\n		<li>Chapter 16 Halo alkanes and Haloarenes</li>\r\n		<li>Chapter 19 Alcohols, Phenols and Ethers</li>\r\n		<li>Chapter 20 Aldehydes, Ketones and Carboxylic Acids</li>\r\n		<li>Chapter 21 Compounds Containing Nitrogen</li>\r\n		<li>Chapter 22 Carbohydrates, Amino Acids, Polymers and Miscellaneous Match the Following</li>\r\n		<li>Chapter 23 Analytical Chemistry</li>\r\n	</ul>\r\n	</li>\r\n</ul>', 1, '2021-08-29 19:44:06', 1, 7, 'all', ''),
