(297, 11, 0, 'MTG NEET Explorer', 0, 'mtg-neet-explorer', 2, 12, 1, '', 'Disha Publications', 1, 1, 'shipped', 'upload/images/2546-2021-09-13.jpg', '', '<p>Mtg NEET Explorer is a guide to practice and analyze preparation for medical entrance Exam I.E. Neet. It accommodates 10 similar question papers along with 18-year (2003 – 2020) AIPMT/NEET solved papers with detailed solutions and br&gt;Chapter wise analysis. Neet Explorer is a book devised specially for medical aspirants with an aim to impart full practice of paper similar with NEET and Previous year papers to give complete understanding of this exam to its readers. Br&gt;<br />\r\ntable of content:- very-similar papers (1-10) very-similar Paper - 1 very-similar Paper - 2 very-similar Paper - 3 very-similar Paper - 4 very-similar Paper - 5 very-similar Paper - 6 very-similar Paper - 7 very-similar Paper - 8 very-similar Paper - 9 very-similar Paper - 10 Solved Papers (2003-2020) AIPMT solved Paper 2003 AIPMT solved Paper 2004 AIPMT solved Paper 2005 AIPMT solved Paper 2006 AIPMT solved Paper 2007 AIPMT solved Paper 2008 AIPMT solved Paper 2009 AIPMT solved Paper (Prelims) 2010 AIPMT solved Paper (Mains) 2010 AIPMT solved Paper (Prelims) 2011 AIPMT solved Paper (Mains) 2011 AIPMT solved Paper (Prelims) 2012 AIPMT solved Paper (Mains) 2012 NEET solved paper 2013 NEET (Karnataka) solved Paper 2013 AIPMT solved Paper 2014 AIPMT solved Paper 2015 AIPMT solved Paper 2015 (Re-Exam) NEET solved paper 2016 (phases) NEET solved paper 2016 (phase-2) NEET solved paper 2017 NEET solved paper 2018 NEET solved paper 2019 NEET solved paper 2020.</p>', 1, '2021-09-13 13:48:28', 1, 7, 'all', ''),
