(302, 11, 0, 'cengage economic for manager', 0, 'cengage-economic-for-manager', 2, 0, 1, 'Cengage; 12th edition (1 January 2012)', 'INDIA', 0, 0, '', 'upload/images/3232-2021-09-13.jpg', '', 'Packed with managerially oriented applications, ECONOMICS FOR MANAGERS, 12e, illustrates how managers apply theories and techniques to solve real-world problems while teaching future business leaders how to think analytically and make better decisions. Extremely user friendly, the text caters to a variety of learning styles as it presents key analytical concepts in several ways, including tabular analysis, graphical analysis and algebraic analysis. Students learn in a format with which they are comfortable, making difficult material more accessible and easier to understand. The new 12th edition is concise, current and cutting edge with an exciting and extremely relevant new focus on &ldquogreen\" businesses and business developments in the examples and applications. The seasoned author team balances traditional neoclassical micro theory with extensive coverage of the latest analytical tools in managerial economics, such as game-theoretic tactics, information economics and organizational architecture.', 1, '2021-09-13 15:01:20', 1, 0, '', ''),
(303, 11, 0, 'oral antidiabetics samar Banerjee', 0, 'oral-antidiabetics-samar-banerjee', 2, 1, 1, 'Scientific Publishing, New Delhi (1 January 2018)', 'INDIA', 1, 1, 'processed', 'upload/images/9157-2021-09-13.jpg', '', 'This is the first book from the academic world, which is completely dedicated to the discussion on all the practical and upcoming aspects of “Oral Anti Diabetics - Current Concepts” in such minute detail. The book contains 20 important chapters spread over 500 pages with beautiful designing and well-planned masterly setup with many tables and charts. Subjects have been selected in an intricate manner, involving topics related to the day-to-day issues in treating different problems of diabetes. Information is very up-to-date, practical, demanding and supported by latest guidelines and maximum number of authentic references. Every chapter is enriched with the final opinion from the vast experience of the author. Salient points in brief are presented in text boxes, as a rapid and ready reckoner. The relevant frequently asked questions of the practising physicians are answered in a very lucid and fluent language. Attempts have been made to strengthen the knowledge of the readers to face challenges in solving the crisis in Diabetes. This is overall the sixth single author book on Diabetes by Prof (Dr) Samar Banerjee and it is an example of his long-term involvement and practical judgement in diabetes, based on hands-on experience for more than 40 years. Hope, this book will fulfil the time-honoured reasonable demands for the knowledge in diabetes of the practicing physicians and finally improve the care of persons with diabetes to whom we are really committed to.', 1, '2021-09-13 15:05:40', 1, 7, 'all', ''),
(304, 11, 0, 'surgery complete dr.jai and dr.vineet', 0, 'surgery-complete-dr-jai-and-dr-vineet', 2, 0, 1, '‎DR BHATIA PUBLISHING HOUSE (1 January 2021)', 'INDIA', 1, 1, 'processed', 'upload/images/8780-2021-09-13.jpg', '[\"../upload/other_images/1631546200.898-580.jpg\"]', 'This is the best available book for SURGERY for any PG entrance exam because of following reasons. 1.All Topics of SURGERY have been covered separately as text, with crisp, concise and to the point description. This book is complete in all the aspect for SURGERY. After that, each topic is followed by Review questions from NEET, INI-CET & Various PG Exams of over last 10 years. 2.Last Minute Revision Points (LMRP) and High yield points (HYP) make it easy to recall the content in very short time. 3.The contents of the book have been organized in different sections of SURGERY and in each chapter there is a basic content and then followed by specific details of each and every topic. For each topic the MCQ’s have been given to practice for the different examination and it has been tried that the questions are exact replica of the questions being asked in different examinations. Latest questions from all the exams like NEET, INI-CET and the changing & upcoming trend of NEXT Entrance Examination has been included in this book. 4.Remember it’s not just the questions that are repeated in exams but the “TOPICS” too, keeping that in mind other relevant content is also added to the explanations”. 5.So first you read the text of the book, then you attempt the questions. In this way you can finish your entire SURGERY in a short time & you will have plenty of time for revision. 6.Last Minute Revision Points (LMRP) 48 hours, before your Exam, you read LMRP, you will be able to revise whole subject in just 1 hour!!! 7.Although care has been taken in compiling this book but making mistake is a human nature so we request all the readers of the book to kindly point to the mistakes, if you find any and do tell us about your suggestions/views or ideas that may be used to improve the further editions of the book at: studentsupport@dbmi.edu.in', 1, '2021-09-13 15:16:40', 1, 7, 'all', ''),
