(309, 11, 0, 'medicine simplified dr mukesh Bhatia', 0, 'medicine-simplified-dr-mukesh-bhatia', 2, 12, 0, 'DR. BHATIA PUBLISHING HOUSE (1 January 2021)', 'INDIA', 1, 1, 'processed', 'upload/images/7659-2021-09-13.jpg', '[\"../upload/other_images/1631548206.7495-266.jpg\"]', 'Dear student, I am glad to present you with Next Edition of Medicine Textbook for the year 2021. All the chapters of this Book are based on 20th Edition of Harrison\'s Principles of Internal Medicine and other standard textbooks of medicine. The vast subject of Medicine is given in a very simple and concise manner which is easy to understand and retain. A crisp approach has been adopted to write this book i.e. Book contains the content what you really need to read for your exam. No unnecessary content is there (Crisp approach). This book is sufficient to solve most of the MCQs of NEET PG, INI - CET. These notes are up to date and contain recent advances in the Medicine and contain information not given even in 20th edition of Harrison also!!!. I have taken special care to remove all the mistakes, but still if you come across any error please feel free to mail us. You would be acknowledged your contributions. Any Suggestion and comments are also welcome at studentsupport@dbmi.edu.in.', 1, '2021-09-13 15:50:06', 1, 7, 'all', ''),
