(314, 11, 0, 'sure success magic B ramgopal', 0, 'sure-success-magic-b-ramgopal', 2, 0, 1, 'Jaypee Brothers Medical Publishers; Thirteenth edition (1 January 2020)', 'INDIA', 1, 1, 'processed', 'upload/images/3914-2021-09-13.jpg', '', 'The primary intent of this book remains the same as ever, I.E. To act as a ready reckoner for quick revision and provides the postgraduate seat aspirant with an extensive resource of the most frequently asked topics (high yield topics) of all subjects, in each and every PG entrance Exam such as NEET PG, AIIMS, PGIMER, JIPMER, FMGE and the upcoming next– in fact each and every PG medical entrance Exam in India! Image-based questions are a routine feature in PG entrance exams now and this book contains plenty of images to help students face these questions confidently. The other highlights and unique features of this book are mentioned on the front and back covers. In addition to the motto of “maximum information in minimum time”, the main motto of this thirteenth edition is to be a “no nonsense, high yield, useful and up to date” PG entrance preparation book. It will give you all the necessary one-liners without compromising on the concepts.', 1, '2021-09-13 16:38:25', 1, 7, 'all', ''),
