(317, 11, 0, 'langman\'s medical embryology', 0, 'langman-s-medical-embryology', 2, 12, 1, 'Wolters Kluwer India Pvt. Ltd.; Thirteenth edition (1 January 2016)', 'INDIA', 1, 1, 'processed', 'upload/images/7288-2021-09-13.jpg', '', 'Langman\'s Medical Embryology, 13/helps medical, nursing and health professions students develop a basic understanding of embryology and its clinical relevance. Concise chapter summaries, captivating clinical correlates boxes, clinical problems and a clear, concise writing style make the subject matter accessible to students and relevant to instructors.', 1, '2021-09-13 16:48:32', 1, 7, 'all', ''),
(318, 11, 0, 'kiplingers practical guide to your money', 0, 'kiplingers-practical-guide-to-your-money', 2, 1, 1, 'Kaplan Publishing; 3rd edition (1 October 2005)', 'INDIA', 1, 1, 'processed', 'upload/images/0932-2021-09-13.jpg', '', 'Kiplinger’s Practical Guide to Your Money covers every one of life’s financial milestones in detail-from renting or buying a home, purchasing life insurance, and sizing up banks and credit unions, to marrying, paying for a child’s education, and planning for retirement-making this the most exhaustive handbook on the market. What’s more, Kiplinger’s Web site, www.kiplinger.com, complements the guide by providing all the latest tax code information. When it comes to money, the editors of Kiplinger’s Personal Finance contend that people should be able to keep more of it, make it grow, enjoy it, protect it, and pass it on. Equipped with their sound advice, readers will assume responsibility for their financial futures, so that they can gain and maintain greater financial independence.', 1, '2021-09-13 16:55:27', 1, 7, 'all', ''),
(319, 11, 0, 'macleod\'s clinical examination', 0, 'macleod-s-clinical-examination', 2, 12, 1, 'Elsevier; 14th edition (26 July 2018)', 'INDIA', 1, 1, 'processed', 'upload/images/8216-2021-09-13.jpg', '', 'This classic textbook aims to assist clinicians develop the consultation skills required to elicit a clear history, and the practical skills needed to detect clinical signs of disease. Where possible, the physical basis of clinical signs is explained to aid understanding. Formulation of a differential diagnosis from the information gained is introduced, and the logical initial investigations are included for each system.\r\n\r\nThe first part of the book addresses the general principles of good interaction with patients, from the basics of taking a history and examining, to the use of pattern recognition to identify spot diagnoses.\r\nThe second part documents the relevant history, examination and investigations for all the major body systems.\r\nThe third part illustrates the application of these skills to specific clinical situations.\r\nThe final part covers preparation for assessments of clinical skills and the use of these skills in everyday practice.\r\nThe book has accompanying videos demonstrating many of the key clinical examination routines as set out in the book.\r\nA new editorial team has undertaken a substantial review of the book’s contents and with the help of many new authors has radically revised the order and approach of the text.\r\nSeveral new chapters have been created including a chapter on patients with mental disorders; a chapter covering the approach to a deteriorating patient; a chapter on assessment of patients towards the end of life and two new chapters on applying the key clinical skills during assessments and in practice.\r\nThe structure of the text has been rationalised with careful use of boxes, tables and figures to set out the concepts for maximum clarity.', 1, '2021-09-13 17:00:40', 1, 7, 'all', ''),
(320, 11, 0, 'Jaypee human neuroanatomy inderbir singh', 0, 'jaypee-human-neuroanatomy-inderbir-singh', 2, 12, 0, 'Jaypee Brothers Medical Publishers; Tenth edition (5 June 2017)', 'INDIA', 1, 1, 'processed', 'upload/images/4485-2021-09-13.jpg', '[\"../upload/other_images/1631552657.5138-700.jpg\"]', 'More refined and updated New edition for undergraduate students\r\n• Total number of chapters has been reduced to 16 from the previous edition of 20.\r\n• New high resolution and labelled photographs of Brain Specimen (Dissection) have been added in the eight plates of black background at the beginning of the book to help students identify various parts of the brain during pro-section studies and at home.\r\n• More line diagrams, tables and New flowcharts have been added to facilitate easy understanding.\r\n• Anatomical basis of a lot of neurological conditions have been highlighted in coloured boxes.\r\n• New section on “Clinical Cases” has been added to each chapter to enhance clinical problem solving skills.\r\n• Origin, course, distribution and clinical anatomy of each cranial nerve have been added which will help students in correlating dissection/pro-section of head and neck regions.\r\n• Each chapter contains short and long answer questions collated from various university examinations for students to do self-assessment and to practise for examinations.\r\n• Useful for undergraduate medical and paramedical students and also for postgraduates and medical teachers.', 1, '2021-09-13 17:04:17', 1, 7, 'all', ''),
(321, 11, 0, 'Elsevier medicine', 0, 'elsevier-medicine', 2, 0, 1, 'Elsevier India; 2nd edition (10 October 2018)', 'INDIA', 1, 1, 'processed', 'upload/images/2847-2021-09-13.jpg', '', 'This book fulfills the unmet need of quick review question answer book and at the same time cover the entire syllabus of Community Medicine, spread over 30 chapters and each chapter has 1 or 2 solved long questions, 8 to 10 solved short notes, viva voce and MCQs related to that chapter.\r\n\r\n Each chapter has 1 or 2 solved long questions, 8 to 10 solved short notes, viva voce and MCQs related to that chapter.\r\n\r\nThe answers to long questions, short notes are crisp, though at the same time, containing all essential details.\r\n\r\nIn this new edition digital assets are also included.\r\n\r\nIn this new edition digital assets,MCQs are also included.', 1, '2021-09-13 17:13:13', 1, 7, 'all', ''),
