(328, 7, 0, 'Theory of Machines  (English, Paperback, Khurmi R. S.)', 0, 'theory-of-machines-english-paperback-khurmi-r-s', 2, 1, 1, 'S Chand & Co Ltd', 'INDIA', 1, 1, 'received', 'upload/images/0116-2021-09-28.jpeg', '', '<p> </p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; color: rgb(33, 33, 33); font-family: Roboto, Arial, sans-serif; font-size: 14px;\">Theory of Machines is a comprehensive reference book for B.E and B.Tech students from the Mechanical Engineering stream.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; color: rgb(33, 33, 33); font-family: Roboto, Arial, sans-serif; font-size: 14px;\">Theory of Machines is a book on various concepts related to mechanical engineering. It is aimed at engineering students at the undergraduate level. It is also recommended for aspirants of the UPSC (Union Public Service Commission) exams.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; color: rgb(33, 33, 33); font-family: Roboto, Arial, sans-serif; font-size: 14px;\">The book begins with an introduction to the subject. This is followed by chapters on kinetics and kinematics of motion, velocity and acceleration in mechanisms, friction, gear trains, toothed gearing, dynamo-meters and brakes. Chapters on concepts like cams, rotating and reciprocating masses, transverse and longitudinal vibrations, torsional vibrations, and automatic control are also included in the book. A separate chapter is dedicated to computer-aided analysis and synthesis of mechanisms.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; color: rgb(33, 33, 33); font-family: Roboto, Arial, sans-serif; font-size: 14px;\">The concepts in the book are presented so as to be self-explanatory. Numerous examples, both solved and unsolved, are included wherever relevant to further elucidate the concepts.</p>', 1, '2021-09-28 07:20:04', 1, 7, 'all', ''),
