(353, 26, 0, 'Modern Control Engineering', 0, 'modern-control-engineering-2', 25, 0, 1, 'Ogata', 'Pearson', 1, 1, 'shipped', 'upload/images/6688-2021-10-03.jpg', '', '<p>Ogata\'s Modern Control Engineering, 5/e, offers the comprehensive coverage of continuous-time control systems that all senior students must have, including frequency response approach, root-locus approach and state-space approach to analysis and design of control systems. The text provides a gradual development of control theory, shows how to solve all computational problems with MATLAB and avoids highly mathematical arguments. A wealth of examples and worked problems are featured throughout the text. The new edition includes improved coverage of Root-Locus Analysis (Chapter 6) and Frequency-Response Analysis (Chapter 8). The author has also updated and revised many of the worked examples and end-of-chapter problems.</p>', 1, '2021-10-03 08:44:42', 1, 7, 'all', ''),
