(358, 26, 0, 'Political Science', 0, 'political-science-3', 25, 0, 1, 'Dr. J.C. Johari', 'sbpd', 1, 1, 'shipped', 'upload/images/2209-2021-10-03.jpeg', '', '<p>Political Science Class-12 (PART A: Contemporary World Politics, PART B: Politics in India since Independence) a book Contents: PART ‘A’ : CONTEMPORARY WORLD POLITICS 1.The Cold War Era in World Politics, 2.Disintegration of the Second World and the Collapse of Bipolarity, 3.American Dominance in World Politics, 4. Alternative Centres of Economic and Political Power, 5 .South Asia in Post-Cold War Era, 6.International Organisations, 7. Security in the Contemporary World, 8. Environment and Natural Resources in Global Politics, 9 .Globalisation, High Order Thinking Skills (HOTS) Questions PART ‘B’ : POLITICS IN INDIA SINCE INDEPENDENCE 1.Nation-Building and its Problems, 2 .Era of One-Party Dominance, 3 .Politics of Planned Development, 4. India’s External Relations, 5. Challenges to and Restoration of the Congress System, 6 .Crisis of the Constitutional Order, 7. Regional Aspirations and Conflicts, 8. Rise of New Social Movements, 9 .Democratic Upsurge and Coalition Politics,10.Recent Issues and Challenges, High Order Thinking Skills (HOTS) Questions Board Examination Papers.</p>', 1, '2021-10-03 09:14:59', 1, 7, 'all', ''),
