(360, 26, 0, 'Economics Class 12 Based On NCERT Guideline', 0, 'economics-class-12-based-on-ncert-guideline-3', 25, 0, 1, 'Anupam agarwal', 'sbpd', 1, 1, 'shipped', 'upload/images/4862-2021-10-03.jpeg', '', '<p>Strictly according to the latest syllabus prescribed by Central Board of Secondary Education (CBSE), Delhi and State Boards of Bihar, Jharkhand, Uttarakhand, Rajasthan, Haryana, H.P. etc. & Navodaya, Kasturba, Kendriya Vidyalayas etc. following CBSE curriculum based on NCERT guidelines. Part A : Introductory Micro Economics 1.Micro Economics : An Introduction, 2. Central Problems of an Economy, 3. Consumer’s Equilibrium, 4. Demand and Law of Demand, 5. Price Elasticity of Demand, 6. Production Function : Returns to a Factor and Returns to Scale, 7. Production Costs, 8. Concepts of Revenue, 9. Producer’s Equilibrium : Meaning and Conditions, 10. Supply and Law of Supply, 11. Elasticity of Supply, 12. Different Forms of Market : Meaning and Features, 13. Market Equilibrium Under Perfect Competition and Effects of Shifts in Demand & Supply, 14. Simple Applications of Tools of Demand and Supply, Part B : Introductory Macro Economics 15. Macro Economics : Meaning, 16. Circular Flow of Income, 17. Concepts and Aggregates related to National Income, 18. Measurement of National Income, 19. Money : Meaning, Evolution and Functions, 20. Commercial Banks and Credit Creation, 21. Central Bank : Meaning and Functions, 22. Recent Significant Reforms and Issues in Indian Banking System : Privatisation and Modernisation, 23. Aggregate Demand, Aggregate Supply and Related Concepts (Propensity to Consume, Propensity to Save and Investment), 24. Short Run Equilibrium Output, 25. Investment Multiplier and its Mechanism, 26. Problems of Deficient and Excess Demand, 27. Measures to Correct Deficient Demand and Excess Demand, 28. Government Budget and Economy, 29. Foreign Exchange Rate, 30. Balance of Payment Accounts : Meaning and Components. Model Paper Board Examination Papers</p>', 1, '2021-10-03 09:23:56', 1, 7, 'all', ''),
(362, 26, 0, 'Itihash (History)', 0, 'itihash-history-2', 21, 0, 1, 'Dr. Brijesh Kumar Shrivastava', 'sbpd', 1, 1, 'shipped', 'upload/images/5488-2021-10-03.jpeg', '', '<p>Strictly according to the latest syllabus prescribed by Central Board of Secondary Education (CBSE), Delhi and State Boards of Uttar pradesh, Bihar, Jharkhand, Uttarakhand, Rajasthan, Haryana, H.P. etc. & Navodaya, Kasturba, Kendriya Vidyalayas etc. following CBSE curriculum based on NCERT guidelines. UNIT – I Archaeology & Ancient India 1. The Story of the First Cities : Harappan Archaeology, 2. Political and Economic History from the Mauryan to Gupta Period, 3. Social History : With Special Reference to Mahabharata, 4. History of Ancient Indian Religions with Special Reference to Buddhism and Sanchi Stupa, UNIT – II Medieval India 5. The Ain-i-Akbari : Agrarian Relations, 6. The Mughal Court : Reconstructing History through Chronical, 7. Architecture of Hampi (Vijaynagar), 8. Religious History : The Bhakti-Sufi Tradition, 9. Medieval Society through Foreign Travellers Accounts, UNIT- IV Modern India 10. Colonialism and Rural Society : Evidence from Official Report, 11. ‘1857’ A Review, 12. Colonial Cities—Urbanisation, Planning and Architecture, 13. Mahatma Gandhi through Contemporary Eyes and his Role in the Indian Politics, 14. Partition of India and its Study through Oral Sources, 15. Making of the Indian Constitution.</p>', 1, '2021-10-03 09:31:26', 1, 7, 'all', ''),
(365, 26, 0, 'Object-Oriented Programming with C++', 0, 'oriented-programming-with-c-2', 25, 0, 1, 'E Balagurusamy', 'mc grawhill', 1, 1, 'shipped', 'upload/images/3618-2021-10-05.jpg', '', '<p>Object-oriented programming with C++, 8th edition is here with some valuable updates. The new edition helps students to assess their learning by answering questions based on learning outcomes. Objective-type questions and dry-run questions are introduced to make students exam ready. A new appendix on interview questions is for those seeking to join the industry. The book is designed for students studying at the undergraduate level. It provides all-inclusive concepts and programs on object-oriented programming with C++ as an implementation language.<br />\r\nhighlights:<br />\r\n<br />\r\n150+ multi-choice questions<br />\r\n<br />\r\n100+ dry-run exercises<br />\r\n<br />\r\n90+ interview questions<br />\r\n<br />\r\nTwo new projects<br />\r\n<br />\r\nNew appendix on implementation of abstract data types<br />\r\n<br />\r\nclassification of review questions on OBE (outcome-based education) learning pattern<br />\r\n<br />\r\nAll programs upgraded for compatibility with ansi C++<br />\r\n.</p>', 1, '2021-10-05 13:45:16', 1, 7, 'all', ''),
(366, 26, 0, 'PROGRAMMING IN BASIC', 0, 'programming-in-basic-2', 25, 0, 1, 'Herbert Schildt', 'mc grawhill', 1, 1, 'shipped', 'upload/images/0614-2021-10-05.jpg', '', '<p>Another gem from Herb Schildt--best-selling programming author with more than 2.5 million books sold! C: The Complete Reference, Fourth Edition gives you full details on C99, the New ANSI/ISO Standard for C. You\'ll get in-depth coverage of the C language and function libraries as well as all the newest C features, including restricted pointers, inline functions, variable-length arrays, and complex math. This jam-packed resource includes hundreds of examples and sample applications.</p>', 1, '2021-10-05 13:50:54', 1, 7, 'all', ''),
(367, 26, 0, 'Thermodynamics - An Engineering Approach', 0, 'an-engineering-approach-2', 25, 0, 1, 'yunus a cengel', 'mc grawhill', 1, 1, 'shipped', 'upload/images/4737-2021-10-05.jpg', '', '<p>Distinguished as a best seller, the title Thermodynamics: An Engineering Approach is taking another step towards excellence with this revised edition. Through its careful explanations of concepts, and use of numerous practical examples and figures, this book aims to bridge the gap between knowledge and the confidence to properly apply it.</p>\r\n\r\n<p>Key Features:</p>\r\n\r\n<p>✔ Written in a self-instructive manner, it speaks to students, not over students</p>\r\n\r\n<p>✔ Emphasizes on the physical aspects of the subject matter in addition to mathematical representations and manipulations.</p>\r\n\r\n<p>✔ Follows a physical, intuitive approach to help students master the practical problems</p>\r\n\r\n<p>✔ Contains a rich pool of pedagogy which revolve around the real-world problems</p>', 1, '2021-10-05 13:55:35', 1, 7, 'all', ''),
(368, 26, 0, 'Circuits and Networks', 0, 'circuits-and-networks-7', 25, 0, 1, 'A sudhakar', 'mc grawhill', 1, 1, 'shipped', 'upload/images/4666-2021-10-05.jpg', '', '<p>The revision of this extremely popular text, Circuits and Networks: Analysis and Synthesis, comes at a time when the industry is increasingly looking to hire engineers who are able to display learning outcomes. The book has been revised based on internationally accepted Learning Outcomes required from a course. Additionally, key pedagogical aids, such as questions from previous year question papers are added afresh to further help students in preparing for this course and its examinations. For the tech savvy, the practice of MCQs in a digital and randomized environment will provide thrill.</p>\r\n\r\n<p>Book Features:</p>\r\n\r\n<ul>\r\n	<li>Content revised as per internationally accepted learning outcomes</li>\r\n	<li>461 Frequently asked questions derived from important previous year question papers</li>\r\n	<li>Features like Definition and Important Formulas are highlighted within the text</li>\r\n</ul>\r\n\r\n<p>Table of Contents:</p>\r\n\r\n<ul>\r\n	<li>Circuit Elements and Kirchoff\'s Laws</li>\r\n	<li>Methods of Analysing Circuits</li>\r\n	<li>Useful Theorems in Circuit Analysis</li>\r\n	<li>Introduction to Alternating Currentsand Voltages</li>\r\n	<li>Complex Impedance</li>\r\n	<li>Power and Power Factor</li>\r\n	<li>Steady State AC Analysis</li>\r\n	<li>Resonance</li>\r\n	<li>Polyphase Circuits</li>\r\n	<li>Coupled Circuits</li>\r\n	<li>Transients</li>\r\n	<li>Fourier Method of Waveform Analysis</li>\r\n	<li>Introduction to Laplace Transform</li>\r\n	<li>Application of the Laplace Transform in Circuit Analysis</li>\r\n	<li>S-Domain Analysis</li>\r\n	<li>Two-Port Networks</li>\r\n	<li>Filters and Attenuators</li>\r\n	<li>Elements of Realizability and Synthesis of One- Port Networks</li>\r\n	<li>An Introduction to PSpice</li>\r\n</ul>\r\n\r\n<p>Appendix A: Fourier Series<br />\r\nAppendix B: The j Factor<br />\r\nIndex</p>', 1, '2021-10-05 13:58:33', 1, 7, 'all', ''),
(369, 26, 0, 'Wireless Communications', 0, 'wireless-communications-2', 25, 0, 1, 'TL Signal', 'mc grawhill', 1, 1, 'shipped', 'upload/images/3136-2021-10-05.jpg', '', '<p>The book presents detailed understanding on fundamentals of Wireless Communication. The topics are written in simple language covering important aspects of wireless communication and networks. Emerging trends like WLAN, Bluetooth, Fixed Broadband and Wireless WAN communications are aptly covered. Technical concepts which are at the core of design, planning and evaluation of wireless communication are presented in detail. The mathematical derivations are given in step by step manner for easy understanding. The book has excellent pedagogy with numerous solved examples and practice questions. Plenty of short answer type questions and objective type questions are included in the text extensively for exam preparation. Some real life figures of wireless devices are also provided in the book to invoke student’s interest.</p>', 1, '2021-10-05 14:03:06', 1, 7, 'all', ''),
(370, 26, 0, 'Operating Systems', 0, 'operating-systems-2', 25, 0, 1, 'Achyut Godbole , Atul Kahate', 'mc grawhill', 1, 1, 'shipped', 'upload/images/7832-2021-10-05.jpg', '', '<p>This book aims to demystify the subject using a simplified step-wise approach of going from the basic fundamentals concepts to advanced concepts. The approach, combined with the numerous illustrations and other pedagogical features of the book, makes it an invaluable resource for the students.</p>', 1, '2021-10-05 14:07:13', 1, 7, 'all', ''),
