(375, 26, 0, 'Electric Machines', 0, 'electric-machines-3-1', 21, 0, 1, 'D.P kothari I.J Nagrath', 'mc grawhill', 1, 1, 'shipped', 'upload/images/3196-2021-10-06.jpg', '', '<p>Electric Machines, now in its 5\" edition, is intended for third and fourth year UG students and first year PG students of electrical engineering-updated with latest scientific advancements. The changes are made keeping the original flavor of the book intact, that is, in-depth coverage of fundamental concepts. This edition contains plethora of solved examples, competitive examination based MCQs and MATLAB examples to enhance problem solving skills. The book can be used as a quick reference by practicing engineers and is also useful to lAS, IES, GATE and other entrance and job examination aspirants preparing for the subject.</p>', 1, '2021-10-06 07:49:29', 1, 7, 'all', ''),
(376, 26, 0, 'Digital Signal Processing', 0, 'digital-signal-processing-2', 25, 0, 1, 'A Nagoor Kani', 'mc grawhill', 1, 1, 'shipped', 'upload/images/7805-2021-10-06.jpg', '', '<p>Digital Signal Processing by A Nagoor Kani has been written keeping in mind the requirement of the students. The subject dealt with in this book is highly mathematical in nature. The author of the book has, therefore, laid stress on the methodology of solving various problems. Mathematical derivations are elucidated in a step-by-step manner for students to understand and remember. In order to help improve the understanding of the subject, the author has provided exercise problems ranging across a wide variety of difficulty levels.</p>\r\n\r\n<p>The book contains 12 chapters which covers various topics and 7 Appendices which contain the key points on certain vital matters relating to the subject. The book contains a total of 320 solved examples and 1080 exercise problems. to make the subject more understandable for students, a set of 305 short questions and answers are also provided in the book.</p>\r\n\r\n<p>The 2nd edition of Digital Signal Processing was published by Tata McGraw Hill Publishing Company in 2012. Available as a paperback, it is helpful for practitioners and engineering students.</p>\r\n\r\n<p>Key Features:</p>\r\n\r\n<p> </p>\r\n\r\n<ul>\r\n	<li>The book contains exercise problems involving varied levels of difficulty and help students in sharpening their intuitive skill.</li>\r\n</ul>', 1, '2021-10-06 07:59:31', 1, 7, 'all', ''),
(377, 26, 0, 'Modern Digital Electronics', 0, 'modern-digital-electronics-2', 25, 0, 1, 'R.P jain', 'mc grawhill', 1, 1, 'shipped', 'upload/images/0604-2021-10-06.jpg', '', '<p>The revised edition of Modern Digital Electronics focuses on rigorous coverage of design and analysis of complex digital circuits and systems through enhanced elucidation of Sequential Logic Design, PLDs, Memories and VHDL implementation codes. Begins with the fundamental concepts of digital electronics, it covers digital design using VHDL supported by plethora of examples.</p>', 1, '2021-10-06 08:03:26', 1, 7, 'all', ''),
(378, 26, 0, 'Computer Graphics', 0, 'computer-graphics-2', 25, 0, 1, 'Chennakesava R', 'PHI Publication', 1, 1, 'shipped', 'upload/images/6857-2021-10-06.jpg', '', '<p>The book begins with an introduction to the subject and goes on to discuss various graphic techniques with the help of several examples and neatly drawn figures. It elaborates on methods for modelling and performing geometric transformations and methods for obtaining views in both two and three dimensions. With a programming-oriented approach, the book also describes all the processes used in computer graphics along with easy-to-read algorithms, which will enable students to develop their own software skills.</p>', 1, '2021-10-06 08:14:51', 1, 7, 'all', ''),
(379, 26, 0, 'Digital Principles and Design', 0, 'digital-principles-and-design-2', 25, 0, 1, 'Donald Givone', 'mc grawhill', 1, 1, 'shipped', 'upload/images/7518-2021-10-06.jpg', '', '<p>Digital Principals and Design is a comprehensive new textbook, which takes a classical approach to the subject of digital design, emphasizing through presentation of the basic principles of logic design and the illustration of these principles. The book is intended for an introductory course in digital principles with emphasis on logic, design as well as for a more advanced course. With the exception of the digital circuits appendix,it assumes no background on the part of the reader. Students in computer science, computer engineering and electrical can use the text.</p>', 1, '2021-10-06 08:20:16', 1, 7, 'all', ''),
