(381, 26, 0, 'Circuits and Networks: Analysis and Synthesis', 0, 'circuits-and-networks-analysis-and-synthesis-4', 25, 0, 1, 'A Sudhakar', 'mc grawhill', 1, 1, 'shipped', 'upload/images/9792-2021-10-06.jpg', '', '<p>The revision of this extremely popular text, Circuits and Networks: Analysis and Synthesis, comes at a time when the industry is increasingly looking to hire engineers who are able to display learning outcomes. The book has been revised based on internationally accepted Learning Outcomes required from a course. Additionally, key pedagogical aids, such as questions from previous year question papers are added afresh to further help students in preparing for this course and its examinations. For the tech savvy, the practice of MCQs in a digital and randomized environment will provide thrill.</p>\r\n\r\n<p>Book Features:</p>\r\n\r\n<ul>\r\n	<li>Content revised as per internationally accepted learning outcomes</li>\r\n	<li>461 Frequently asked questions derived from important previous year question papers</li>\r\n	<li>Features like Definition and Important Formulas are highlighted within the text</li>\r\n</ul>\r\n\r\n<p>Table of Contents:</p>\r\n\r\n<ul>\r\n	<li>Circuit Elements and Kirchoff\'s Laws</li>\r\n	<li>Methods of Analysing Circuits</li>\r\n	<li>Useful Theorems in Circuit Analysis</li>\r\n	<li>Introduction to Alternating Currentsand Voltages</li>\r\n	<li>Complex Impedance</li>\r\n	<li>Power and Power Factor</li>\r\n	<li>Steady State AC Analysis</li>\r\n	<li>Resonance</li>\r\n	<li>Polyphase Circuits</li>\r\n	<li>Coupled Circuits</li>\r\n	<li>Transients</li>\r\n	<li>Fourier Method of Waveform Analysis</li>\r\n	<li>Introduction to Laplace Transform</li>\r\n	<li>Application of the Laplace Transform in Circuit Analysis</li>\r\n	<li>S-Domain Analysis</li>\r\n	<li>Two-Port Networks</li>\r\n	<li>Filters and Attenuators</li>\r\n	<li>Elements of Realizability and Synthesis of One- Port Networks</li>\r\n	<li>An Introduction to PSpice</li>\r\n</ul>\r\n\r\n<p>Appendix A: Fourier Series<br />\r\nAppendix B: The j Factor<br />\r\nIndex</p>', 1, '2021-10-06 08:27:58', 1, 7, 'all', ''),
(382, 26, 0, 'Electric Machines', 0, 'electric-machines-3', 21, 0, 1, 'D.P kothari I.J Nagrath', 'mc grawhill', 1, 1, 'shipped', 'upload/images/8923-2021-10-06.jpg', '', '<p>Electric Machines, now in its 5\" edition, is intended for third and fourth year UG students and first year PG students of electrical engineering-updated with latest scientific advancements. The changes are made keeping the original flavor of the book intact, that is, in-depth coverage of fundamental concepts. This edition contains plethora of solved examples, competitive examination based MCQs and MATLAB examples to enhance problem solving skills. The book can be used as a quick reference by practicing engineers and is also useful to lAS, IES, GATE and other entrance and job examination aspirants preparing for the subject.</p>', 1, '2021-10-06 08:29:47', 1, 7, 'all', ''),
(383, 26, 0, 'MACHINE DRAWING', 0, 'machine-drawing-3', 25, 0, 1, 'RB Gupta', 'Satya Prakashan', 1, 1, 'shipped', 'upload/images/9715-2021-10-06.jpg', '', '<p>The purpose of writing the book on Machine Drawing is to meet the requirements of Engineering Degree and Diploma students. It is based upon the syllabuses specified by different State Boards of Technical Education and Universities. The book is in First Angle Projection according to the specifications of the Bureau of Indian Standards. However, the Third Angle Projection has also been included. It covers full syllabuses of different Engineering Universities and State Boards of Technical Education Many questions of the examination papers which were in F.P.S. and First Angle Projection, have been converted in M.K.S. and Third Angle Projection. The dimensions of the figures are in millimetres unless otherwise specified</p>', 1, '2021-10-06 08:35:56', 1, 7, 'all', ''),
(384, 26, 0, 'Power Electronics', 0, 'power-electronics-5', 25, 0, 1, 'PS Bimbhra', 'Khanna publication', 1, 1, 'shipped', 'upload/images/6775-2021-10-06.jpg', '', '<p>Introduction power semiconductor diodes and transistors<br />\r\ndiode circuits and rectifiers<br />\r\nthyristors<br />\r\nthyristor commutation techniques<br />\r\nphase controlled rectifiers<br />\r\nchoppers<br />\r\ninverter<br />\r\nac voltage controllers<br />\r\ncycloconverters some applications electric drives power factor improvement<br />\r\nswitching mode Dc-Dc converters power supplies power electronic controllers for AC transmission<br />\r\nappendix-a Fourier analysis<br />\r\nappendix-b Laplace transforms<br />\r\nappendix-c objective type questions appendix some useful functions appendix references<br />\r\nindex.</p>', 1, '2021-10-06 08:40:33', 1, 7, 'all', ''),
(385, 26, 0, 'Theory of Machines, 5th Edition', 0, 'theory-of-machines-5th-edition-1', 21, 0, 1, 'S.S Rattan', 'mc grawhill', 1, 1, 'shipped', 'upload/images/3858-2021-10-06.jpg', '[\"../upload/other_images/1633509836.2072-393.jpg\"]', '<p>Popular for more than four decades for its uniquely written theory derived from the very basic principles, book - Theory of machines is enriched with the significant value-adds in every edition. Carrying on the legacy, this edition aims at focused learning in respect to today\'s competitive world. The book is broadly divided into two sections, namely Kinematics and Dynamics of Machines. These sections are lucidly explained with logical presentation of topics. The book also includes various advanced topics that are supported with strong pedagogy, including various questions from competitive examinations as well.</p>\r\n\r\n<p>Salient Features:</p>\r\n\r\n<p>• Revised sections on Gyroscope</p>\r\n\r\n<p>• A step forward to problem-solving, introducing a feature ‘To consider’ that helps address the most complex problems</p>\r\n\r\n<p>• Various MCQs from GATE added with difficult ones included and solved as Examples</p>\r\n\r\n<p>• Balanced presentation of graphical and algebraic approaches</p>\r\n\r\n<p>• Computer programs in user friendly C language</p>\r\n\r\n<p>• Appendices containing glossary of terms, important relations and results</p>\r\n\r\n<p>• Pedagogy includes:</p>\r\n\r\n<p>✔ 389 Examples</p>\r\n\r\n<p>✔ 401 MCQs</p>\r\n\r\n<p>✔ 516 Numerical Problems</p>', 1, '2021-10-06 08:43:56', 1, 7, 'all', ''),
(386, 26, 0, 'Control Systems Engineering (Multi Colour Edition)', 0, 'control-systems-engineering-multi-colour-edition-2', 25, 0, 1, 'I J Nagrath', 'New Age International Publication', 1, 1, 'shipped', 'upload/images/1590-2021-10-06.jpg', '', '<p>Reading books is a kind of enjoyment. Reading books is a good habit. We bring you a different kinds of books. You can carry this book where ever you want. It is easy to carry. It can be an ideal gift to yourself and to your loved ones. Care instruction keep away from fire.</p>', 1, '2021-10-06 08:47:41', 1, 7, 'all', ''),
(387, 26, 0, 'Theory Of Machines', 0, 'theory-of-machines-6', 25, 0, 1, 'RS Khurmi', 'S Chand', 1, 1, 'shipped', 'upload/images/6111-2021-10-06.jpg', '', '<p>Reading books is a kind of enjoyment. Reading books is a good habit. We bring you a different kinds of books. You can carry this book where ever you want. It is easy to carry. It can be an ideal gift to yourself and to your loved ones. Care instruction keep away from fire.</p>', 1, '2021-10-06 08:51:25', 1, 7, 'all', ''),
(388, 26, 0, 'Principles And Practice Of Management', 0, 'principles-and-practice-of-management-1', 25, 0, 1, 'Pillai R.S.N. (Author), Kala S. (Author)', 'S Chand', 1, 1, 'shipped', 'upload/images/8675-2021-10-06.jpg', '', '<p>Reading books is a kind of enjoyment. Reading books is a good habit. We bring you a different kinds of books. You can carry this book where ever you want. It is easy to carry. It can be an ideal gift to yourself and to your loved ones. Care instruction keep away from fire.</p>\r\n\r\n<p> </p>', 1, '2021-10-06 08:57:17', 1, 7, 'all', ''),
(389, 26, 0, 'Machine Design', 0, 'machine-design-2', 25, 0, 1, 'RS Khurmi', 'S Chand', 1, 1, 'shipped', 'upload/images/1804-2021-10-06.jpg', '', '<p>This book is devided into 32 Chapters</p>', 1, '2021-10-06 09:03:30', 1, 7, 'all', ''),
(390, 26, 0, 'Strength of Material: Mechanics of Soilds', 0, 'strength-of-material-mechanics-of-soilds-2', 25, 0, 1, 'RS Khurmi', 'S Chand', 1, 1, 'shipped', 'upload/images/3452-2021-10-06.jpg', '', '<p>Strength of Materials: Mechanics of Solids in SI Units” is an all-inclusive text for students as it takes a detailed look at all concepts of the subject. Distributed evenly in 38 chapters, important focusses are laid on stresses, strains, inertia, force, beams, joints and shells amongst others.<br />\r\nEach chapter contains numerous solved examples supported by exercises and chapter-end questions which aid to the understanding of the concepts explained. A book which has seen, foreseen and incorporated changes in the subject for close to 50 years, it continues to be one of the most sought after texts by the students for all aspects of the subject.</p>\r\n\r\n<p><strong>Key Features:</strong></p>\r\n\r\n<ul>\r\n	<li>38 chapters provide an in-depth coverage of every important concept in the subject.</li>\r\n	<li>Close to 1250 examples, figures and tables aid to the concepts explained.</li>\r\n	<li>Close to 700 in-text exercise questions and chapter-end questions add to the practice of the students.</li>\r\n</ul>\r\n\r\n<p><strong>Table of Content :</strong></p>\r\n\r\n<ul>\r\n	<li>Introduction</li>\r\n	<li>Simple Stresses and Strains</li>\r\n	<li>Stresses and Strains in Bars of Varying Sections</li>\r\n	<li>Stresses and Strains in Statically Indeterminate Structures</li>\r\n	<li>Thermal Stresses and Strains</li>\r\n	<li>Elastic Constants</li>\r\n	<li>Principal Stresses and Strains</li>\r\n	<li>Strain Energy and Impact Loading</li>\r\n	<li>Centre of Gravity</li>\r\n	<li>Moment of Inertia</li>\r\n	<li>Analysis of Perfect Frames (Analytical Method)</li>\r\n	<li>Analysis of Perfect Frames (Graphical Method)</li>\r\n	<li>Bending Moment and Shear Force</li>\r\n	<li>Bending Stresses in Simple Beams</li>\r\n	<li>Bending Stresses in Composite Beams</li>\r\n	<li>Shearing Stresses In Beams</li>\r\n	<li>Direct and Bending Stresses</li>\r\n	<li>Dams and Retaining Walls</li>\r\n	<li>Deflection of Beams</li>\r\n	<li>Deflection of Cantilevers</li>\r\n	<li>Deflection by Moment Area Method</li>\r\n	<li>Deflection by Conjugate Beam Method</li>\r\n	<li>Propped Cantilevers and Beams</li>\r\n	<li>Fixed Beams</li>\r\n	<li>Theorem of Three Moments</li>\r\n	<li>Moment Distribution Method</li>\r\n	<li>Torsion of Circular Shafts</li>\r\n	<li>Springs</li>\r\n	<li>Riveted Joints</li>\r\n	<li>Welded Joints</li>\r\n	<li>Thin Cylindrical and Spherical Shells</li>\r\n	<li>Thick Cylindrical and Spherical Shells</li>\r\n	<li>Bending of Curved Bars</li>\r\n	<li>Columns and Struts</li>\r\n	<li>Introduction to Reinforced Concrete</li>\r\n	<li>Product of Inertia</li>\r\n	<li>Strain Energy and Deflection Due to Bending & Shear (and Castigliano\'s Theorem)</li>\r\n	<li>Mechanical Properties and Testing of Materials (Stress-Strain Diagram)</li>\r\n</ul>', 1, '2021-10-06 09:06:18', 1, 7, 'all', ''),
(391, 26, 0, 'Power System Analysis And Design', 0, 'power-system-analysis-and-design-2', 25, 0, 1, 'Dr. B.R. GUPTA (Author)', 'S Chand', 1, 1, 'shipped', 'upload/images/8623-2021-10-06.jpg', '', '<p>Reading books is a kind of enjoyment. Reading books is a good habit. We bring you a different kinds of books. You can carry this book where ever you want. It is easy to carry. It can be an ideal gift to yourself and to your loved ones. Care instruction keep away from fire.</p>', 1, '2021-10-06 09:09:46', 1, 7, 'all', ''),
(392, 26, 0, 'A Textbook Of Thermal Engineering: Mechanical Technology', 0, 'a-textbook-of-thermal-engineering-mechanical-technology-2', 25, 0, 1, 'RS Khurmi', 'S Chand', 1, 1, 'shipped', 'upload/images/9430-2021-10-06.jpg', '', '<p>Reading books is a kind of enjoyment. Reading books is a good habit. We bring you a different kinds of books. You can carry this book where ever you want. It is easy to carry. It can be an ideal gift to yourself and to your loved ones. Care instruction keep away from fire.</p>', 1, '2021-10-06 09:12:48', 1, 7, 'all', ''),
(393, 26, 0, 'Computer Networks and Internets', 0, 'computer-networks-and-internets-2', 25, 0, 1, 'Douglas Comer', 'Pearson', 1, 1, 'shipped', 'upload/images/0527-2021-10-06.jpg', '', '<p><em>Appropriate for all introductory-to-intermediate courses in computer networking, the Internet, or Internet applications; students need no background in networking, operating systems, or advanced mathematics.</em></p>\r\n\r\n<p><em> </em></p>\r\n\r\n<p>Leading networking authority Douglas Comer presents a wide-ranging, self-contained tour of the concepts, principles, and technologies that enable today’s Internet to support applications ranging from web browsing to telephony and multimedia. Comer begins by illuminating the applications and facilities offered by today’s Internet. Next, he systematically introduces the underlying network technologies and protocols that make them possible. With these concepts and technologies established, he introduces several of the most important contemporary issues faced by network implementers and managers, including quality of service, Internet telephony, multimedia, network security, and network management. Comer has carefully designed this book to support both top-down and bottom-up teaching approaches. Students need no background in operating systems, and no sophisticated math: Comer relies throughout on figures, drawings, examples, and analogies, not mathematical proofs.</p>', 1, '2021-10-06 09:20:59', 1, 7, 'all', '');
INSERT INTO `products` (`id`, `seller_id`, `row_order`, `name`, `tax_id`, `slug`, `category_id`, `subcategory_id`, `indicator`, `manufacturer`, `made_in`, `return_status`, `cancelable_status`, `till_status`, `image`, `other_images`, `description`, `status`, `date_added`, `is_approved`, `return_days`, `type`, `pincodes`) VALUES
(394, 26, 0, 'Computer Networks', 0, 'computer-networks-3', 25, 0, 1, 'Andrew Tanenbaum', 'Pearson', 1, 1, 'shipped', 'upload/images/4860-2021-10-06.jpg', '', '<p>The book is an introduction to computer networking for those seeking information on various aspects of establishing and maintaining wireless networks. A computer network is a group of computers that share data over a wireless or cable-connected set-up. To establish a computer network one needs to be equipped with the basic guidelines that help to lay down complex networks.</p>\r\n\r\n<p>The book places emphasis on topics of 802.11, 802.16, Bluetooth, paired and fixed coverage of ADSL, 3G cellular, gigabit Ethernet, MLPS and peer-to-peer networks. The latest edition comprehensively discusses fibre to the home, RIFD, delay torrent networking, 802.11 security, internet routing, congestion control, quality of service, real-time transport and content distribution.</p>\r\n\r\n<p>Published by Pearson Education, the 5th Edition includes eight chapters that begin with the petite topics of physical layer, data link layer and medium access control sub-layer. Tanenbaum gradually gets to the more intricate topics of network layer, transport layer and application layer where various concepts have been explained in a plain manner. The book also explains network security to assist in creating a secure networking system between computers.</p>\r\n\r\n<p><strong>About the author:</strong></p>\r\n\r\n<p>Andrew Tanenbaum, born in 1944, is an American computer scientist who is a professor emeritus at Vrije Universiteit at Amsterdam, Netherlands. Known for being the author of MINIX, a unix like free operating system, Tanenbaum is devoted to his teaching profession.</p>', 1, '2021-10-06 09:24:34', 1, 7, 'all', ''),
(395, 26, 0, 'Statistics for Management', 0, 'statistics-for-management-2', 25, 0, 1, 'I. Levin Richard (Author), H. Siddiqui Masood (Author), S. Rubin David (Author), Rastogi Sanjay (Author)', 'Pearson', 1, 1, 'shipped', 'upload/images/3098-2021-10-06.jpg', '', '<p>Statistics for Management, 8e, is a comprehensive textbook designed to help students understand the statistical concepts and applications used in business and management situations. In the manner of the earlier editions, this edition too omits complex notations in favor of graphic and verbal explanations and aims to explain the subject with a practical orientation. Examples from the real world are discussed to explain how the textbook principles work in professional practice. Written in a simple and lucid language, this book is an excellent resource for students pursuing management courses.<br />\r\nSalient Features<br />\r\n• Emphasis on providing easy-to-understand explanation of statistical topic a strong real-world focus<br />\r\n• Offers three types of end-of-chapter exercise – Basic Concepts (exercises without scenarios), Applications (with scenarios) and Self-Check Exercises (with worked-out solutions right in the section)<br />\r\n• Increase in the number of real-world examples in the end-of-chapter sections Review and Application Exercises<br />\r\n• Includes new problems and cases specifically covering the Indian scenario<br />\r\n• Provides a stepwise guide along with relevant snapshots for running various tools on the SPSS software and the MS Excel Package<br />\r\n<br />\r\nContents<br />\r\nChapter 1 Introduction<br />\r\nChapter 2 Grouping and Displaying Data to Convey Meaning:<br />\r\nTables and Graphs<br />\r\nChapter 3 Measures of Central Tendency and Dispersion<br />\r\nin Frequency Distributions<br />\r\nChapter 4 Probability I: Introductory Ideas<br />\r\nChapter 5 Probability Distributions<br />\r\nChapter 6 Sampling and Sampling Distributions<br />\r\nChapter 7 Estimation<br />\r\nChapter 8 Testing Hypotheses: One-sample Tests<br />\r\nChapter 9 Testing Hypotheses: Two-sample Tests<br />\r\nChapter 10 Quality and Quality Control<br />\r\nChapter 11 Chi-Square and Analysis of Variance<br />\r\nChapter 12 Simple Regression and Correlation<br />\r\nChapter 13 Multiple Regression and Modelling<br />\r\nChapter 14 Nonparametric Methods<br />\r\nChapter 15 T time Series and Forecasting<br />\r\nChapter 16 Index Numbers<br />\r\nChapter 17 Decision Theory<br />\r\nAppendix Tables<br />\r\nBibliography<br />\r\nIndex<br />\r\n </p>', 1, '2021-10-06 09:33:18', 1, 7, 'all', ''),
(396, 26, 0, 'Manufacturing Engineering and Technology (SI Edition)', 0, 'manufacturing-engineering-and-technology-si-edition-2', 25, 0, 1, 'Serope Kalpakjian  (Author), Steven R. Schmid (Author)', 'Pearson', 1, 1, 'shipped', 'upload/images/5998-2021-10-06.jpg', '', '<p>Pearson presents Manufacturing Engineering and Technology, 7e an up-to-date text that provides<br />\r\na solid background in manufacturing processes.<br />\r\nThe Seventh Edition has been completely updated and addresses issues essential to modern<br />\r\nmanufacturing, ranging from traditional topics such as casting, forming, machining and joining,<br />\r\nto advanced topics such as the fabrication of microelectronic devices and microelectromechanical<br />\r\nsystems (MEMS) and nanomaterials and nonmanufacturing. With comprehensive coverage of all<br />\r\ntopics and superior graphics, this text provides a solid background for manufacturing students and<br />\r\nserves as a valuable reference text for professionals.<br />\r\nFeatures 1. An excellent overview of manufacturing concepts is provided with a balance of relevant fundamentals and real-world practices.<br />\r\n2. Coverage of the latest technological advances, like rapid prototyping, the most dramatic change in manufacturing in recent years. Also includes coverage of nanofabrication, rapid tooling and semisolid metalworking making this is one of the most up-to-date texts available.<br />\r\n3. A wealth of examples and industrially-relevant case studies demonstrate the importance of the subject matter, offer a real-world perspective and keep students interested and engaged.<br />\r\n4.Superior use of analogies, discussions and problems motivate students’ interest in the material.<br />\r\nTable of Contents Chapter 1 the Structure Of Metals<br />\r\nChapter 2 Mechanical Behaviour, Testing and Manufacturing Properties of Materials<br />\r\nChapter 3 Physical Properties of Materials<br />\r\nChapter 4 Metal Alloys: Their Structure and Strengthening by Heat Treatment<br />\r\nChapter 5 Ferrous Metals and Alloys: Production, General Properties and Applications<br />\r\nChapter 6 Nonferrous Metals and Alloys: Production, General Properties and Applications<br />\r\nChapter 7 Polymers: Structure, General Properties and Applications<br />\r\nChapter 8 Ceramics, Glass, Graphite, Diamond and Nanomaterials: Structure, General Properties and Applications<br />\r\nChapter 9 Composite Materials: Structure, General Properties and Applications<br />\r\nChapter 10 Fundamentals of Metal Casting<br />\r\nChapter 11 Metal-casting Processes and Equipment<br />\r\nChapter 12 Metal Casting: Design, Materials and Economics<br />\r\nChapter 13 Metal-rolling Processes and Equipment<br />\r\nChapter 14 Metal-forging Processes and Equipment<br />\r\nChapter 15 Metal Extrusion and Drawing Processes and Equipment<br />\r\nChapter 16 Sheet-metal Forming Processes and Equipment<br />\r\nChapter 17 Powder Metal Processes and Equipment<br />\r\nChapter 18 Ceramics, Glasses and Superconductors: Processing and Equipment<br />\r\nChapter 19 Plastics and Composite Materials: Forming and Shaping<br />\r\nChapter 20 Rapid-prototyping Processes and Operations<br />\r\nChapter 21 Fundamentals of Machining<br />\r\nChapter 22 Cutting-tool Materials and Cutting Fluids<br />\r\nChapter 23 Machining Processes: Turning and Hole Making<br />\r\nChapter 24 Machining Processes: Milling, Broaching, Sawing, Filing and Gear Manufacturing<br />\r\nChapter 25 Machining Centers, Machine-Tool Structures and Machining Economics<br />\r\nChapter 26 Abrasive Machining and Finishing Operations<br />\r\nChapter 27 Advanced Machining Processes and Equipment<br />\r\nChapter 28 Fabrication of Microelectronic Devices<br />\r\nChapter 29 Fabrication of Microelectromechanical Devices and Systems and Nanoscale Manufacturing<br />\r\nChapter 30 Fusion Welding Processes<br />\r\nChapter 31 Solid-State Welding Processes<br />\r\nChapter 32 Brazing, Soldering, Adhesive-bonding and Mechanical Fastening Processes<br />\r\nChapter 33 Surface Roughness and Measurement Friction, Wear and Lubrication<br />\r\nChapter 34 Surface Treatments, Coatings and Cleaning<br />\r\nChapter 35 Engineering Metrology and Instrumentation<br />\r\nChapter 36 Quality Assurance, Testing and Inspection<br />\r\nChapter 37 Automation of Manufacturing Processes and Operations<br />\r\nChapter 38 Computer-aided Manufacturing<br />\r\nChapter 39 Computer-integrated Manufacturing Systems<br />\r\nChapter 40 Product Design and Manufacturing in a Competitive Environment.</p>', 1, '2021-10-06 09:39:25', 1, 7, 'all', ''),
(397, 26, 0, 'Data and Computer Communication', 0, 'data-and-computer-communication-2', 25, 0, 1, 'Stallings William (Author)', 'Pearson', 1, 1, 'shipped', 'upload/images/6934-2021-10-06.jpg', '', '<p>With a focus on the most current technology and a convenient modular format, this best-selling text from Pearson offers a clear and comprehensive survey of the entire data and computer communications field. Emphasizing both the fundamental principles as well as the critical role of performance in driving protocol and network design, it explores all the critical technical areas in data communications, wide-area networking, local area networking and protocol design in detail.<br />\r\n<br />\r\nFeatures<br />\r\n1. A modular format—This structure breaks this massive subject into comprehensible parts, thus making learning easier for students.<br />\r\n2. Unifying principles—The text repeatedly emphasizes such principles as multiplexing, flow control and error control and contrasts their application in specific areas of technology. This enables students to understand how the same protocol design principles are applied at different levels of the protocol architecture.<br />\r\n3. Standards—A comprehensive discussion of the current status and future direction of related technology standards helps students understand the central role of standards in network and protocol design.<br />\r\n4. More than 250 homework problems—Problems ranging in difficulty give students the opportunity to test their comprehension of concepts.<br />\r\n5. Strong pedagogical support—The liberal use of figures and tables; glossary; recommended reading list and Websites; and a bibliography provide students with convenient study tools.<br />\r\nTable of Contents:<br />\r\nChapter 1 Data Communications, Data Networks and the Internet<br />\r\nChapter 2 Protocol Architecture, TCP/IP and Internet-Based Applications<br />\r\nChapter 3 Data Transmission<br />\r\nChapter 4 Transmission Media<br />\r\nChapter 5 Signal Encoding Techniques<br />\r\nChapter 6 Error Detection and Correction<br />\r\nChapter 7 Data Link Control Protocols<br />\r\nChapter 8 Multiplexing<br />\r\nChapter 9 WAN Technology and Protocols<br />\r\nChapter 10 Cellular Wireless Networks<br />\r\nChapter 11 Local Area Network Overview<br />\r\nChapter 12 Ethernet<br />\r\nChapter 13 Wireless LANs<br />\r\nChapter 14 The Internet Protocol<br />\r\nChapter 15 Transport Protocols<br />\r\nChapter 16 Advanced Data Communications Topics<br />\r\nChapter 17 Wireless Transmission Techniques<br />\r\nChapter 18 Wireless Networks<br />\r\nChapter 19 Routing<br />\r\nChapter 20 Congestion Control<br />\r\nChapter 21 Internetwork Operation<br />\r\nChapter 22 Internetwork Quality of Service<br />\r\nChapter 23 Multiprotocol Label Switching<br />\r\nChapter 24 Electronic Mail, DNS and HTTP<br />\r\nChapter 25 Internet Multimedia Support<br />\r\nChapter 26 Computer and Network Security Threats (online)<br />\r\nChapter 27 Computer and Network Security Techniques (online)</p>', 1, '2021-10-06 09:47:54', 1, 7, 'all', ''),
(398, 26, 0, 'Fundamentals of Database Systems', 0, 'fundamentals-of-database-systems-1', 21, 0, 1, 'Ramez Elmasri  (Author), Shamkant B. Navathe (Author), Elmasri (Author)', 'Pearson', 1, 1, 'shipped', 'upload/images/5229-2021-10-06.jpg', '', '<p>The book Fundamentals of Database Systems covers detailed and clear explanations of databases in form of practical, design and theoretical knowledge. Broad and in depth coverage of real systems and models and the up-to-date introduction to the modern database technologies helps to rapidly clarify the essential components of database systems. This textbook is intended for computer science majors and the study matter lays special emphasis on designs issues, relational calculus, mathematical models and relational algebra.</p>\r\n\r\n<p>With the help of the latest manual and new sets of problems, students are provided with more opportunities for practicing the fundamentals of implementation and designing. Excess of real world solved questions in Fundamentals of Database Systems serve to engage in database concepts and their practical illustrations. The book covers the most known and up to date version of database topics including, data mining, security, SQL, etc. and throws special light on semi-structured data and XML.</p>\r\n\r\n<p>The newest edition comes with the rearranging of chapter series so that the instructors can start with laboratory exercises and projects at the earliest. Additionally, a new chapter on information retrieval techniques is provided in the book.</p>\r\n\r\n<p>Fundamentals of Database Systems was published in July 2013 by Pearson UK and is made available in paperback.</p>\r\n\r\n<p>Key Features</p>\r\n\r\n<ul>\r\n	<li>Fundamental topics like relational algebra/calculus, modeling, diagrams and normalization are also covered.</li>\r\n	<li>The book also makes for great self study material with the help of its various guidelines for systematic reading.</li>\r\n	<li> Design and tuning of Physical Database.</li>\r\n	<li>The Data modeling material covers both UML and traditional ER model.</li>\r\n</ul>', 1, '2021-10-06 09:51:13', 1, 7, 'all', ''),
(399, 26, 0, 'Computer Networking – A top down approach featuring the Internet', 0, 'computer-networking-a-top-down-approach-featuring-the-internet-1', 21, 0, 1, 'Kurose James F. (Author), Ross Keith W. (Author)', 'Pearson', 1, 1, 'shipped', 'upload/images/1454-2021-10-06.jpg', '', '<p>Building on the successful top-down approach of previous editions, the Sixth Edition of Computer Networking continues with an early emphasis on application-layer paradigms and application programming interfaces (the top layer), encouraging a hands-on experience with protocols and networking concepts, before working down the protocol stack to more abstract layers.<br />\r\n<br />\r\n<br />\r\nThis book has become the dominant book for this course because of the authors’ reputations, the precision of explanation, the quality of the art program and the value of their own supplements.<br />\r\nFeatures A balanced presentation focuses on the Internet as a specific motivating example of a network and also introduces students to protocols in a more theoretical context.<br />\r\nA chapter on wireless and mobility includes insight into 802.11 and coverage of ad hoc networking.<br />\r\nPrinciples and Practice boxes throughout demonstrate real-world applications of the principles studied.<br />\r\nCase History boxes are sprinkled in to help tell the story of the history and development of computer networking.<br />\r\nMaterial on application programming development is included, along with numerous programming assignments.<br />\r\nA highly developed art program enhances the descriptions of concepts.<br />\r\nA comprehensive Companion Website, which includes additional learning material, links to relevant online resources and lab material<br />\r\nTable of Contents Chapter 1 Computer Networks and the Internet<br />\r\nChapter 2 Application Layer<br />\r\nChapter 3 Transport Layer<br />\r\nChapter 4 The Network Layer<br />\r\nChapter 5 The Link Layer: Links, Access Networks and LANs<br />\r\nChapter 6 Wireless and Mobile Networks<br />\r\nChapter 7 Multimedia Networking Applications<br />\r\nChapter 8 Security in Computer Networks<br />\r\nChapter 9 Network Management</p>', 1, '2021-10-06 09:56:26', 1, 7, 'all', ''),
(400, 26, 0, 'Power System Analysis: Operation and Control', 0, 'power-system-analysis-operation-and-control-2', 25, 0, 1, 'Abhijit Chakrabarti (Author), Sunita Halder (Author)', 'PHI Publication', 1, 1, 'shipped', 'upload/images/5173-2021-10-06.jpg', '', '<p>With an emphasis on both basics and advanced topics and practical aspects, the topics are substantiated by a number of illustrations and computer programs that reinforce the analytical methods of approaches to operation and control problems of power system engineering. Besides fundamentals of power systems, the readers can learn about power flow, economic considerations, computer-aided economic load despatch, power system stability, fault analysis, high voltage transmission systems, transient analysis, and much more from this systematic treatment of an exhaustive treatise on power system engineering. The book is designed to cover courses in Power Systems conducted during third and fourth years of study by senior undergraduate students and to cover courses prescribed for postgraduate students as well.</p>', 1, '2021-10-06 10:04:19', 1, 7, 'all', ''),
(401, 27, 0, 'success Master', 0, 'success-master-1', 2, 8, 1, 'Arihant', 'Arihant', 1, 1, 'shipped', 'upload/images/8094-2021-10-06.jpeg', '[\"upload/other_images/1633514824.2307-136.jpg\"]', 'Description\n\"1.Success Master Study Guides focus in the preparation of CTET teaching Exam 2.This book deals with CTET Mathematics and Science Paper ? 2 (Classes 6-8) 3.Divided into 5 main Sections completely prep ...\nSEE MORE', 1, '2021-10-06 10:07:04', 1, 7, 'included', '600028'),
(402, 26, 0, 'Fundamentals of Digital Circuits', 0, 'fundamentals-of-digital-circuits-1', 25, 0, 1, 'Kumar A. Anand (Author)', 'PHI Publication', 1, 1, 'shipped', 'upload/images/3786-2021-10-06.jpg', '', '<p>The Fourth edition of this well-received text continues to provide coherent and comprehensive coverage of digital circuits. It is designed for the undergraduate students pursuing courses in areas of engineering disciplines such as Electrical and Electronics, Electronics and Communication, Electronics and Instrumentation, Telecommunications, Medical Electronics, Computer Science and Engineering, Electronics and Computers and Information Technology. It is also useful as a text for MCA, M.Sc. (Electronics) and M.Sc. (Computer Science) students. Appropriate for self study, the book is useful even for AMIE and grad IETE students.</p>\r\n\r\n<p>Written in a student-friendly style, the book provides an excellent introduction to digital concepts and basic design techniques of digital circuits. It discusses Boolean algebra concepts and their application to digital circuitry and elaborates on both combinational and sequential circuits. It provides numerous fully worked-out, laboratory tested examples to give students a solid grounding in the related design concepts. It includes a number of short questions with answers, review questions, fill in the blanks with answers, multiple choice questions with answers and exercise problems at the end of each chapter.</p>\r\n\r\n<p>As the book requires only an elementary knowledge of electronics to understand most of the topics, it can also serve as a textbook for the students of polytechnics, B.Sc. (Electronics) and B.Sc. (Computer Science).</p>\r\n\r\n<p><br />\r\n<strong>New to this edition</strong><br />\r\nNow, based on the readers’ demand, this new edition incorporates VERILOG programs in addition to VHDL programs at the end of each chapter.</p>', 1, '2021-10-06 10:14:40', 1, 7, 'all', ''),
(403, 27, 0, 'success Master planner', 0, 'success-master-planner', 2, 8, 1, 'Ravi Kant Agarwal/Deepak Pandey/om prakash', 'Mc grow hill', 1, 1, 'shipped', 'upload/images/8805-2021-10-06.jpeg', '[\"upload/other_images/1633515395.3848-648.jpg\"]', 'Description\nMathematics and Pedagogy has been designed based on the latest syllabus of CTET/ TET. Class 6 ? 8 NCERT/SCERT books named magic of Mathematics were intensively referred while writing this book. Also, ...\nSEE MORE', 1, '2021-10-06 10:16:35', 1, 7, 'included', '600028'),
(404, 26, 0, 'Circuit Theory Analysis And Synthesis', 0, 'circuit-theory-analysis-and-synthesis-2', 25, 0, 1, 'Abhijit Chakrabarti', 'Dhanpat Rai publication', 1, 1, 'shipped', 'upload/images/2150-2021-10-06.jpg', '', '<p>Reading books is a kind of enjoyment. Reading books is a good habit. We bring you a different kinds of books. You can carry this book where ever you want. It is easy to carry. It can be an ideal gift to yourself and to your loved ones. Care instruction keep away from fire.</p>', 1, '2021-10-06 10:17:41', 1, 7, 'all', ''),
(405, 26, 0, 'Electrical Machines, Drives and Power Systems', 0, 'electrical-machines-drives-and-power-systems-1', 21, 0, 1, 'Theodore Wildi', 'Pearson', 1, 1, 'shipped', 'upload/images/6163-2021-10-06.jpg', '', '<p>This best-selling text employs a theoretical, practical, multidisciplinary approach to provide introductory students with a broad understanding of modern electric power. The scope of the book reflects the rapid changes that have occurred in power technology over the past few years-allowing the entrance of power electronics into every facet of industrial drives and expanding the field to open more career opportunities.</p>', 1, '2021-10-06 10:21:33', 1, 7, 'all', ''),
(406, 26, 0, 'Introductory Methods of Numerical Analysis', 0, 'introductory-methods-of-numerical-analysis-2', 25, 0, 1, 'Sastry S.S', 'PHI Publication', 1, 1, 'shipped', 'upload/images/2739-2021-10-06.jpg', '', '<p>This thoroughly revised and updated text, now in its fifth edition, continues to provide a rigorous introduction to the fundamentals of numerical methods required in scientific and technological applications, emphasizing on teaching students numerical methods and in helping them to develop problem solving skills. While the essential features of the previous editions such as References to MATLAB, IMSL, Numerical Recipes and program libraries for implementing the numerical methods are retained, a chapter on spline functions has been added in this edition because of their increasing importance in applications. This text is designed for undergraduate students of all branches of engineering. Includes additional modified illustrative examples and problems in every chapter. Provides answers to all chapter-end exercises. Illustrates algorithms, computational steps or flow charts for many numerical methods. Contains four model question papers at the end of the text.</p>', 1, '2021-10-06 10:24:56', 1, 7, 'all', ''),
