(410, 26, 0, 'Programming with Java', 0, 'programming-with-java-2', 25, 0, 1, 'E Balagurusamy', 'mc grawhill', 1, 1, 'shipped', 'upload/images/0956-2021-10-06.jpg', '', '<p>The sixth edition of this most trusted book on JAVA for beginners is here with some essential updates. Retaining its quintessential style of concept explanation with exhaustive programs, solved examples, and illustrations, this test takes the journey of understanding JAVA to slightly higher level. The book introduces readers to some of the Core JAVA topics like JDBC, Java Servlets, Java Beans, Lambada Expression and much more. Practical real-life projects will give a better understanding of JAVA usage and make students industry-ready.</p>\r\n\r\n<p>Salient Features:</p>\r\n\r\n<p>✔New chapters on JDBC, Java Servlets and Graphic Programming using AWT and SWING</p>\r\n\r\n<p>✔New Appendix on—Iterators, Java Beans, Lambada Expression, Generic Programming</p>\r\n\r\n<p>✔Two new full- fledged projects: 1. LIVE CRICKET SCORE APP—Major project and 2. SIMPLE WEB CRAWLER -Minor project</p>\r\n\r\n<p>✔Refreshed Pedagogy</p>', 1, '2021-10-06 10:34:36', 1, 7, 'all', ''),
