(463, 26, 0, 'Samajshastra (Sociology) Class 11 ( Part A: Introducing Sociology, Part B: Understanding)', 0, 'samajshastra-sociology-class-11-part-a-introducing-sociology-part-b-understanding-1', 21, 0, 1, 'SBPD Publications', 'made in india', 1, 1, 'shipped', 'upload/images/8437-2021-10-01.jpeg', '', '<p>Strictly according to the latest syllabus prescribed by Central Board of Secondary Education (CBSE), Delhi and State Boards of Bihar, Jharkhand, Uttarakhand, Rajasthan, Haryana, H.P. etc. & Navodaya, Kasturba, Kendriya Vidyalayas etc. following CBSE curriculum based on NCERT guidelines. Part \'A\'-Introducing Sociology 1.Introducing Society : Individual, Collectivities and Plural Perspective, 2 .Emergence and Development of Sociology, 3 .Nature and Scope of Sociology, 4. Relationship of Sociology with other Social Sciences, 5 .Social Groups, 6 .Status and Role, 7..Social Stratification, 8. Social Control, 9. Family and Kinship, 10. Economic Institutions, 11. Political Institutions, 12 .Religion : As a Social Institution, 13. Education : As an Institution, 14. Culture, Values and Norms : Shared, Plural and Contested, 15 .Socialization : Conformity, Conflict and the Shaping of Personality, 16. Tools and Techniques of Field-work : Survey, Observation and Interview, 17. Significance of Field-work in Sociology, Part \'B\'-Understanding Sociology 1.Social Structure, 2. Social Processes : Co-operation, Competition and Conflict, 3 .Social Stratification : Class, Caste, Race and Gender, 4. Social Change : Types , Dimension, Causes and Consequences, 5. Social Order : Domination, Authority and Law, 6. Contestation, Crime and Violence, 7. Village, Town and City : Changes in Rural and Urban Society, 8. Ecology and Society, 9. Environmental Crisis and Social Responses, 10. Class Conflict on Karl Marx, 11. Emile Durkheim on Division of Labour, 12. Max Weber on Bureaucracy, 13. G. S. Ghurye : Caste and Race, 14. D. P. Mukerji : Tradition and Change, 15. A. R. Desai : Views on State, 16. M.N. Srinivas on the Village.</p>', 1, '2021-10-12 06:50:24', 1, 7, 'all', ''),
(456, 26, 0, 'Electrical Machines, Drives and Power Systems', 0, 'electrical-machines-drives-and-power-systems-3', 25, 0, 1, 'Theodore Wildi', 'Pearson', 1, 1, 'shipped', 'upload/images/6163-2021-10-06.jpg', '', '<p>This best-selling text employs a theoretical, practical, multidisciplinary approach to provide introductory students with a broad understanding of modern electric power. The scope of the book reflects the rapid changes that have occurred in power technology over the past few years-allowing the entrance of power electronics into every facet of industrial drives and expanding the field to open more career opportunities.</p>', 1, '2021-10-11 16:57:12', 1, 7, 'all', ''),
(457, 26, 0, 'Power Electronics', 0, 'power-electronics-2', 21, 0, 1, 'Muhammad H. Rashid', 'Pearson', 1, 1, 'shipped', 'upload/images/8001-2021-10-06.jpg', '', '<p>This book on Power Electronics is one of the most reputed and revered texts for more than three decades. Exemplary writing style, precise descriptions and supreme attention to detail in the quality of the schematics makes this text one of<br />\r\nthe most sought after and inspiring books on Power Electronics. This new edition beautifully upgrades the earlier work, with substantial updates to detail, without compromising on the style,<br />\r\ncontent or technical quality.</p>', 1, '2021-10-11 16:57:58', 1, 7, 'all', ''),
(458, 26, 0, 'Power Electronics', 0, 'power-electronics-3', 21, 0, 1, 'Muhammad H. Rashid', 'Pearson', 1, 1, 'shipped', 'upload/images/8001-2021-10-06.jpg', '', '<p>This book on Power Electronics is one of the most reputed and revered texts for more than three decades. Exemplary writing style, precise descriptions and supreme attention to detail in the quality of the schematics makes this text one of<br />\r\nthe most sought after and inspiring books on Power Electronics. This new edition beautifully upgrades the earlier work, with substantial updates to detail, without compromising on the style,<br />\r\ncontent or technical quality.</p>', 1, '2021-10-11 17:03:00', 1, 7, 'all', ''),
(459, 26, 0, 'Programming with Java', 0, 'programming-with-java-1', 21, 0, 1, 'E Balagurusamy', 'mc grawhill', 1, 1, 'shipped', 'upload/images/0956-2021-10-06.jpg', '', '<p>The sixth edition of this most trusted book on JAVA for beginners is here with some essential updates. Retaining its quintessential style of concept explanation with exhaustive programs, solved examples, and illustrations, this test takes the journey of understanding JAVA to slightly higher level. The book introduces readers to some of the Core JAVA topics like JDBC, Java Servlets, Java Beans, Lambada Expression and much more. Practical real-life projects will give a better understanding of JAVA usage and make students industry-ready.</p>\r\n\r\n<p>Salient Features:</p>\r\n\r\n<p>✔New chapters on JDBC, Java Servlets and Graphic Programming using AWT and SWING</p>\r\n\r\n<p>✔New Appendix on—Iterators, Java Beans, Lambada Expression, Generic Programming</p>\r\n\r\n<p>✔Two new full- fledged projects: 1. LIVE CRICKET SCORE APP—Major project and 2. SIMPLE WEB CRAWLER -Minor project</p>\r\n\r\n<p>✔Refreshed Pedagogy</p>', 1, '2021-10-11 17:03:23', 1, 7, 'all', ''),
(460, 26, 0, 'Programming with Java', 0, 'programming-with-java-2', 21, 0, 1, 'E Balagurusamy', 'mc grawhill', 1, 1, 'shipped', 'upload/images/0956-2021-10-06.jpg', '', '<p>The sixth edition of this most trusted book on JAVA for beginners is here with some essential updates. Retaining its quintessential style of concept explanation with exhaustive programs, solved examples, and illustrations, this test takes the journey of understanding JAVA to slightly higher level. The book introduces readers to some of the Core JAVA topics like JDBC, Java Servlets, Java Beans, Lambada Expression and much more. Practical real-life projects will give a better understanding of JAVA usage and make students industry-ready.</p>\r\n\r\n<p>Salient Features:</p>\r\n\r\n<p>✔New chapters on JDBC, Java Servlets and Graphic Programming using AWT and SWING</p>\r\n\r\n<p>✔New Appendix on—Iterators, Java Beans, Lambada Expression, Generic Programming</p>\r\n\r\n<p>✔Two new full- fledged projects: 1. LIVE CRICKET SCORE APP—Major project and 2. SIMPLE WEB CRAWLER -Minor project</p>\r\n\r\n<p>✔Refreshed Pedagogy</p>', 1, '2021-10-11 17:03:39', 1, 7, 'all', ''),
(461, 26, 0, 'Introductory Methods of Numerical Analysis', 0, 'introductory-methods-of-numerical-analysis-1', 21, 0, 1, 'Sastry S.S', 'PHI Publication', 1, 1, 'shipped', 'upload/images/2739-2021-10-06.jpg', '', '<p>This thoroughly revised and updated text, now in its fifth edition, continues to provide a rigorous introduction to the fundamentals of numerical methods required in scientific and technological applications, emphasizing on teaching students numerical methods and in helping them to develop problem solving skills. While the essential features of the previous editions such as References to MATLAB, IMSL, Numerical Recipes and program libraries for implementing the numerical methods are retained, a chapter on spline functions has been added in this edition because of their increasing importance in applications. This text is designed for undergraduate students of all branches of engineering. Includes additional modified illustrative examples and problems in every chapter. Provides answers to all chapter-end exercises. Illustrates algorithms, computational steps or flow charts for many numerical methods. Contains four model question papers at the end of the text.</p>', 1, '2021-10-12 06:33:19', 1, 7, 'all', ''),
(464, 26, 0, 'Circuit Theory Analysis And Synthesis', 0, 'circuit-theory-analysis-and-synthesis-1', 21, 0, 1, 'Abhijit Chakrabarti', 'Dhanpat Rai publication', 1, 1, 'shipped', 'upload/images/2150-2021-10-06.jpg', '', '<p>Reading books is a kind of enjoyment. Reading books is a good habit. We bring you a different kinds of books. You can carry this book where ever you want. It is easy to carry. It can be an ideal gift to yourself and to your loved ones. Care instruction keep away from fire.</p>', 1, '2021-10-12 07:05:45', 1, 7, 'all', ''),
(465, 26, 0, 'Power System Analysis: Operation and Control', 0, 'power-system-analysis-operation-and-control-1', 21, 0, 1, 'Abhijit Chakrabarti (Author), Sunita Halder (Author)', 'PHI Publication', 1, 1, 'shipped', 'upload/images/5173-2021-10-06.jpg', '', '<p>With an emphasis on both basics and advanced topics and practical aspects, the topics are substantiated by a number of illustrations and computer programs that reinforce the analytical methods of approaches to operation and control problems of power system engineering. Besides fundamentals of power systems, the readers can learn about power flow, economic considerations, computer-aided economic load despatch, power system stability, fault analysis, high voltage transmission systems, transient analysis, and much more from this systematic treatment of an exhaustive treatise on power system engineering. The book is designed to cover courses in Power Systems conducted during third and fourth years of study by senior undergraduate students and to cover courses prescribed for postgraduate students as well.</p>', 1, '2021-10-12 07:07:51', 1, 7, 'all', ''),
(466, 26, 0, 'Computer Networking – A top down approach featuring the Internet', 0, 'computer-networking-a-top-down-approach-featuring-the-internet-1', 21, 0, 1, 'Kurose James F. (Author), Ross Keith W. (Author)', 'Pearson', 1, 1, 'shipped', 'upload/images/1454-2021-10-06.jpg', '', '<p>Building on the successful top-down approach of previous editions, the Sixth Edition of Computer Networking continues with an early emphasis on application-layer paradigms and application programming interfaces (the top layer), encouraging a hands-on experience with protocols and networking concepts, before working down the protocol stack to more abstract layers.<br />\r\n<br />\r\n<br />\r\nThis book has become the dominant book for this course because of the authors’ reputations, the precision of explanation, the quality of the art program and the value of their own supplements.<br />\r\nFeatures A balanced presentation focuses on the Internet as a specific motivating example of a network and also introduces students to protocols in a more theoretical context.<br />\r\nA chapter on wireless and mobility includes insight into 802.11 and coverage of ad hoc networking.<br />\r\nPrinciples and Practice boxes throughout demonstrate real-world applications of the principles studied.<br />\r\nCase History boxes are sprinkled in to help tell the story of the history and development of computer networking.<br />\r\nMaterial on application programming development is included, along with numerous programming assignments.<br />\r\nA highly developed art program enhances the descriptions of concepts.<br />\r\nA comprehensive Companion Website, which includes additional learning material, links to relevant online resources and lab material<br />\r\nTable of Contents Chapter 1 Computer Networks and the Internet<br />\r\nChapter 2 Application Layer<br />\r\nChapter 3 Transport Layer<br />\r\nChapter 4 The Network Layer<br />\r\nChapter 5 The Link Layer: Links, Access Networks and LANs<br />\r\nChapter 6 Wireless and Mobile Networks<br />\r\nChapter 7 Multimedia Networking Applications<br />\r\nChapter 8 Security in Computer Networks<br />\r\nChapter 9 Network Management</p>', 1, '2021-10-12 07:16:19', 1, 7, 'all', ''),
(467, 26, 0, 'Computer Networking – A top down approach featuring the Internet', 0, 'computer-networking-a-top-down-approach-featuring-the-internet-2', 25, 0, 1, 'Kurose James F. (Author), Ross Keith W. (Author)', 'Pearson', 1, 1, 'shipped', 'upload/images/1454-2021-10-06.jpg', '', '<p>Building on the successful top-down approach of previous editions, the Sixth Edition of Computer Networking continues with an early emphasis on application-layer paradigms and application programming interfaces (the top layer), encouraging a hands-on experience with protocols and networking concepts, before working down the protocol stack to more abstract layers.<br />\r\n<br />\r\n<br />\r\nThis book has become the dominant book for this course because of the authors’ reputations, the precision of explanation, the quality of the art program and the value of their own supplements.<br />\r\nFeatures A balanced presentation focuses on the Internet as a specific motivating example of a network and also introduces students to protocols in a more theoretical context.<br />\r\nA chapter on wireless and mobility includes insight into 802.11 and coverage of ad hoc networking.<br />\r\nPrinciples and Practice boxes throughout demonstrate real-world applications of the principles studied.<br />\r\nCase History boxes are sprinkled in to help tell the story of the history and development of computer networking.<br />\r\nMaterial on application programming development is included, along with numerous programming assignments.<br />\r\nA highly developed art program enhances the descriptions of concepts.<br />\r\nA comprehensive Companion Website, which includes additional learning material, links to relevant online resources and lab material<br />\r\nTable of Contents Chapter 1 Computer Networks and the Internet<br />\r\nChapter 2 Application Layer<br />\r\nChapter 3 Transport Layer<br />\r\nChapter 4 The Network Layer<br />\r\nChapter 5 The Link Layer: Links, Access Networks and LANs<br />\r\nChapter 6 Wireless and Mobile Networks<br />\r\nChapter 7 Multimedia Networking Applications<br />\r\nChapter 8 Security in Computer Networks<br />\r\nChapter 9 Network Management</p>', 1, '2021-10-12 07:16:26', 1, 7, 'all', ''),
(468, 26, 0, 'Data and Computer Communication', 0, 'data-and-computer-communication-1', 21, 0, 1, 'Stallings William (Author)', 'Pearson', 1, 1, 'shipped', 'upload/images/6934-2021-10-06.jpg', '', '<p>With a focus on the most current technology and a convenient modular format, this best-selling text from Pearson offers a clear and comprehensive survey of the entire data and computer communications field. Emphasizing both the fundamental principles as well as the critical role of performance in driving protocol and network design, it explores all the critical technical areas in data communications, wide-area networking, local area networking and protocol design in detail.<br />\r\n<br />\r\nFeatures<br />\r\n1. A modular format—This structure breaks this massive subject into comprehensible parts, thus making learning easier for students.<br />\r\n2. Unifying principles—The text repeatedly emphasizes such principles as multiplexing, flow control and error control and contrasts their application in specific areas of technology. This enables students to understand how the same protocol design principles are applied at different levels of the protocol architecture.<br />\r\n3. Standards—A comprehensive discussion of the current status and future direction of related technology standards helps students understand the central role of standards in network and protocol design.<br />\r\n4. More than 250 homework problems—Problems ranging in difficulty give students the opportunity to test their comprehension of concepts.<br />\r\n5. Strong pedagogical support—The liberal use of figures and tables; glossary; recommended reading list and Websites; and a bibliography provide students with convenient study tools.<br />\r\nTable of Contents:<br />\r\nChapter 1 Data Communications, Data Networks and the Internet<br />\r\nChapter 2 Protocol Architecture, TCP/IP and Internet-Based Applications<br />\r\nChapter 3 Data Transmission<br />\r\nChapter 4 Transmission Media<br />\r\nChapter 5 Signal Encoding Techniques<br />\r\nChapter 6 Error Detection and Correction<br />\r\nChapter 7 Data Link Control Protocols<br />\r\nChapter 8 Multiplexing<br />\r\nChapter 9 WAN Technology and Protocols<br />\r\nChapter 10 Cellular Wireless Networks<br />\r\nChapter 11 Local Area Network Overview<br />\r\nChapter 12 Ethernet<br />\r\nChapter 13 Wireless LANs<br />\r\nChapter 14 The Internet Protocol<br />\r\nChapter 15 Transport Protocols<br />\r\nChapter 16 Advanced Data Communications Topics<br />\r\nChapter 17 Wireless Transmission Techniques<br />\r\nChapter 18 Wireless Networks<br />\r\nChapter 19 Routing<br />\r\nChapter 20 Congestion Control<br />\r\nChapter 21 Internetwork Operation<br />\r\nChapter 22 Internetwork Quality of Service<br />\r\nChapter 23 Multiprotocol Label Switching<br />\r\nChapter 24 Electronic Mail, DNS and HTTP<br />\r\nChapter 25 Internet Multimedia Support<br />\r\nChapter 26 Computer and Network Security Threats (online)<br />\r\nChapter 27 Computer and Network Security Techniques (online)</p>', 1, '2021-10-12 07:16:47', 1, 7, 'all', ''),
(469, 26, 0, 'Manufacturing Engineering and Technology (SI Edition)', 0, 'manufacturing-engineering-and-technology-si-edition-1', 21, 0, 1, 'Serope Kalpakjian  (Author), Steven R. Schmid (Author)', 'Pearson', 1, 1, 'shipped', 'upload/images/5998-2021-10-06.jpg', '', '<p>Pearson presents Manufacturing Engineering and Technology, 7e an up-to-date text that provides<br />\r\na solid background in manufacturing processes.<br />\r\nThe Seventh Edition has been completely updated and addresses issues essential to modern<br />\r\nmanufacturing, ranging from traditional topics such as casting, forming, machining and joining,<br />\r\nto advanced topics such as the fabrication of microelectronic devices and microelectromechanical<br />\r\nsystems (MEMS) and nanomaterials and nonmanufacturing. With comprehensive coverage of all<br />\r\ntopics and superior graphics, this text provides a solid background for manufacturing students and<br />\r\nserves as a valuable reference text for professionals.<br />\r\nFeatures 1. An excellent overview of manufacturing concepts is provided with a balance of relevant fundamentals and real-world practices.<br />\r\n2. Coverage of the latest technological advances, like rapid prototyping, the most dramatic change in manufacturing in recent years. Also includes coverage of nanofabrication, rapid tooling and semisolid metalworking making this is one of the most up-to-date texts available.<br />\r\n3. A wealth of examples and industrially-relevant case studies demonstrate the importance of the subject matter, offer a real-world perspective and keep students interested and engaged.<br />\r\n4.Superior use of analogies, discussions and problems motivate students’ interest in the material.<br />\r\nTable of Contents Chapter 1 the Structure Of Metals<br />\r\nChapter 2 Mechanical Behaviour, Testing and Manufacturing Properties of Materials<br />\r\nChapter 3 Physical Properties of Materials<br />\r\nChapter 4 Metal Alloys: Their Structure and Streng