bonding and Mechanical Fastening Processes<br />\r\nChapter 33 Surface Roughness and Measurement Friction, Wear and Lubrication<br />\r\nChapter 34 Surface Treatments, Coatings and Cleaning<br />\r\nChapter 35 Engineering Metrology and Instrumentation<br />\r\nChapter 36 Quality Assurance, Testing and Inspection<br />\r\nChapter 37 Automation of Manufacturing Processes and Operations<br />\r\nChapter 38 Computer-aided Manufacturing<br />\r\nChapter 39 Computer-integrated Manufacturing Systems<br />\r\nChapter 40 Product Design and Manufacturing in a Competitive Environment.</p>', 1, '2021-10-12 07:17:58', 1, 7, 'all', ''),
(471, 26, 0, 'Statistics for Management', 0, 'statistics-for-management-1', 21, 0, 1, 'I. Levin Richard (Author), H. Siddiqui Masood (Author), S. Rubin David (Author), Rastogi Sanjay (Author)', 'Pearson', 1, 1, 'shipped', 'upload/images/3098-2021-10-06.jpg', '', '<p>Statistics for Management, 8e, is a comprehensive textbook designed to help students understand the statistical concepts and applications used in business and management situations. In the manner of the earlier editions, this edition too omits complex notations in favor of graphic and verbal explanations and aims to explain the subject with a practical orientation. Examples from the real world are discussed to explain how the textbook principles work in professional practice. Written in a simple and lucid language, this book is an excellent resource for students pursuing management courses.<br />\r\nSalient Features<br />\r\n• Emphasis on providing easy-to-understand explanation of statistical topic a strong real-world focus<br />\r\n• Offers three types of end-of-chapter exercise – Basic Concepts (exercises without scenarios), Applications (with scenarios) and Self-Check Exercises (with worked-out solutions right in the section)<br />\r\n• Increase in the number of real-world examples in the end-of-chapter sections Review and Application Exercises<br />\r\n• Includes new problems and cases specifically covering the Indian scenario<br />\r\n• Provides a stepwise guide along with relevant snapshots for running various tools on the SPSS software and the MS Excel Package<br />\r\n<br />\r\nContents<br />\r\nChapter 1 Introduction<br />\r\nChapter 2 Grouping and Displaying Data to Convey Meaning:<br />\r\nTables and Graphs<br />\r\nChapter 3 Measures of Central Tendency and Dispersion<br />\r\nin Frequency Distributions<br />\r\nChapter 4 Probability I: Introductory Ideas<br />\r\nChapter 5 Probability Distributions<br />\r\nChapter 6 Sampling and Sampling Distributions<br />\r\nChapter 7 Estimation<br />\r\nChapter 8 Testing Hypotheses: One-sample Tests<br />\r\nChapter 9 Testing Hypotheses: Two-sample Tests<br />\r\nChapter 10 Quality and Quality Control<br />\r\nChapter 11 Chi-Square and Analysis of Variance<br />\r\nChapter 12 Simple Regression and Correlation<br />\r\nChapter 13 Multiple Regression and Modelling<br />\r\nChapter 14 Nonparametric Methods<br />\r\nChapter 15 T time Series and Forecasting<br />\r\nChapter 16 Index Numbers<br />\r\nChapter 17 Decision Theory<br />\r\nAppendix Tables<br />\r\nBibliography<br />\r\nIndex<br />\r\n </p>', 1, '2021-10-12 07:18:34', 1, 7, 'all', ''),
(472, 26, 0, 'Computer Networks', 0, 'computer-networks-2', 21, 0, 1, 'Andrew Tanenbaum', 'Pearson', 1, 1, 'shipped', 'upload/images/4860-2021-10-06.jpg', '', '<p>The book is an introduction to computer networking for those seeking information on various aspects of establishing and maintaining wireless networks. A computer network is a group of computers that share data over a wireless or cable-connected set-up. To establish a computer network one needs to be equipped with the basic guidelines that help to lay down complex networks.</p>\r\n\r\n<p>The book places emphasis on topics of 802.11, 802.16, Bluetooth, paired and fixed coverage of ADSL, 3G cellular, gigabit Ethernet, MLPS and peer-to-peer networks. The latest edition comprehensively discusses fibre to the home, RIFD, delay torrent networking, 802.11 security, internet routing, congestion control, quality of service, real-time transport and content distribution.</p>\r\n\r\n<p>Published by Pearson Education, the 5th Edition includes eight chapters that begin with the petite topics of physical layer, data link layer and medium access control sub-layer. Tanenbaum gradually gets to the more intricate topics of network layer, transport layer and application layer where various concepts have been explained in a plain manner. The book also explains network security to assist in creating a secure networking system between computers.</p>\r\n\r\n<p><strong>About the author:</strong></p>\r\n\r\n<p>Andrew Tanenbaum, born in 1944, is an American computer scientist who is a professor emeritus at Vrije Universiteit at Amsterdam, Netherlands. Known for being the author of MINIX, a unix like free operating system, Tanenbaum is devoted to his teaching profession.</p>', 1, '2021-10-12 07:19:03', 1, 7, 'all', ''),
(473, 26, 0, 'Computer Networks and Internets', 0, 'computer-networks-and-internets-1', 21, 0, 1, 'Douglas Comer', 'Pearson', 1, 1, 'shipped', 'upload/images/0527-2021-10-06.jpg', '', '<p><em>Appropriate for all introductory-to-intermediate courses in computer networking, the Internet, or Internet applications; students need no background in networking, operating systems, or advanced mathematics.</em></p>\r\n\r\n<p><em> </em></p>\r\n\r\n<p>Leading networking authority Douglas Comer presents a wide-ranging, self-contained tour of the concepts, principles, and technologies that enable today’s Internet to support applications ranging from web browsing to telephony and multimedia. Comer begins by illuminating the applications and facilities offered by today’s Internet. Next, he systematically introduces the underlying network technologies and protocols that make them possible. With these concepts and technologies established, he introduces several of the most important contemporary issues faced by network implementers and managers, including quality of service, Internet telephony, multimedia, network security, and network management. Comer has carefully designed this book to support both top-down and bottom-up teaching approaches. Students need no background in operating systems, and no sophisticated math: Comer relies throughout on figures, drawings, examples, and analogies, not mathematical proofs.</p>', 1, '2021-10-12 07:20:09', 1, 7, 'all', ''),
(474, 26, 0, 'A Textbook Of Thermal Engineering: Mechanical Technology', 0, 'a-textbook-of-thermal-engineering-mechanical-technology-1', 21, 0, 1, 'RS Khurmi', 'S Chand', 1, 1, 'shipped', 'upload/images/9430-2021-10-06.jpg', '', '<p>Reading books is a kind of enjoyment. Reading books is a good habit. We bring you a different kinds of books. You can carry this book where ever you want. It is easy to carry. It can be an ideal gift to yourself and to your loved ones. Care instruction keep away from fire.</p>', 1, '2021-10-12 07:20:44', 1, 7, 'all', ''),
(475, 26, 0, 'Power System Analysis And Design', 0, 'power-system-analysis-and-design-1', 21, 0, 1, 'Dr. B.R. GUPTA (Author)', 'S Chand', 1, 1, 'shipped', 'upload/images/8623-2021-10-06.jpg', '', '<p>Reading books is a kind of enjoyment. Reading books is a good habit. We bring you a different kinds of books. You can carry this book where ever you want. It is easy to carry. It can be an ideal gift to yourself and to your loved ones. Care instruction keep away from fire.</p>', 1, '2021-10-12 07:21:16', 1, 7, 'all', ''),
(476, 26, 0, 'Strength of Material: Mechanics of Soilds', 0, 'strength-of-material-mechanics-of-soilds-1', 21, 0, 1, 'RS Khurmi', 'S Chand', 1, 1, 'shipped', 'upload/images/3452-2021-10-06.jpg', '', '<p>Strength of Materials: Mechanics of Solids in SI Units” is an all-inclusive text for students as it takes a detailed look at all concepts of the subject. Distributed evenly in 38 chapters, important focusses are laid on stresses, strains, inertia, force, beams, joints and shells amongst others.<br />\r\nEach chapter contains numerous solved examples supported by exercises and chapter-end questions which aid to the understanding of the concepts explained. A book which has seen, foreseen and incorporated changes in the subject for close to 50 years, it continues to be one of the most sought after texts by the students for all aspects of the subject.</p>\r\n\r\n<p><strong>Key Features:</strong></p>\r\n\r\n<ul>\r\n	<li>38 chapters provide an in-depth coverage of every important concept in the subject.</li>\r\n	<li>Close to 1250 examples, figures and tables aid to the concepts explained.</li>\r\n	<li>Close to 700 in-text exercise questions and chapter-end questions add to the practice of the students.</li>\r\n</ul>\r\n\r\n<p><strong>Table of Content :</strong></p>\r\n\r\n<ul>\r\n	<li>Introduction</li>\r\n	<li>Simple Stresses and Strains</li>\r\n	<li>Stresses and Strains in Bars of Varying Sections</li>\r\n	<li>Stresses and Strains in Statically Indeterminate Structures</li>\r\n	<li>Thermal Stresses and Strains</li>\r\n	<li>Elastic Constants</li>\r\n	<li>Principal Stresses and Strains</li>\r\n	<li>Strain Energy and Impact Loading</li>\r\n	<li>Centre of Gravity</li>\r\n	<li>Moment of Inertia</li>\r\n	<li>Analysis of Perfect Frames (Analytical Method)</li>\r\n	<li>Analysis of Perfect Frames (Graphical Method)</li>\r\n	<li>Bending Moment and Shear Force</li>\r\n	<li>Bending Stresses in Simple Beams</li>\r\n	<li>Bending Stresses in Composite Beams</li>\r\n	<li>Shearing Stresses In Beams</li>\r\n	<li>Direct and Bending Stresses</li>\r\n	<li>Dams and Retaining Walls</li>\r\n	<li>Deflection of Beams</li>\r\n	<li>Deflection of Cantilevers</li>\r\n	<li>Deflection by Moment Area Method</li>\r\n	<li>Deflection by Conjugate Beam Method</li>\r\n	<li>Propped Cantilevers and Beams</li>\r\n	<li>Fixed Beams</li>\r\n	<li>Theorem of Three Moments</li>\r\n	<li>Moment Distribution Method</li>\r\n	<li>Torsion of Circular Shafts</li>\r\n	<li>Springs</li>\r\n	<li>Riveted Joints</li>\r\n	<li>Welded Joints</li>\r\n	<li>Thin Cylindrical and Spherical Shells</li>\r\n	<li>Thick Cylindrical and Spherical Shells</li>\r\n	<li>Bending of Curved Bars</li>\r\n	<li>Columns and Struts</li>\r\n	<li>Introduction to Reinforced Concrete</li>\r\n	<li>Product of Inertia</li>\r\n	<li>Strain Energy and Deflection Due to Bending & Shear (and Castigliano\'s Theorem)</li>\r\n	<li>Mechanical Properties and Testing of Materials (Stress-Strain Diagram)</li>\r\n</ul>', 1, '2021-10-12 07:21:57', 1, 7, 'all', ''),
