(480, 26, 0, 'Power Electronics', 0, 'power-electronics-4', 21, 0, 1, 'PS Bimbhra', 'Khanna publication', 1, 1, 'shipped', 'upload/images/6775-2021-10-06.jpg', '', '<p>Introduction power semiconductor diodes and transistors<br />\r\ndiode circuits and rectifiers<br />\r\nthyristors<br />\r\nthyristor commutation techniques<br />\r\nphase controlled rectifiers<br />\r\nchoppers<br />\r\ninverter<br />\r\nac voltage controllers<br />\r\ncycloconverters some applications electric drives power factor improvement<br />\r\nswitching mode Dc-Dc converters power supplies power electronic controllers for AC transmission<br />\r\nappendix-a Fourier analysis<br />\r\nappendix-b Laplace transforms<br />\r\nappendix-c objective type questions appendix some useful functions appendix references<br />\r\nindex.</p>', 1, '2021-10-12 07:25:30', 1, 7, 'all', ''),
(481, 26, 0, 'MACHINE DRAWING', 0, 'machine-drawing-1', 25, 0, 1, 'RB Gupta', 'Satya Prakashan', 1, 1, 'shipped', 'upload/images/9715-2021-10-06.jpg', '', '<p>The purpose of writing the book on Machine Drawing is to meet the requirements of Engineering Degree and Diploma students. It is based upon the syllabuses specified by different State Boards of Technical Education and Universities. The book is in First Angle Projection according to the specifications of the Bureau of Indian Standards. However, the Third Angle Projection has also been included. It covers full syllabuses of different Engineering Universities and State Boards of Technical Education Many questions of the examination papers which were in F.P.S. and First Angle Projection, have been converted in M.K.S. and Third Angle Projection. The dimensions of the figures are in millimetres unless otherwise specified</p>', 1, '2021-10-12 07:26:08', 1, 7, 'all', ''),
