(496, 26, 0, 'Circuits and Networks: Analysis and Synthesis', 0, 'circuits-and-networks-analysis-and-synthesis-4-1', 21, 0, 1, 'A Sudhakar', 'mc grawhill', 1, 1, 'shipped', 'upload/images/4983-2021-10-06.jpg', '', '<p>The revision of this extremely popular text, Circuits and Networks: Analysis and Synthesis, comes at a time when the industry is increasingly looking to hire engineers who are able to display learning outcomes. The book has been revised based on internationally accepted Learning Outcomes required from a course. Additionally, key pedagogical aids, such as questions from previous year question papers are added afresh to further help students in preparing for this course and its examinations. For the tech savvy, the practice of MCQs in a digital and randomized environment will provide thrill.</p>\r\n\r\n<p>Book Features:</p>\r\n\r\n<ul>\r\n	<li>Content revised as per internationally accepted learning outcomes</li>\r\n	<li>461 Frequently asked questions derived from important previous year question papers</li>\r\n	<li>Features like Definition and Important Formulas are highlighted within the text</li>\r\n</ul>\r\n\r\n<p>Table of Contents:</p>\r\n\r\n<ul>\r\n	<li>Circuit Elements and Kirchoff\'s Laws</li>\r\n	<li>Methods of Analysing Circuits</li>\r\n	<li>Useful Theorems in Circuit Analysis</li>\r\n	<li>Introduction to Alternating Currentsand Voltages</li>\r\n	<li>Complex Impedance</li>\r\n	<li>Power and Power Factor</li>\r\n	<li>Steady State AC Analysis</li>\r\n	<li>Resonance</li>\r\n	<li>Polyphase Circuits</li>\r\n	<li>Coupled Circuits</li>\r\n	<li>Transients</li>\r\n	<li>Fourier Method of Waveform Analysis</li>\r\n	<li>Introduction to Laplace Transform</li>\r\n	<li>Application of the Laplace Transform in Circuit Analysis</li>\r\n	<li>S-Domain Analysis</li>\r\n	<li>Two-Port Networks</li>\r\n	<li>Filters and Attenuators</li>\r\n	<li>Elements of Realizability and Synthesis of One- Port Networks</li>\r\n	<li>An Introduction to PSpice</li>\r\n</ul>\r\n\r\n<p>Appendix A: Fourier Series<br />\r\nAppendix B: The j Factor<br />\r\nIndex</p>', 1, '2021-10-14 04:41:17', 1, 7, 'all', ''),
(497, 26, 0, 'Digital Principles and Design', 0, 'digital-principles-and-design-1', 21, 0, 1, 'Donald Givone', 'mc grawhill', 1, 1, 'shipped', 'upload/images/7518-2021-10-06.jpg', '', '<p>Digital Principals and Design is a comprehensive new textbook, which takes a classical approach to the subject of digital design, emphasizing through presentation of the basic principles of logic design and the illustration of these principles. The book is intended for an introductory course in digital principles with emphasis on logic, design as well as for a more advanced course. With the exception of the digital circuits appendix,it assumes no background on the part of the reader. Students in computer science, computer engineering and electrical can use the text.</p>', 1, '2021-10-14 04:42:08', 1, 7, 'all', ''),
(498, 26, 0, 'Computer Graphics', 0, 'computer-graphics-1', 21, 0, 1, 'Chennakesava R', 'PHI Publication', 1, 1, 'shipped', 'upload/images/6857-2021-10-06.jpg', '', '<p>The book begins with an introduction to the subject and goes on to discuss various graphic techniques with the help of several examples and neatly drawn figures. It elaborates on methods for modelling and performing geometric transformations and methods for obtaining views in both two and three dimensions. With a programming-oriented approach, the book also describes all the processes used in computer graphics along with easy-to-read algorithms, which will enable students to develop their own software skills.</p>', 1, '2021-10-14 04:42:43', 1, 7, 'all', ''),
(499, 26, 0, 'Modern Digital Electronics', 0, 'modern-digital-electronics-1', 21, 0, 1, 'R.P jain', 'mc grawhill', 1, 1, 'shipped', 'upload/images/0604-2021-10-06.jpg', '', '<p>The revised edition of Modern Digital Electronics focuses on rigorous coverage of design and analysis of complex digital circuits and systems through enhanced elucidation of Sequential Logic Design, PLDs, Memories and VHDL implementation codes. Begins with the fundamental concepts of digital electronics, it covers digital design using VHDL supported by plethora of examples.</p>', 1, '2021-10-14 04:43:09', 1, 7, 'all', ''),
(500, 26, 0, 'Digital Signal Processing', 0, 'digital-signal-processing-1', 21, 0, 1, 'A Nagoor Kani', 'mc grawhill', 1, 1, 'shipped', 'upload/images/7805-2021-10-06.jpg', '', '<p>Digital Signal Processing by A Nagoor Kani has been written keeping in mind the requirement of the students. The subject dealt with in this book is highly mathematical in nature. The author of the book has, therefore, laid stress on the methodology of solving various problems. Mathematical derivations are elucidated in a step-by-step manner for students to understand and remember. In order to help improve the understanding of the subject, the author has provided exercise problems ranging across a wide variety of difficulty levels.</p>\r\n\r\n<p>The book contains 12 chapters which covers various topics and 7 Appendices which contain the key points on certain vital matters relating to the subject. The book contains a total of 320 solved examples and 1080 exercise problems. to make the subject more understandable for students, a set of 305 short questions and answers are also provided in the book.</p>\r\n\r\n<p>The 2nd edition of Digital Signal Processing was published by Tata McGraw Hill Publishing Company in 2012. Available as a paperback, it is helpful for practitioners and engineering students.</p>\r\n\r\n<p>Key Features:</p>\r\n\r\n<p> </p>\r\n\r\n<ul>\r\n	<li>The book contains exercise problems involving varied levels of difficulty and help students in sharpening their intuitive skill.</li>\r\n</ul>', 1, '2021-10-14 04:43:32', 1, 7, 'all', ''),
(501, 26, 0, 'Digital Signal Processing', 0, 'digital-signal-processing-2', 25, 0, 1, 'A Nagoor Kani', 'mc grawhill', 1, 1, 'shipped', 'upload/images/7805-2021-10-06.jpg', '', '<p>Digital Signal Processing by A Nagoor Kani has been written keeping in mind the requirement of the students. The subject dealt with in this book is highly mathematical in nature. The author of the book has, therefore, laid stress on the methodology of solving various problems. Mathematical derivations are elucidated in a step-by-step manner for students to understand and remember. In order to help improve the understanding of the subject, the author has provided exercise problems ranging across a wide variety of difficulty levels.</p>\r\n\r\n<p>The book contains 12 chapters which covers various topics and 7 Appendices which contain the key points on certain vital matters relating to the subject. The book contains a total of 320 solved examples and 1080 exercise problems. to make the subject more understandable for students, a set of 305 short questions and answers are also provided in the book.</p>\r\n\r\n<p>The 2nd edition of Digital Signal Processing was published by Tata McGraw Hill Publishing Company in 2012. Available as a paperback, it is helpful for practitioners and engineering students.</p>\r\n\r\n<p>Key Features:</p>\r\n\r\n<p> </p>\r\n\r\n<ul>\r\n	<li>The book contains exercise problems involving varied levels of difficulty and help students in sharpening their intuitive skill.</li>\r\n</ul>', 1, '2021-10-14 04:44:03', 1, 7, 'all', ''),
(502, 26, 0, 'Digital Signal Processing', 0, 'digital-signal-processing-3', 25, 0, 1, 'A Nagoor Kani', 'mc grawhill', 1, 1, 'shipped', 'upload/images/7805-2021-10-06.jpg', '', '<p>Digital Signal Processing by A Nagoor Kani has been written keeping in mind the requirement of the students. The subject dealt with in this book is highly mathematical in nature. The author of the book has, therefore, laid stress on the methodology of solving various problems. Mathematical derivations are elucidated in a step-by-step manner for students to understand and remember. In order to help improve the understanding of the subject, the author has provided exercise problems ranging across a wide variety of difficulty levels.</p>\r\n\r\n<p>The book contains 12 chapters which covers various topics and 7 Appendices which contain the key points on certain vital matters relating to the subject. The book contains a total of 320 solved examples and 1080 exercise problems. to make the subject more understandable for students, a set of 305 short questions and answers are also provided in the book.</p>\r\n\r\n<p>The 2nd edition of Digital Signal Processing was published by Tata McGraw Hill Publishing Company in 2012. Available as a paperback, it is helpful for practitioners and engineering students.</p>\r\n\r\n<p>Key Features:</p>\r\n\r\n<p> </p>\r\n\r\n<ul>\r\n	<li>The book contains exercise problems involving varied levels of difficulty and help students in sharpening their intuitive skill.</li>\r\n</ul>', 1, '2021-10-14 04:44:35', 1, 7, 'all', ''),
(503, 26, 0, 'Higher Engineering Mathematics', 0, 'higher-engineering-mathematics-2-1', 21, 0, 1, 'B. S. Grewal', 'Khanna publication', 1, 1, 'shipped', 'upload/images/8024-2021-10-05.jpg', '', '<p>Reading books is a kind of enjoyment. Reading books is a good habit. We bring you a different kinds of books. You can carry this book where ever you want. It is easy to carry. It can be an ideal gift to yourself and to your loved ones. Care instruction keep away from fire.</p>', 1, '2021-10-14 04:45:20', 1, 7, 'all', ''),
(504, 26, 0, 'Operating Systems', 0, 'operating-systems-1', 21, 0, 1, 'Achyut Godbole , Atul Kahate', 'mc grawhill', 1, 1, 'shipped', 'upload/images/7832-2021-10-05.jpg', '', '<p>This book aims to demystify the subject using a simplified step-wise approach of going from the basic fundamentals concepts to advanced concepts. The approach, combined with the numerous illustrations and other pedagogical features of the book, makes it an invaluable resource for the students.</p>', 1, '2021-10-14 04:46:01', 1, 7, 'all', ''),
(505, 26, 0, 'Wireless Communications', 0, 'wireless-communications-1', 21, 0, 1, 'TL Signal', 'mc grawhill', 1, 1, 'shipped', 'upload/images/3136-2021-10-05.jpg', '', '<p>The book presents detailed understanding on fundamentals of Wireless Communication. The topics are written in simple language covering important aspects of wireless communication and networks. Emerging trends like WLAN, Bluetooth, Fixed Broadband and Wireless WAN communications are aptly covered. Technical concepts which are at the core of design, planning and evaluation of wireless communication are presented in detail. The mathematical derivations are given in step by step manner for easy understanding. The book has excellent pedagogy with numerous solved examples and practice questions. Plenty of short answer type questions and objective type questions are included in the text extensively for exam preparation. Some real life figures of wireless devices are also provided in the book to invoke student’s interest.</p>', 1, '2021-10-14 04:46:37', 1, 7, 'all', ''),
(506, 26, 0, 'Circuits and Networks', 0, 'circuits-and-networks-6', 21, 1, 1, 'A sudhakar', 'mc grawhill', 1, 1, 'shipped', 'upload/images/4666-2021-10-05.jpg', '', '<p>The revision of this extremely popular text, Circuits and Networks: Analysis and Synthesis, comes at a time when the industry is increasingly looking to hire engineers who are able to display learning outcomes. The book has been revised based on internationally accepted Learning Outcomes required from a course. Additionally, key pedagogical aids, such as questions from previous year question papers are added afresh to further help students in preparing for this course and its examinations. For the tech savvy, the practice of MCQs in a digital and randomized environment will provide thrill.</p>\r\n\r\n<p>Book Features:</p>\r\n\r\n<ul>\r\n	<li>Content revised as per internationally accepted learning outcomes</li>\r\n	<li>461 Frequently asked questions derived from important previous year question papers</li>\r\n	<li>Features like Definition and Important Formulas are highlighted within the text</li>\r\n</ul>\r\n\r\n<p>Table of Contents:</p>\r\n\r\n<ul>\r\n	<li>Circuit Elements and Kirchoff\'s Laws</li>\r\n	<li>Methods of Analysing Circuits</li>\r\n	<li>Useful Theorems in Circuit Analysis</li>\r\n	<li>Introduction to Alternating Currentsand Voltages</li>\r\n	<li>Complex Impedance</li>\r\n	<li>Power and Power Factor</li>\r\n	<li>Steady State AC Analysis</li>\r\n	<li>Resonance</li>\r\n	<li>Polyphase Circuits</li>\r\n	<li>Coupled Circuits</li>\r\n	<li>Transients</li>\r\n	<li>Fourier Method of Waveform Analysis</li>\r\n	<li>Introduction to Laplace Transform</li>\r\n	<li>Application of the Laplace Transform in Circuit Analysis</li>\r\n	<li>S-Domain Analysis</li>\r\n	<li>Two-Port Networks</li>\r\n	<li>Filters and Attenuators</li>\r\n	<li>Elements of Realizability and Synthesis of One- Port Networks</li>\r\n	<li>An Introduction to PSpice</li>\r\n</ul>\r\n\r\n<p>Appendix A: Fourier Series<br />\r\nAppendix B: The j Factor<br />\r\nIndex</p>', 1, '2021-10-14 04:47:22', 1, 7, 'all', ''),
(507, 26, 0, 'Thermodynamics - An Engineering Approach', 0, 'an-engineering-approach-1', 21, 0, 1, 'yunus a cengel', 'mc grawhill', 1, 1, 'shipped', 'upload/images/4737-2021-10-05.jpg', '', '<p>Distinguished as a best seller, the title Thermodynamics: An Engineering Approach is taking another step towards excellence with this revised edition. Through its careful explanations of concepts, and use of numerous practical examples and figures, this book aims to bridge the gap between knowledge and the confidence to properly apply it.</p>\r\n\r\n<p>Key Features:</p>\r\n\r\n<p>✔ Written in a self-instructive manner, it speaks to students, not over students</p>\r\n\r\n<p>✔ Emphasizes on the physical aspects of the subject matter in addition to mathematical representations and manipulations.</p>\r\n\r\n<p>✔ Follows a physical, intuitive approach to help students master the practical problems</p>\r\n\r\n<p>✔ Contains a rich pool of pedagogy which revolve around the real-world problems</p>', 1, '2021-10-14 04:47:59', 1, 7, 'all', ''),
(508, 26, 0, 'PROGRAMMING IN BASIC', 0, 'programming-in-basic-1', 21, 0, 1, 'Herbert Schildt', 'mc grawhill', 1, 1, 'shipped', 'upload/images/0614-2021-10-05.jpg', '', '<p>Another gem from Herb Schildt--best-selling programming author with more than 2.5 million books sold! C: The Complete Reference, Fourth Edition gives you full details on C99, the New ANSI/ISO Standard for C. You\'ll get in-depth coverage of the C language and function libraries as well as all the newest C features, including restricted pointers, inline functions, variable-length arrays, and complex math. This jam-packed resource includes hundreds of examples and sample applications.</p>', 1, '2021-10-14 04:48:42', 1, 7, 'all', ''),
(509, 26, 0, 'Object-Oriented Programming with C++', 0, 'oriented-programming-with-c-1', 21, 0, 1, 'E Balagurusamy', 'mc grawhill', 1, 1, 'shipped', 'upload/images/3618-2021-10-05.jpg', '', '<p>Object-oriented programming with C++, 8th edition is here with some valuable updates. The new edition helps students to assess their learning by answering questions based on learning outcomes. Objective-type questions and dry-run questions are introduced to make students exam ready. A new appendix on interview questions is for those seeking to join the industry. The book is designed for students studying at the undergraduate level. It provides all-inclusive concepts and programs on object-oriented programming with C++ as an implementation language.<br />\r\nhighlights:<br />\r\n<br />\r\n150+ multi-choice questions<br />\r\n<br />\r\n100+ dry-run exercises<br />\r\n<br />\r\n90+ interview questions<br />\r\n<br />\r\nTwo new projects<br />\r\n<br />\r\nNew appendix on implementation of abstract data types<br />\r\n<br />\r\nclassification of review questions on OBE (outcome-based education) learning pattern<br />\r\n<br />\r\nAll programs upgraded for compatibility with ansi C++<br />\r\n.</p>', 1, '2021-10-14 04:49:12', 1, 7, 'all', ''),
(510, 26, 0, 'Business Studies', 0, 'business-studies-4', 21, 0, 1, 'DR. O.P. Gupta Mrs. S.K. Gupta Vijay Gupta', 'sbpd', 1, 1, 'shipped', 'upload/images/8915-2021-10-03.jpeg', '', '<p><span style=\"color:rgb(33, 33, 33); font-family:roboto,arial,sans-serif; font-size:14px\">Business Studies-12 a book contents: 1. Nature and Significant of Management 2. Principles of Management 3. Business Environment 4. Planning 5. Organisation 6. Staffing 7. Directing 8. Controlling 9. Business Finance 10. Financial; Market 11. Marketing 12. Consumer Protection 13. Project Work and Assignment</span></p>', 1, '2021-10-14 04:50:12', 1, 7, 'all', ''),
(511, 26, 0, 'Modern Control Engineering', 0, 'modern-control-engineering-1', 21, 0, 1, 'Ogata', 'Pearson', 1, 1, 'shipped', 'upload/images/6688-2021-10-03.jpg', '', '<p>Ogata\'s Modern Control Engineering, 5/e, offers the comprehensive coverage of continuous-time control systems that all senior students must have, including frequency response approach, root-locus approach and state-space approach to analysis and design of control systems. The text provides a gradual development of control theory, shows how to solve all computational problems with MATLAB and avoids highly mathematical arguments. A wealth of examples and worked problems are featured throughout the text. The new edition includes improved coverage of Root-Locus Analysis (Chapter 6) and Frequency-Response Analysis (Chapter 8). The author has also updated and revised many of the worked examples and end-of-chapter problems.</p>', 1, '2021-10-14 04:51:08', 1, 7, 'all', ''),
(512, 26, 0, 'Political Science', 0, 'political-science-2', 21, 0, 1, 'Dr. J.C. Johari', 'sbpd', 1, 1, 'shipped', 'upload/images/2209-2021-10-03.jpeg', '', '<p>Political Science Class-12 (PART A: Contemporary World Politics, PART B: Politics in India since Independence) a book Contents: PART ‘A’ : CONTEMPORARY WORLD POLITICS 1.The Cold War Era in World Politics, 2.Disintegration of the Second World and the Collapse of Bipolarity, 3.American Dominance in World Politics, 4. Alternative Centres of Economic and Political Power, 5 .South Asia in Post-Cold War Era, 6.International Organisations, 7. Security in the Contemporary World, 8. Environment and Natural Resources in Global Politics, 9 .Globalisation, High Order Thinking Skills (HOTS) Questions PART ‘B’ : POLITICS IN INDIA SINCE INDEPENDENCE 1.Nation-Building and its Problems, 2 .Era of One-Party Dominance, 3 .Politics of Planned Development, 4. India’s External Relations, 5. Challenges to and Restoration of the Congress System, 6 .Crisis of the Constitutional Order, 7. Regional Aspirations and Conflicts, 8. Rise of New Social Movements, 9 .Democratic Upsurge and Coalition Politics,10.Recent Issues and Challenges, High Order Thinking Skills (HOTS) Questions Board Examination Papers.</p>', 1, '2021-10-14 04:51:38', 1, 7, 'all', ''),
(513, 26, 0, 'Economics Class 12 Based On NCERT Guideline', 0, 'economics-class-12-based-on-ncert-guideline-2', 21, 0, 1, 'Anupam agarwal', 'sbpd', 1, 1, 'shipped', 'upload/images/4862-2021-10-03.jpeg', '', '<p>Strictly according to the latest syllabus prescribed by Central Board of Secondary Education (CBSE), Delhi and State Boards of Bihar, Jharkhand, Uttarakhand, Rajasthan, Haryana, H.P. etc. & Navodaya, Kasturba, Kendriya Vidyalayas etc. following CBSE curriculum based on NCERT guidelines. Part A : Introductory Micro Economics 1.Micro Economics : An Introduction, 2. Central Problems of an Economy, 3. Consumer’s Equilibrium, 4. Demand and Law of Demand, 5. Price Elasticity of Demand, 6. Production Function : Returns to a Factor and Returns to Scale, 7. Production Costs, 8. Concepts of Revenue, 9. Producer’s Equilibrium : Meaning and Conditions, 10. Supply and Law of Supply, 11. Elasticity of Supply, 12. Different Forms of Market : Meaning and Features, 13. Market Equilibrium Under Perfect Competition and Effects of Shifts in Demand & Supply, 14. Simple Applications of Tools of Demand and Supply, Part B : Introductory Macro Economics 15. Macro Economics : Meaning, 16. Circular Flow of Income, 17. Concepts and Aggregates related to National Income, 18. Measurement of National Income, 19. Money : Meaning, Evolution and Functions, 20. Commercial Banks and Credit Creation, 21. Central Bank : Meaning and Functions, 22. Recent Significant Reforms and Issues in Indian Banking System : Privatisation and Modernisation, 23. Aggregate Demand, Aggregate Supply and Related Concepts (Propensity to Consume, Propensity to Save and Investment), 24. Short Run Equilibrium Output, 25. Investment Multiplier and its Mechanism, 26. Problems of Deficient and Excess Demand, 27. Measures to Correct Deficient Demand and Excess Demand, 28. Government Budget and Economy, 29. Foreign Exchange Rate, 30. Balance of Payment Accounts : Meaning and Components. Model Paper Board Examination Papers</p>', 1, '2021-10-14 04:52:07', 1, 7, 'all', ''),
(514, 26, 0, 'Accountancy Class 11-BASED ON NCERT GUIDELINES (SBPD)', 0, 'based-on-ncert-guidelines-sbpd-1', 25, 0, 1, 'SBPD Publications', 'made in india', 1, 1, 'shipped', 'upload/images/2739-2021-10-01.jpeg', '', '<p>1. Introduction to Accounting, 2. Basic Accounting Terms or Terminology, 3. Theory Base of Accounting : Accounting Principles Fundamental Assumptions or Concepts, 4. Accounting Standards and IFRS, 5. Double Entry System, 6. Process and Bases of Accounting 7. Origin of Transactions : Source Documents and Vouchers, 8. Accounting Equation, 9. Rules of Debit and Credit, 10. Recording of Business Transactions : Books of Original Entry—Journal, 11. Ledger, 12. Special Purpose (Subsidiary) Books (I) : Cash Book, 13. Special Purpose (Subsidiary) Books (II), 14. Bank Reconciliation Statement, 15. Trial Balance and Errors, 16. Depreciation, 17. Provisions and Reserves, 18. Accounting for Bills of Exchange, 19. Rectification of Errors, 20. Capital and Revenue Expenditures and Receipts, 21. Financial Statements/Final Accounts (Without Adjustment), 22. Final Accounts (With Adjustment), 23. Accounts from Incomplete Records or Single Entry System. UNIT : Computer in Accounting 1. Introduction to Computer and Accounting Information System (AIS), 2. Applications of Computer in Accounting, 3. Accounting and Database System : Project Work</p>', 1, '2021-10-14 04:52:41', 1, 7, 'all', ''),
