(712, 26, 0, 'Olympiad Champs Mathematics Class 8 with Past Olympiad Questions 4th Edition', 0, 'olympiad-champs-mathematics-class-8-with-past-olympiad-questions-4th-edition', 2, 20, 1, 'Disha Experts  (Author)', 'Disha Publication', 1, 1, 'shipped', 'upload/images/9776-2021-10-22.jpg', '', '<p>he thoroughly revised &amp; updated 4th edition of “Olympiad Champs Mathematics Class 8 with Past Olympiad Questions” is a complete preparatory book not only for Olympiad but also for Class 8 Mathematics. # The book has been updated with the introduction of 2 Online mock Tests for practice and 2019 &amp; 2018 Solved questions of the various Olympiad Exams.# The book has been updated with the introduction of questions based on mental Mathematics &amp; critical Reasoning. # This new edition now comes with inclusion of past 7 year Questions from various Olympiad Exams like IMO, IOM, GTSE, etc. In both the exercises of every br&gt;Chapter # further the book provides engaging content with the help of Teasers, Do You know, Amazing Facts &amp; illustrations, which enriches the reading experience for the children.# The questions are divided into two levels Level 1 and Level 2. # The first level, Level 1, is the beginner’s level which comprises of questions like fillers, analogy and odd one out. # The second level is the advanced level. Level 2 comprises of techniques like matching, chronological sequencing, picture, passage and feature based, statement correct/incorrect, integer based, puzzle, grid based, crossword, Venn diagram, table/chart based and much more.# Solutions and explanations are provided for all questions. # The access code to the 2 Online Tests is available in the book.</p>', 1, '2021-10-22 10:21:41', 1, 7, 'all', ''),
(713, 26, 0, 'Olympiad Champs Science Class 8 with Past Olympiad Questions 4th Edition', 0, 'olympiad-champs-science-class-8-with-past-olympiad-questions-4th-edition', 2, 20, 1, 'Disha Experts  (Author)', 'Disha Publication', 1, 1, 'shipped', 'upload/images/9653-2021-10-22.jpg', '', '<p>The thoroughly revised &amp; updated 3rd Edition of “Olympiad Champs Science Class 6 with Past Olympiad Questions” is a complete preparatory book not only for Olympiad but also for Class 6 Science. # The book has been updated with the introduction of 2 Online mock Tests for practice and 2019 &amp; 2018 Solved questions of the various pathologic; Olympiad exams.# This new edition now comes with inclusion of past 7 year Questions from various Olympiad Exams like NSO, IOS, gt se, etc. In both the exercises of every Chapter # further the book provides engaging content with the help of Teasers, Do You know, Amazing Facts &amp; illustrations, which enriches the reading experience for the children.# The questions are divided into two levels Level 1 and Level 2. # The first level, Level 1, is the beginners level which comprises of questions like fillers, analogy and odd one out. # The second level is the advanced level. Level 2 comprises of questions based on techniques like matching, chronological sequencing, picture, passage and feature based, statement correct/incorrect, integer based, puzzle, grid based, crossword, Venn diagram, table/chart based and much more.# Solutions and explanations are provided for all questions at the end of each Chapter # The access code to the 2 Online Tests is available in the book.</p>', 1, '2021-10-22 10:24:26', 1, 7, 'all', ''),
(714, 26, 0, 'Foundation Science for IIT-JEE/ NEET/ NTSE/ Olympiad Class 7 - 3rd Edition', 0, 'foundation-science-for-iit-jee-neet-ntse-olympiad-class-7-3rd-edition', 2, 20, 1, 'Disha Experts  (Author)', 'Disha Publication', 1, 1, 'shipped', 'upload/images/5989-2021-10-22.jpg', '', '<p> The Foundation Science for IIT-JEE/ NEET/ NTSE/ Olympiad Guide for Class 7 is the perfect book to build a VERY STRONG FOUNDATION for these examinations. - The book provides, for each chapter, key Concepts followed by Multiple Choice Questions of various varieties. - Each chapter has 2 levels of exercises. - Exercise 1 contains straight MCQ&#39;s having one correct option. - Exercise 2 contains MCQ&#39;s of different types as asked in the IIT-JEE and various PMT exams. The various types of questions are: 1. Matching based MCQ&#39;s 2. MCQ&#39;s with more than one correct answer 3. Assertion-Reason type MCQ&#39;s 4. Passage based MCQ&#39;s 5. Integer based MCQ&#39;s 6. Diagram based MCQ&#39;s - The solutions to both the exercises are provided at the end of each chapter. - The book will also prove to be very helpful in the preparation of NTSE and Olympiads</p>', 1, '2021-10-22 10:28:26', 1, 7, 'all', ''),
(715, 26, 0, 'Foundation Mathematics for Iit-Jee/ Ntse/Olympiad Class 7', 0, 'foundation-mathematics-for-iit-jee-ntse-olympiad-class-7', 2, 20, 1, 'Disha Experts  (Author)', 'Disha Publication', 1, 1, 'shipped', 'upload/images/2973-2021-10-22.jpg', '', '<p>The Foundation Mathematics for IIT-JEE/ NEET/ NTSE/ Olympiad Guide for Class 7 is the perfect book to build a VERY STRONG FOUNDATION for these examinations. - The book provides, for each chapter, key Concepts followed by Multiple Choice Questions of various varieties. - Each chapter has 2 levels of exercises. - Exercise 1 contains straight MCQ&#39;s having one correct option. - Exercise 2 contains MCQ&#39;s of different types as asked in the IIT-JEE exam. The various types of questions are: 1. Matching based MCQ&#39;s 2. MCQ&#39;s with more than one correct answer 3. Assertion-Reason type MCQ&#39;s 4. Passage based MCQ&#39;s 5. Integer based MCQ&#39;s 6. Diagram based MCQ&#39;s - The solutions to both the exercises are provided at the end of each chapter. - The book will also prove to be very helpful in the preparation of NTSE and Olympiads.</p>', 1, '2021-10-22 10:32:01', 1, 7, 'all', ''),
