(9, 'privacy_policy', '<p><strong>This Privacy Policy describes Our policies and procedures on the collection, use and disclosure of Your information when You use the Service and tells You about Your privacy rights and how the law protects You. We use Your Personal data to provide and improve the Service. By using the Service, You agree to the collection […]</strong></p>\r\n\r\n<p><strong>We use Your Personal data to provide and improve the Service. By using the Service, You agree to the collection and use of information in accordance with this Privacy Policy.</strong></p>\r\n\r\n<h1>Interpretation and Definitions</h1>\r\n\r\n<h2>Interpretation</h2>\r\n\r\n<p>The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.</p>\r\n\r\n<h2>Definitions</h2>\r\n\r\n<p>For the purposes of this Privacy Policy:</p>\r\n\r\n<ul>\r\n	<li>Account means a unique account created for You to access our Service or parts of our Service.</li>\r\n	<li>Company (referred to as either “the Company”, “We”, “Us” or “Our” in this Agreement) refers to BookShaala.com.</li>\r\n	<li>Cookies are small files that are placed on Your computer, mobile device or any other device by a website, containing the details of Your browsing history on that website among its many uses.</li>\r\n	<li>Country refers to: Rajasthan, India</li>\r\n	<li>Device means any device that can access the Service such as a computer, a cellphone or a digital tablet.</li>\r\n	<li>Personal Data is any information that relates to an identified or identifiable individual.</li>\r\n	<li>Service refers to the Website.</li>\r\n	<li>Service Provider means any natural or legal person who processes the data on behalf of the Company. It refers to third-party companies or individuals employed by the Company to facilitate the Service, to provide the Service on behalf of the Company, to perform services related to the Service or to assist the Company in analyzing how the Service is used.</li>\r\n	<li>Third-party Social Media Service refers to any website or any social network website through which a User can log in or create an account to use the Service.</li>\r\n	<li>Usage Data refers to data collected automatically, either generated by the use of the Service or from the Service infrastructure itself (for example, the duration of a page visit).</li>\r\n	<li>Website refers to BookShaala, accessible from BooksBear App</li>\r\n	<li>You means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</li>\r\n</ul>\r\n\r\n<h1>Collecting and Using Your Personal Data</h1>\r\n\r\n<h2>Types of Data Collected</h2>\r\n\r\n<h3>Personal Data</h3>\r\n\r\n<p>While using Our Service, We may ask You to provide Us with certain personally identifiable information that can be used to contact or identify You. Personally identifiable information may include, but is not limited to:</p>\r\n\r\n<ul>\r\n	<li>Email address</li>\r\n	<li>First name and last name</li>\r\n	<li>Phone number</li>\r\n	<li>Address, State, Province, ZIP/Postal code, City</li>\r\n	<li>Usage Data</li>\r\n</ul>\r\n\r\n<h3>Usage Data</h3>\r\n\r\n<p>Usage Data is collected automatically when using the Service.</p>\r\n\r\n<p>Usage Data may include information such as Your Device’s Internet Protocol address (e.g. IP address), browser type, browser version, the pages of our Service that You visit, the time and date of Your visit, the time spent on those pages, unique device identifiers and other diagnostic data.</p>\r\n\r\n<p>When You access the Service by or through a mobile device, We may collect certain information automatically, including, but not limited to, the type of mobile device You use, Your mobile device unique ID, the IP address of Your mobile device, Your mobile operating system, the type of mobile Internet browser You use, unique device identifiers and other diagnostic data.</p>\r\n\r\n<p>We may also collect information that Your browser sends whenever You visit our Service or when You access the Service by or through a mobile device.</p>\r\n\r\n<h3>Tracking Technologies and Cookies</h3>\r\n\r\n<p>We use Cookies and similar tracking technologies to track the activity on Our Service and store certain information. Tracking technologies used are beacons, tags, and scripts to collect and track information and to improve and analyze Our Service. The technologies We use may include:</p>\r\n\r\n<ul>\r\n	<li>Cookies or Browser Cookies. A cookie is a small file placed on Your Device. You can instruct Your browser to refuse all Cookies or to indicate when a cookie is being sent. However, if You do not accept Cookies, You may not be able to use some parts of our Service. Unless you have adjusted Your browser setting so that it will refuse cookies, our Service may use Cookies.</li>\r\n	<li>Flash Cookies. Certain features of our Service may use local stored objects (or Flash cookies) to collect and store information about Your preferences or Your activity on our Service. Flash Cookies are not managed by the same browser settings as those used for Browser Cookies. For more information on how You can delete Flash Cookies, please read “Where can I change the settings for disabling, or deleting local shared objects?</li>\r\n	<li>Web Beacons. Certain sections of our Service and our emails may contain small electronic files known as web beacons (also referred to as clear gifs, pixel tags, and single-pixel gifs) that permit the Company, for example, to count users who have visited those pages or opened an email and for other related website statistics (for example, recording the popularity of a certain section and verifying system and server integrity).</li>\r\n</ul>\r\n\r\n<p>Cookies can be “Persistent” or “Session” Cookies. Persistent Cookies remain on Your personal computer or mobile device when You go offline, while Session Cookies are deleted as soon as You close Your web browser.</p>\r\n\r\n<p>We use both Session and Persistent Cookies for the purposes set out below:</p>\r\n\r\n<ul>\r\n	<li>Necessary / Essential CookiesType: Session CookiesAdministered by: UsPurpose: These Cookies are essential to provide You with services available through the Website and to enable You to use some of its features. They help to authenticate users and prevent fraudulent use of user accounts. Without these Cookies, the services that You have asked for cannot be provided, and We only use these Cookies to provide You with those services.</li>\r\n	<li>Cookies Policy / Notice Acceptance CookiesType: Persistent CookiesAdministered by: UsPurpose: These Cookies identify if users have accepted the use of cookies on the Website.</li>\r\n	<li>Functionality CookiesType: Persistent CookiesAdministered by: UsPurpose: These Cookies allow us to remember choices You make when You use the Website, such as remembering your login details or language preference. The purpose of these Cookies is to provide You with a more personal experience and to avoid You having to re-enter your preferences every time You use the Website.</li>\r\n</ul>\r\n\r\n<p>For more information about the cookies we use and your choices regarding cookies, please visit our Cookies Policy or the Cookies section of our Privacy Policy.</p>\r\n\r\n<h2>Use of Your Personal Data</h2>\r\n\r\n<p>The Company may use Personal Data for the following purposes:</p>\r\n\r\n<ul>\r\n	<li>To provide and maintain our Service, including to monitor the usage of our Service.</li>\r\n	<li>To manage Your Account: to manage Your registration as a user of the Service. The Personal Data You provide can give You access to different functionalities of the Service that are available to You as a registered user.</li>\r\n	<li>For the performance of a contract: the development, compliance and undertaking of the purchase contract for the products, items or services You have purchased or of any other contract with Us through the Service.</li>\r\n	<li>To contact You: To contact You by email, telephone calls, SMS, or other equivalent forms of electronic communication, such as a mobile application’s push notifications regarding updates or informative communications related to the functionalities, products or contracted services, including the security updates, when necessary or reasonable for their implementation.</li>\r\n	<li>To provide You with news, special offers and general information about other goods, services and events which we offer that are similar to those that you have already purchased or enquired about unless You have opted not to receive such information.</li>\r\n	<li>To manage Your requests: To attend and manage Your requests to Us.</li>\r\n	<li>For business transfers: We may use Your information to evaluate or conduct a merger, divestiture, restructuring, reorganization, dissolution, or other sale or transfer of some or all of Our assets, whether as a going concern or as part of bankruptcy, liquidation, or similar proceeding, in which Personal Data held by Us about our Service users is among the assets transferred.</li>\r\n	<li>For other purposes: We may use Your information for other purposes, such as data analysis, identifying usage trends, determining the effectiveness of our promotional campaigns and to evaluate and improve our Service, products, services, marketing and your experience.</li>\r\n</ul>\r\n\r\n<p>We may share Your personal information in the following situations:</p>\r\n\r\n<ul>\r\n	<li>With Service Providers: We may share Your personal information with Service Providers to monitor and analyze the use of our Service, to contact You.</li>\r\n	<li>For business transfers: We may share or transfer Your personal information in connection with, or during negotiations of, any merger, sale of Company assets, financing, or acquisition of all or a portion of Our business to another company.</li>\r\n	<li>With Affiliates: We may share Your information with Our affiliates, in which case we will require those affiliates to honor this Privacy Policy. Affiliates include Our parent company and any other subsidiaries, joint venture partners or other companies that We control or that are under common control with Us.</li>\r\n	<li>With business partners: We may share Your information with Our business partners to offer You certain products, services or promotions.</li>\r\n	<li>With other users: when You share personal information or otherwise interact in the public areas with other users, such information may be viewed by all users and may be publicly distributed outside. If You interact with other users or register through a Third-Party Social Media Service, Your contacts on the Third-Party Social Media Service may see Your name, profile, pictures and description of Your activity. Similarly, other users will be able to view descriptions of Your activity, communicate with You and view Your profile.</li>\r\n	<li>With Your consent: We may disclose Your personal information for any other purpose with Your consent.</li>\r\n</ul>\r\n\r\n<h2>Retention of Your Personal Data</h2>\r\n\r\n<p>The Company will retain Your Personal Data only for as long as is necessary for the purposes set out in this Privacy Policy. We will retain and use Your Personal Data to the extent necessary to comply with our legal obligations (for example, if we are required to retain your data to comply with applicable laws), resolve disputes, and enforce our legal agreements and policies.</p>\r\n\r\n<p>The Company will also retain Usage Data for internal analysis purposes. Usage Data is generally retained for a shorter period of time, except when this data is used to strengthen the security or to improve the functionality of Our Service, or We are legally obligated to retain this data for longer time periods.</p>\r\n\r\n<h2>Transfer of Your Personal Data</h2>\r\n\r\n<p>Your information, including Personal Data, is processed at the Company’s operating offices and in any other places where the parties involved in the processing are located. It means that this information may be transferred to — and maintained on — computers located outside of Your state, province, country or other governmental jurisdiction where the data protection laws may differ than those from Your jurisdiction.</p>\r\n\r\n<p>Your consent to this Privacy Policy followed by Your submission of such information represents Your agreement to that transfer.</p>\r\n\r\n<p>The Company will take all steps reasonably necessary to ensure that Your data is treated securely and in accordance with this Privacy Policy and no transfer of Your Personal Data will take place to an organization or a country unless there are adequate controls in place including the security of Your data and other personal information.</p>\r\n\r\n<h2>Disclosure of Your Personal Data</h2>\r\n\r\n<h3>Business Transactions</h3>\r\n\r\n<p>If the Company is involved in a merger, acquisition or asset sale, Your Personal Data may be transferred. We will provide notice before Your Personal Data is transferred and becomes subject to a different Privacy Policy.</p>\r\n\r\n<h3>Law enforcement</h3>\r\n\r\n<p>Under certain circumstances, the Company may be required to disclose Your Personal Data if required to do so by law or in response to valid requests by public authorities (e.g. a court or a government agency).</p>\r\n\r\n<h3>Other legal requirements</h3>\r\n\r\n<p>The Company may disclose Your Personal Data in the good faith belief that such action is necessary to:</p>\r\n\r\n<ul>\r\n	<li>Comply with a legal obligation</li>\r\n	<li>Protect and defend the rights or property of the Company</li>\r\n	<li>Prevent or investigate possible wrongdoing in connection with the Service</li>\r\n	<li>Protect the personal safety of Users of the Service or the public</li>\r\n	<li>Protect against legal liability</li>\r\n</ul>\r\n\r\n<h2>Security of Your Personal Data</h2>\r\n\r\n<p>The security of Your Personal Data is important to Us, but remember that no method of transmission over the Internet, or method of electronic storage is 100% secure. While We strive to use commercially acceptable means to protect Your Personal Data, We cannot guarantee its absolute security.</p>\r\n\r\n<h1>Links to Other Websites</h1>\r\n\r\n<p>Our Service may contain links to other websites that are not operated by Us. If You click on a third party link, You will be directed to that third party’s site. We strongly advise You to review the Privacy Policy of every site You visit.</p>\r\n\r\n<p>We have no control over and assume no responsibility for the content, privacy policies or practices of any third party sites or services.</p>\r\n\r\n<h1>Changes to this Privacy Policy</h1>\r\n\r\n<p>We may update Our Privacy Policy from time to time. We will notify You of any changes by posting the new Privacy Policy on this page.</p>\r\n\r\n<p>We will let You know via email and/or a prominent notice on Our Service, prior to the change becoming effective and update the “Last Updated” date at the top of this Privacy Policy.</p>\r\n\r\n<p>You are advised to review this Privacy Policy periodically for any changes. Changes to this Privacy Policy are effective when they are posted on this page.</p>\r\n\r\n<p> </p>'),
(10, 'terms_conditions', '<h3><strong>NEW T&amp;C :</strong></h3>\r\n\r\n<ul>\r\n	<li><strong>Product will be only returned if you got it damaged or changed!</strong></li>\r\n</ul>\r\n\r\n<p><strong>Returning Process!</strong></p>\r\n\r\n<p>If you get damaged or changed product, mail us its image on support@booksbear.in. We will verify &amp; initiate return. Note : You have to verify your address by providing otp, and you have to stick a label on product given by us, It will be pickup and you will receive money within 3 days.</p>\r\n\r\n<h3> </h3>\r\n\r\n<h3><strong>Introduction.</strong><br />\r\nWelcome to BooksBear (“App / Site”). These are the terms and conditions governing your use of the Site (“herein after referred to as Acceptable Use Policy “AUP”). By accessing BooksBear either through the website, app or any other electronic device, you acknowledge, accept and agree to the following terms of the AUP, which are designed to make sure that BooksBear works for everyone. This AUP is effective from the time you log in to BooksBear. By accepting this AUP, you are also accepting and agreeing to be bound by the Privacy Policy and the Listing Policy.</h3>\r\n\r\n<p>BOOKSBEAR IS AN OPEN MARKETPLACE, WHERE ANYONE CAN SELL, BUY, RENT, DONATE BOOKS &amp; CAN ACCESS E-BOOKS. WE HOLD NO RESPONSIBILTY FOR PRODUCTS PIRACY, AS BOOKSBEAR DONOT SELL BOOKS, WE ONLY PROVIDE PLATFROM AND SERVICES [LIKE DOORSTEP PICKUP &amp; DELIVERY , ENSURING FRAUD FREE SELLING &amp; PURCHASING ,ETC .</p>\r\n\r\n<p> Using BooksBear.<br />\r\nYou agree and understand that BooksBear is an internet enabled electronic platform that facilitates communication for the purposes of advertising and distributing information pertaining to goods and/ or services. You further agree and understand that we do not endorse, market or promote any of the listings, postings or information, we engage in the distribution of any of the goods and/ or services, you have posted, listed or provided information about on our site, as our doorstep pickup &amp; delivery service. You can not directly contact to any seller or buyer directly, We did this to reduce the fraud chances .</p>\r\n\r\n<p>” Your Information”is defined as any information you provide to us or other users of the Site during the registration, posting,in the feedback area (if any), through the Help chatbot or in the course of using any other feature of the Services. You agree that you are the lawful owner having all rights, title and interest in your information, and further agree that you are solely responsible and accountable for Your Information and that we act as a mere platform for your online sell &amp; services.<br />\r\nYou agree that your listing, posting and / or Information :<br />\r\n• shall “not be fraudulent, misrepresent, mislead or pertain to the sale of any illegal, counterfeit, stolen goods and / or services<br />\r\n• shall not pertain to good , services of which you are not the lawful owner or you do not have the authority or consent to ‘list’ which do not belong to you or you do not have the authority for<br />\r\nshall not infringe any intellectual property, trade secret, or other proprietary right or rights of publicity or privacy of any third party;<br />\r\n• shall not consist of material that is an expression of bigotry, racism or hatred based on age, gender, race, religion, caste, class, lifestyle preference, and nationality and / or is in the nature of being derogatory, slanderous to any third party;<br />\r\n• shall not be obscene, contain pornography or contain “indecent representation of women” within the meaning of the Indecent Representation of Women (Prohibition) Act, 1986.<br />\r\n• shall not distribute or contain spam, multiple / chain letters, or pyramid schemes in any of its forms;<br />\r\n• shall not distribute viruses or any other technologies that may harm BooksBear or the interests or property of BooksBear users or impose an unreasonable load on the infrastructure or interfere with the proper working of BooksBear;<br />\r\n• shall not, directly or indirectly, offer, attempt to offer, trade or attempt to trade in any goods and services, the dealing of which is prohibited or restricted in any manner under the provisions of any applicable law, rule, regulation or guideline for the time being in force.<br />\r\n• shall not be placed in a wrong category or in an incorrect area of the site;<br />\r\n• shall not list or post or pertain to information that is either prohibited or restricted under the laws of the Republic of India and such listing, posting or information shall not violate BooksBear Listing Policy<br />\r\n• You consent to receive communications by email, call or by such other mode of communication, electronic or otherwise related to the services provided through the website.<br />\r\nYou agree that your listing, posting and / or Information :<br />\r\nIf you use the Site by registering on the Site, you are responsible for maintaining the confidentiality of your User ID, password, and email address and for restricting access to your computer, computer system, computer network and your BookFlow account, and you are responsible for all activities that occur under your User ID and password. If you access the Site using any electronic device other than by registration on the Site, the AUP remains applicable to you in the same manner as if you are a registered user on the Site.</p>\r\n\r\n<p>Eligibility<br />\r\nUse of BooksBear, either by registration or by any other means, is available only to persons, who are Citizens of the Republic of India, who are 12 yrs of age and above and persons who can enter into a legally binding contract, and or are not barred by any law for the time being in force. If you access BooksBear, either by registration on the Site or by any other means, not as an individual but on behalf of a legal entity, you represent that you are fully authorized to do so and the listing, posting or information placed on the site on behalf of the legal entity is your responsibility and you agree to be accountable for the same to other users of the Site.</p>\r\n\r\n<p>Content<br />\r\nThe Site contains content which includes Your Information [Only for sellers], BooksBear information and information from other users. You agree not to copy, modify, or distribute such content (other than Your Information), BookFlow copyrights or trademarks. When you give us any content as part of Your Information, you are granting us a non-exclusive, worldwide, perpetual, irrevocable, royalty-free, sub-licensable right and license to use, reproduce, publish, translate, distribute, perform and display such content (in whole or part) worldwide through the Site as well as on any of our affiliates or partners websites, publications and mobile platform. We need these rights with respect to the content in Your Information in order to host and display your content.<br />\r\nWe reserve the right to remove any such content where we have grounds for suspecting the violation of these terms and our Listing Policy or of any party’s rights.</p>\r\n\r\n<p>Liability<br />\r\nYou agree not to hold BooksBear or any of its officers, employees, agents responsible or accountable for any of your listing, postings or information and nor shall we, our officers, employees or agents be liable for any misuse, illegal activity or third party content as most postings, listings or information are generated by various users directly and we do not have any role in the creation, publication or distribution of the posting, listing or information, We don’t take any type responisibility on any product posted on BooksBear , as BooksBear is open for everyone, anyone across globe can buy, sell &amp; use other features of BooksBear, Still if you find any product violating your trademark or Copyright, You can write us at Support@booksBear.com , We will remove that product &amp; Take appropriate action on the seller.</p>\r\n\r\n<p>Personal Information<br />\r\nBy using BooksBear, you agree to the collection, transfer, storage and use of any personal information provided by you on the Site by BooksBear. The data is stored and controlled on our servers as further described in our Privacy Policy. You also agree to receive communications Mail from us unless you specifically indicate otherwise in writing to us through BooksBear.</p>\r\n\r\n<p>General</p>\r\n\r\n<p>We may update this AUP or the listing policy at any time and may notify you of such updates via a post on the boards and /or through email communications. The modified AUP and /or Listing Policy shall come into effect either at the time you place your next posting, listing or information on the Site or after a period of 30 days from the date of the update, whichever is sooner. If we or our corporate affiliates are involved in a merger or acquisition, we may share personal information with another company, but this AUP shall continue to apply.</p>\r\n\r\n<p>Third Party Content and Services</p>\r\n\r\n<p>BooksBear may provide, on its site, links to sites operated by other entities. If the user decides to view this site, they shall do so at their own risk, subject to that site’s terms and conditions of use and privacy policy that may be different from those of this site. It is the user’s responsibility to take all protective measures to guard against viruses or other destructive elements they may encounter on these sites. BooksBear makes no warranty or representation regarding, and do not endorse any linked website or the information appearing thereon or any of the products or services described thereon.</p>\r\n\r\n<p>Governing Law &amp; Jurisdiction</p>\r\n\r\n<p>This AUP and the Privacy Policy shall be governed and construed in accordance with the laws of the Republic of India and the High courts at Muzaffarpur shall have exclusive jurisdiction on all matters and disputes arising out of and relating to the Site.</p>\r\n\r\n<p> </p>'),
