(12, 'contact_us', '<h2><strong>Get in Touch:</strong></h2>\r\n\r\n<p>For any kind of queries related to products, orders or services feel free to contact us on our official email address or phone number as given below :</p>\r\n\r\n<h3><strong>Whatsapp us on :</strong></h3>\r\n\r\n<p><strong>+91 8986496851 [Normally Replies 24*7]</strong></p>\r\n\r\n<p> </p>\r\n\r\n<h3><strong>Call us on :</strong></h3>\r\n\r\n<p><strong>+91 9006810395 [ 6 am to 9 am, 1 pm to 9 pm]</strong></p>\r\n\r\n<p> </p>\r\n\r\n<h3><strong>Mail us on :</strong></h3>\r\n\r\n<p><strong>support@BooksBear.in </strong></p>\r\n\r\n<p> </p>\r\n\r\n<h3><strong>For Business Deals &amp; Collaboration :</strong></h3>\r\n\r\n<p><strong>Mayush@booksbear.in</strong></p>'),
(13, 'system_timezone', '{\"system_configurations\":\"1\",\"system_timezone_gmt\":\"+05:30\",\"system_configurations_id\":\"13\",\"app_name\":\"BooksBear\",\"support_number\":\"+91 9006810395\",\"support_email\":\"support@BooksBear.in\",\"current_version\":\"1.0.0\",\"minimum_version_required\":\"1.0.0\",\"is-version-system-on\":\"0\",\"store_address\":\"Bihar & Delhi\",\"map_latitude\":\"\",\"map_longitude\":\"\",\"currency\":\"u20b9\",\"system_timezone\":\"Asia/Kolkata\",\"max_cart_items_count\":\"1\",\"min_order_amount\":\"1\",\"area-wise-delivery-charge\":\"0\",\"min_amount\":\"1500\",\"delivery_charge\":\"60\",\"is-refer-earn-on\":\"1\",\"min-refer-earn-order-amount\":\"100\",\"refer-earn-bonus\":\"5\",\"refer-earn-method\":\"percentage\",\"max-refer-earn-amount\":\"50000\",\"minimum-withdrawal-amount\":\"1000\",\"max-product-return-days\":\"10\",\"delivery-boy-bonus-percentage\":\"\",\"low-stock-limit\":\"10\",\"user-wallet-refill-limit\":\"10000\",\"from_mail\":\"Mayush@booksbear.in\",\"reply_to\":\"support@booksbear.in\",\"generate-otp\":\"0\",\"smtp-from-mail\":\"\",\"smtp-reply-to\":\"\",\"smtp-email-password\":\"Mayush2211!\",\"smtp-host\":\"smtppro.zoho.in\",\"smtp-port\":\"465\",\"smtp-content-type\":\"html\",\"smtp-encryption-type\":\"ssl\"}'),
(15, 'about_us', '<p>BooksBear began as an idea to help students get the notes and books that are not available near them. Then we quickly planned BooksBear as a marketplace focused C2C for students and general public who seeks an opportunity to sell their old books instead of giving them to rag pickers. </p>\r\n\r\n<p>BooksBear aims to bring every possible book/notes/novels/stationary and more to our app for our clients to shop from a wide variety of books and to never get settled for less if thier area shops doesn&#39;t provide those books.</p>\r\n\r\n<p>At BooksBear we have kept in our vision that every one deserves education and we will help everyone achieve this. Donation at BooksBear is a very noble cause and we actively conduct book donation camps so the needy can get what is their basic rights i.e. education. </p>\r\n\r\n<p>Legally:<br />\r\nBooksBear is owned by parent company A&amp;A inc. based in India.</p>\r\n\r\n<p>What we do?</p>\r\n\r\n<p>–  In the journey we felt a huge issue related books, having books, having books which are not of our use burdening on shelf , Difficulty of getting books for a financially weak student due to high prices of books, we at bookshaala are trying to solve all these issues at a single mutual platform</p>\r\n\r\n<ol>\r\n	<li>Buy &amp; sell – In this section anyone can buy used/new books by sellers all across india or anyone can sell their old used books to students all across india without even leaving your door</li>\r\n</ol>\r\n\r\n<p>Benefits of selling used books</p>\r\n\r\n<ul>\r\n	<li> you will be helping people who cannot buy the book at its original price get it at a more pocket-friendly price.</li>\r\n	<li>Whether the books are in your closet, backpack, or just stacked somewhere on a table, they are consuming space that you could use for something else.</li>\r\n	<li>An online place like <strong>BooksBear</strong> offers Online places for selling books that offer you to price the books you want to sell using the books You won’t have to leave your home to go give the books or anything of the sort. As you can see, you will be saving time and making money simultaneously.</li>\r\n	<li>By selling your books, it means fewer trees will be cut to make more copies of the book. It is a form of recycling. Furthermore, you will be contributing to the reduction of landfill waste. As long as books are useful and relevant, they should be passed from one generation to the next.</li>\r\n	<li>You can buy new and useful books by selling your used books</li>\r\n</ul>\r\n\r\n<p>Benefits of buying old books</p>\r\n\r\n<ul>\r\n	<li>Very affordable almost half of the new book price</li>\r\n	<li>Increase Book life</li>\r\n	<li>By buying used books, it means fewer trees will be cut to make more copies of the book. It is a form of recycling. Furthermore, you will be contributing to the reduction of landfill waste. As long as books are useful and relevant, they should be passed from one generation to the next.</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li>‘HUMANITY EXIST’ Book donation- we have created a mutual platform for both the book donor and for someone who need donated books. Its free for everyone its open platform anyone can donate books here and any needy person can get it free of cost.</li>\r\n</ol>\r\n\r\n<p>how this works?</p>\r\n\r\n<ol>\r\n	<li>Book has been donated by someone</li>\r\n	<li>We will list that book on booksBear</li>\r\n	<li>Someone ordered the donated book</li>\r\n	<li>We will verify the person </li>\r\n	<li>After successful verification book will be shipped</li>\r\n	<li>We will pickup the book from the donor and deliver that to the receiver.</li>\r\n</ol>\r\n\r\n<p> </p>\r\n\r\n<p>Benefits</p>\r\n\r\n<ul>\r\n	<li>When you donate your books, you allow the opportunity to let those texts have new life. Whether they end up in the hands of a young teen looking for an exciting new story to read, or they become part of a collection on someone else’s shelf, donating your books expands their purpose and influence in a fascinating way.</li>\r\n	<li>By donating (30 books), you will help to reduce 85kg of carbon footprint</li>\r\n	<li>A ton of recycled paper saves 17 trees.</li>\r\n	<li>In 1993, U.S. paper recovery saved more than 90,000,000 cubic yards of landfill space. It’s our turn in India.</li>\r\n	<li>There are people who cannot access books. They can get books at FREE OF COST anywhere across India.</li>\r\n	<li>The happiness and satisfaction You will feel by helping is more than anything else.</li>\r\n</ul>\r\n\r\n<p>why there is delivery charge</p>\r\n\r\n<ul>\r\n	<li>Donated book will be free of cost for everyone, but the receiver have to pay the delivery charges, because delivery will be done by 3rd party company , No extra cost will be taken by bookshala ,delivery charges will be transparent, </li>\r\n</ul>\r\n\r\n<p><em>NOTE- booksbear will bare the maintaince charge &amp; extra handling charge.</em></p>\r\n\r\n<ol>\r\n	<li>RENTAL LIBRARY- Here you can rent book and have to pay only the rent price, This will allow you to get any book at home at as less as 10% of the cost.</li>\r\n</ol>\r\n\r\n<p> </p>\r\n\r\n<p>How this work?</p>\r\n\r\n<ol>\r\n	<li>Choose the book from the inventory </li>\r\n	<li>Order it as usual by paying total amount</li>\r\n	<li>After ordering you will get a form in which you have tot select the time period of renting the book</li>\r\n	<li>After  using the book for the selected time period</li>\r\n	<li>Return the book to us on the time</li>\r\n	<li>We will refund all the amount , rental cost will be deducted only. Eg book cost is 2000 , rental cost is 200 you will get 1800 </li>\r\n	<li>Fine will be deducted depending on book condition </li>\r\n	<li>Returning the book to us is your responsibility.</li>\r\n</ol>\r\n\r\n<p> </p>\r\n\r\n<p>Benefits</p>\r\n\r\n<ul>\r\n	<li>It will increase book life</li>\r\n	<li>Eventually help in saving trees</li>\r\n	<li>One can get hardcopy books at as low as 10% of the price</li>\r\n	<li>Simplify access of expensive books</li>\r\n</ul>\r\n\r\n<p> </p>\r\n\r\n<ol>\r\n	<li>E-books –  This is a special dedicated section for new generation budies , here you will find many free E-books to read, This is another initiative by us toward society , anyone can read books her free of cost</li>\r\n</ol>\r\n\r\n<p> </p>\r\n\r\n<p>Benifits</p>\r\n\r\n<ul>\r\n	<li>Enables Flexible Reading. The eBooks offer learners the luxury of reading content anywhere and anytime</li>\r\n	<li>eBooks Are Portable. Though the printed textbooks are heavy and cumbersome to carry every time, eBooks are quite portable</li>\r\n	<li>Allows Students to Customize, bookmark a Page</li>\r\n	<li>It Has Multiple Interactive Feature</li>\r\n</ul>\r\n\r\n<p> </p>\r\n\r\n<p>Our aim and vision</p>\r\n\r\n<p>“Every deserving student will get education, We dont care how long it will take or how much energy it will take, but we can promise  one thing that together one day we can put a positive impact towards the society” – Mayush Ayush [Owner &amp; Founder]</p>\r\n\r\n<p> </p>\r\n\r\n<p>Knowledge is the most powerful weapon that one can have. So, we aim to make India more powerful by sharing the gift of knowledge from those who supply it to those who need it. Knowledge is not something to hide its a blessing to share</p>\r\n\r\n<p>                  Our aim is to  provide the users the best and easy to access free platform that will bind them with Booksbear forever. We want to be their first choice for donating,renting &amp; buying books</p>\r\n\r\n<p>                  Proudly we are indias first platform to having all these feature at a same place and the most convenient and easy to use and easily accessable platform, we are not here to maximising the profit , we are here to put  a positive impact in the society.</p>'),
